-- -----------------------------
-- Table structure for `tp_line`
-- -----------------------------
DROP TABLE IF EXISTS `tp_line`;
CREATE TABLE `tp_line` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `category_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '分类',
  `title` char(60) NOT NULL DEFAULT '' COMMENT '名称',
  `sellpoint` char(160) NOT NULL DEFAULT '' COMMENT '卖点',
  `lineday` int(5) NOT NULL DEFAULT '0' COMMENT '线路天数',
  `linenight` int(5) NOT NULL DEFAULT '0' COMMENT '多少晚',
  `sellprice` decimal(11,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '价格',
  `startcity` varchar(200) NOT NULL COMMENT '出发城市',
  `overcity` varchar(200) NOT NULL COMMENT '目的城市',
  `linebefore` int(11) NOT NULL DEFAULT '0' COMMENT '提前报名天数',
  `price` decimal(11,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '报价',
  `price_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '最新价格时间',
  `phone` varchar(20) NOT NULL DEFAULT '' COMMENT '联系电话',
  `images` varchar(255) NOT NULL DEFAULT '' COMMENT '封面图片',
  `photo` text COMMENT '相册',
  `photo_count` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '相册图片数量',
  `video` char(255) NOT NULL DEFAULT '' COMMENT '短视频',
  `content` text COMMENT '行程安排',
  `notice` text COMMENT '注意事项',
  `feeinclude` longtext NOT NULL COMMENT '费用包含',
  `feenotinclude` longtext NOT NULL COMMENT '费用不包含',
  `constraints` longtext NOT NULL COMMENT '出游人限制',
  `contract` longtext NOT NULL COMMENT '合同条款',
  `access_count` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '访问次数',
  `sales_count` int(11) NOT NULL DEFAULT '0' COMMENT '销售数量',
  `recommend` tinyint(1) NOT NULL DEFAULT '0' COMMENT '首页推荐（0否, 1是）',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '2' COMMENT '运营审核 0=禁用 1=通过 2审核中 3审核失败 4修改资料',
  `tourism_status` tinyint(1) unsigned NOT NULL DEFAULT '2' COMMENT '文旅审核 1=通过 2审核中 3不通过',
  `delete_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '是否已删除（0 未删除, 大于0则是删除时间）',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `tags` varchar(50) NOT NULL DEFAULT '' COMMENT '线路景点',
  `flag` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '所属 1=运营创建   2=旅行社创建',
  `mid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '旅行社商户',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `title` (`title`) USING BTREE,
  KEY `access_count` (`access_count`) USING BTREE,
  KEY `photo_count` (`photo_count`) USING BTREE,
  KEY `is_shelves` (`status`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='线路-信息-基表';


