  `create_ip` varchar(64) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT 'IP地址',
  `name` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT '投诉人',
  `uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '用户ID',
  `content` text COLLATE utf8_unicode_ci COMMENT '投诉、建议内容',
  `images` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '图片信息',
  `mobile` varchar(20) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '手机号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='用户-信息-投诉反馈';


