-- -----------------------------
-- Table structure for `tp_coupon_order_item`
-- -----------------------------
DROP TABLE IF EXISTS `tp_coupon_order_item`;
CREATE TABLE `tp_coupon_order_item` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uuid` varchar(40) DEFAULT '0' COMMENT '消费券用户编号',
  `order_no` varchar(36) DEFAULT '' COMMENT '消费券订单单号',
  `coupon_uuno` varchar(36) DEFAULT '' COMMENT '消费券编号',
  `coupon_cid` int(11) NOT NULL DEFAULT '0' COMMENT '消费券所属分类ID',
  `coupon_title` varchar(200) DEFAULT '' COMMENT '消费券名称',
  `coupon_price` decimal(10,2) DEFAULT '0.00' COMMENT '消费券面额',
  `coupon_icon` varchar(500) DEFAULT '' COMMENT '封面图片',
  `coupon_sale_price` decimal(20,2) DEFAULT '0.00' COMMENT '市场单价 = 消费券销售价格',
  `total_market` decimal(20,2) DEFAULT '0.00' COMMENT '市场总价',
  `price_selling` decimal(20,2) DEFAULT '0.00' COMMENT '销售单价 = 消费券销售价格',
  `total_selling` decimal(20,2) DEFAULT '0.00' COMMENT '销售总价',
  `stock_sales` bigint(20) DEFAULT '1' COMMENT '消费券包含数量',
  `discount_amount` decimal(20,2) DEFAULT '0.00' COMMENT '优惠金额',
  `status` tinyint(1) DEFAULT '0' COMMENT '状态(1已使用,0未使用)',
  `deleted` tinyint(1) DEFAULT '0' COMMENT '删除状态(0未删,1已删)',
  `update_time` int(11) DEFAULT '0' COMMENT '订单创建时间',
  `create_time` int(11) DEFAULT '0' COMMENT '订单创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_shop_order_item_status` (`status`) USING BTREE,
  KEY `idx_shop_order_item_deleted` (`deleted`) USING BTREE,
  KEY `idx_shop_order_item_order_no` (`order_no`) USING BTREE,
  KEY `coupon_cid` (`coupon_cid`),
  KEY `uuid` (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='消费券-订单-消费券';


-- -----------------------------
-- Table structure for `tp_coupon_order`
-- -----------------------------
DROP TABLE IF EXISTS `tp_coupon_order`;
CREATE TABLE `tp_coupon_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `openid` varchar(40) NOT NULL COMMENT '小程序openid',
  `uuid` varchar(50) NOT NULL DEFAULT '0' COMMENT '下单用户编号uuid',
  `mch_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单所属商户',
  `order_no` varchar(30) NOT NULL DEFAULT '' COMMENT '订单编号 = 内部订单编号',
  `order_out_no` varchar(33) NOT NULL COMMENT '订单编号 = 外部调用编号',
  `origin_price` decimal(10,2) NOT NULL COMMENT '订单原来的价格 = 数量*单价',
  `amount_price` decimal(20,2) DEFAULT '0.00' COMMENT '消费券统计金额 = 实际要去支付的金额',
  `payment_code` varchar(20) DEFAULT '' COMMENT '实际渠道编号 = 支付配置主键ID',
  `payment_trade` varchar(80) DEFAULT '' COMMENT '实际支付单号 = 微信支付生成的单号',
  `payment_status` tinyint(1) DEFAULT '0' COMMENT '实际支付状态  1=已支付  0=未支付 2=已退款',
  `payment_image` varchar(999) DEFAULT '' COMMENT '支付凭证图片',
  `payment_remark` varchar(500) DEFAULT '' COMMENT '支付结果描述',
  `payment_datetime` char(15) DEFAULT '0' COMMENT '支付到账时间 = 微信返回',
  `number_count` int(11) DEFAULT '0' COMMENT '订单数量',
  `order_remark` varchar(999) DEFAULT '' COMMENT '订单用户备注',
  `cancel_status` tinyint(1) DEFAULT '0' COMMENT '订单取消状态  1=是 0=否',
  `cancel_remark` varchar(200) DEFAULT '' COMMENT '订单取消描述',
  `cancel_datetime` int(11) DEFAULT '0' COMMENT '订单取消时间',
  `deleted_status` tinyint(1) DEFAULT '0' COMMENT '订单删除状态 1=已删  0=未删',
  `deleted_remark` varchar(255) DEFAULT '' COMMENT '订单删除描述',
  `deleted_datetime` int(11) DEFAULT '0' COMMENT '订单删除时间',
  `is_refund` int(11) NOT NULL COMMENT '订单退款状态  1=退款中 0= 表示未退款 2=已退款',
  `status` tinyint(1) DEFAULT '1' COMMENT '订单流程状态(0已取消,,1已下单=待支付,3支付中,4已支付,5已完成)',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '订单创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '订单更新时间',
  `issue_coupon_user_id` varchar(20) NOT NULL COMMENT '领取记录ID串',
  `payment_data_id` int(11) NOT NULL DEFAULT '0' COMMENT '支付记录交易数据ID',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_shop_order_status` (`status`) USING BTREE,
  KEY `idx_shop_order_orderno` (`order_no`) USING BTREE,
  KEY `idx_shop_order_cancel_status` (`cancel_status`) USING BTREE,
  KEY `idx_shop_order_payment_status` (`payment_status`) USING BTREE,
  KEY `idx_shop_order_deleted` (`deleted_status`) USING BTREE,
  KEY `idx_shop_order_mid` (`uuid`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='消费券-订单-内容';


-- -----------------------------
-- Table structure for `tp_coupon_issue_user`
-- -----------------------------
DROP TABLE IF EXISTS `tp_coupon_issue_user`;
CREATE TABLE `tp_coupon_issue_user` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '领取时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '领取人',
  `issue_coupon_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券ID',
  `coupon_title` varchar(255) NOT NULL DEFAULT '' COMMENT '消费券标题',
  `coupon_price` decimal(10,0) unsigned NOT NULL DEFAULT '0' COMMENT '消费券面额',
  `use_min_price` decimal(10,0) unsigned NOT NULL DEFAULT '0' COMMENT '最低消费多少可使用优惠券',
  `coupon_create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券创建时间',
  `time_start` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券开启时间',
  `time_end` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券结束时间',
  `time_use` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券使用时间',
  `status` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '状态（0：未使用，1：已使用, 2:已过期）',
  `is_fail` varchar(255) NOT NULL DEFAULT '' COMMENT '是否有效',
  `is_limit_total` tinyint(1) NOT NULL COMMENT '是否限制领取  1=是 0=否',
  `issue_coupon_class_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券种类',
  `enstr_salt` text NOT NULL COMMENT '数据加密串',
  `qrcode_url` varchar(200) NOT NULL DEFAULT '' COMMENT '领取二维码图片地址',
  `code_time_create` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '加密串生成时间',
  `code_time_expire` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '加密串过期时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `uid` (`uid`),
  KEY `issue_coupon_id` (`issue_coupon_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='消费券-用户-领取记录';


-- -----------------------------
-- Table structure for `tp_coupon_issue`
-- -----------------------------
DROP TABLE IF EXISTS `tp_coupon_issue`;
CREATE TABLE `tp_coupon_issue` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uuno` varchar(36) NOT NULL COMMENT '消费券唯一标识编号',
  `cid` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '所属分类',
  `coupon_title` varchar(50) NOT NULL DEFAULT '' COMMENT '消费券名称',
  `coupon_icon` varchar(100) NOT NULL DEFAULT '' COMMENT '消费券图标',
  `limit_time` tinyint(1) NOT NULL COMMENT '是否限时  1=限时  0=不限时',
  `start_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券领取开启时间',
  `end_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '消费券领取结束时间',
  `total_count` int(10) NOT NULL DEFAULT '0' COMMENT '消费券领取数量',
  `remain_count` int(10) NOT NULL DEFAULT '0' COMMENT '消费券剩余领取数量',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1 正常 0 未开启 -1 已无效  2=已领完',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `coupon_price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '兑换的消费券面值',
  `is_threshold` tinyint(1) NOT NULL COMMENT '是否有门槛  1=是  0=否',
  `use_min_price` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '最低消费多少金额可用消费券',
  `is_permanent` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '有效期设置',
  `coupon_time_start` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '有效期开始时段',
  `coupon_time_end` int(11) NOT NULL COMMENT '有效期结束时段',
  `class_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '栏目类型 1=通用 2=门票 3=线路 4=商品',
  `type` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '消费券类型 1=通用 2=品类券 3=商品券',
  `product_id` varchar(64) NOT NULL DEFAULT '' COMMENT '所属商品id 根据消费类型选择不同的商品ID',
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类id 根据消费类型选择不同的分类ID',
  `receive_type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1 手动领取，2 新人券，3赠送券，4会员券',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `remark` text COMMENT '备注=使用细则',
  `last_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后修改时间',
  `tag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否在首页展示  1=是  0=否',
  `is_limit_total` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否限量   1=是  0=否',
  `limit_total` tinyint(1) NOT NULL DEFAULT '0' COMMENT '单人限制领取数量',
  `use_store` tinyint(1) NOT NULL DEFAULT '1' COMMENT '使用门店  1=通用  2=景区  3=旅行社 4=剧院 5=影院',
  `use_stroe_id` varchar(200) NOT NULL DEFAULT '' COMMENT '门店ID  如果use_store=1 则等于0   否则为门店ID  如果use_store不等于1 则等于0时为具体某个分类的全部商家',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `sale_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '购买价格',
  `is_get` tinyint(10) unsigned NOT NULL DEFAULT '0' COMMENT '是否可领取',
  `tips` varchar(200) NOT NULL DEFAULT '' COMMENT '不可领取的提示语',
  `day` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '天数',
  `pid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '父级ID',
  `is_rollback` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否回滚数据  1=需要回滚数据  0=不需要回滚  2=已经回滚数据',
  `rollback_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '回滚数量',
  `coupon_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '券类型 1=通用  2=散客 3=团体',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `cid` (`cid`) USING BTREE,
  KEY `start_time` (`start_time`,`end_time`) USING BTREE,
  KEY `remain_count` (`remain_count`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `coupon_time` (`coupon_time_start`) USING BTREE,
  KEY `is_del` (`is_del`) USING BTREE,
  KEY `uuno` (`uuno`),
  KEY `use_stroe_id` (`use_stroe_id`),
  KEY `receive_type` (`receive_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='消费券-基础-内容表';


-- -----------------------------
-- Table structure for `tp_coupon_class`
