  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '交易ID',
  `appid` char(32) NOT NULL COMMENT '小程序ID',
  `mch_id` char(32) NOT NULL COMMENT '商户号',
  `order_no` char(50) NOT NULL COMMENT '订单ID',
  `out_refund_no` char(32) NOT NULL,
  `total_fee` char(8) NOT NULL COMMENT '订单金额 ',
  `refund_fee` char(8) NOT NULL COMMENT '申请退款金额',
  `refund_desc` varchar(255) NOT NULL COMMENT '退款原因',
  `model` varchar(50) NOT NULL COMMENT '模型',
  `refund_ip` char(30) NOT NULL DEFAULT '' COMMENT '支付IP',
  `return_code` char(16) NOT NULL COMMENT '返回状态码',
  `result_code` char(32) NOT NULL COMMENT '业务结果',
  `transaction_id` char(32) NOT NULL COMMENT '微信支付订单号',
  `refund_id` char(32) NOT NULL COMMENT '微信退款单号',
  `settlement_refund_fee` char(32) NOT NULL COMMENT '退款金额',
  `refund_status` varchar(20) NOT NULL COMMENT '退款状态',
  `success_time` varchar(32) NOT NULL COMMENT '退款成功时间',
  `refund_recv_accout` varchar(255) NOT NULL COMMENT '退款入账账户',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态: 0待退款 1 退款成功 2退款失败',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `trade_sn` (`order_no`,`total_fee`,`status`,`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='基础-退款-交易数据';


-- -----------------------------
-- Table structure for `tp_base_payment`
