-- -----------------------------
-- Table structure for `tp_accounting`
-- -----------------------------
DROP TABLE IF EXISTS `tp_accounting`;
CREATE TABLE `tp_accounting` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `sort` mediumint(8) DEFAULT '50' COMMENT '排序',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '运营审核   1=通过  0=待上传资料  2=不通过 3=待审核',
  `write_off_ids` varchar(255) NOT NULL DEFAULT '' COMMENT '核销记录ID',
  `mid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商户ID',
  `remarks` text COMMENT '备注信息',
  `sum_coupon_price` decimal(10,0) unsigned NOT NULL DEFAULT '0' COMMENT '核算金额',
  `writeoff_total` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '核算记录数',
  `card_name` varchar(200) NOT NULL DEFAULT '' COMMENT '收款账号',
  `card_deposit` varchar(200) NOT NULL DEFAULT '' COMMENT '开户行',
  `cart_number` varchar(200) NOT NULL DEFAULT '' COMMENT '卡号',
  `sup_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '监管单位审核  1=通过  0=待审核  2=不通过',
  `back_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '银行打款        1=已付款  0=待付款  2=拒绝付款',
  `sup_card` varchar(200) NOT NULL COMMENT '监管单位上传附件地址',
  `back_card` varchar(200) NOT NULL COMMENT '银行打款凭据地址',
  `class_id` tinyint(10) unsigned NOT NULL DEFAULT '0' COMMENT '商家分类',
  `area` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属区域',
  `nickname` varchar(100) NOT NULL DEFAULT '' COMMENT '商户名称',
  `no` varchar(100) NOT NULL DEFAULT '' COMMENT '结算单号',
  `data_url` text COMMENT '申请材料明细文件地址',
  `data_detail` varchar(255) NOT NULL DEFAULT '' COMMENT '申请资料明细url',
  `tour_status` tinyint(10) unsigned NOT NULL DEFAULT '0' COMMENT '文旅审核',
  `tags` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '结算类型  1=团申请  0=散客申请',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='消费券-散客-核算';

