INSERT INTO `tp_system` VALUES ('1', '1580560560', '1677754085', '榆林市文旅电子消费劵发放平台', '', '陕ICP备19022518号-1', 'Copyright ©榆林大数据有限公司 2022. ', 'xfq.dianfengcms.com', '榆林大数据有限公司', 'X先生', '09123358881', '19909122099', '010-8888 9999', '1103398780@qq.com', '1103398780', '', '榆林市文旅电子消费劵发放平台', '榆林市文旅电子消费劵发放平台', '榆林市文旅电子消费劵发放平台', '0', '0', '0', '0', '1', 'default', 'html', '', '2', '0', 'rar,zip,avi,rmvb,3gp,flv,mp3,mp4,txt,doc,xls,ppt,pdf,xls,docx,xlsx,doc,png,jpg,jpeg', '0', 'jpg,png,gif,jpeg,ico', '0', '1', 'wxc15821e9355cf967', 'b9e2ce9519db884b053ab1ea17ab82d7', '1677761285', 'LIKLckvwlJT9cWIhEQTwfPPhJmKFavK9R-ofDcuFsQ3_MS69WiIqGCLxHt1G2K7G5kyveXKjKfPaE3wsADGfBg', '66_XdfeoTYXljAU_ppzHiLveogC0rnMSvsV6_nJRXjvqnnMXOae44CB8CJ9ELdmgLPz8HDs4AcS0nsgIl-c4ArDX3kQT8D9clhvomI-wPWgbm4ATpzu-grM8Ul57FkKNOaAFADGH', '1677754085', '<p>&nbsp;&nbsp;&nbsp;一、消费券具体信息</p>\n\n<p>&nbsp; &nbsp; &nbsp; （一）消费券名称：&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （二）发放对象；榆林市民和来榆游客。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （三）.发行平台：微信小程序&ldquo;畅游榆林&rdquo;。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （四）消费券类别：畅游消费券（全市A级旅游景区、乡村旅游示范村、文化产业&ldquo;十百千&rdquo;工程等门票及体验项目）、剧院消费券（榆林大剧院、神木大剧院及榆林剧院剧目演出票）、旅行消费券（在榆注册旅行社及旅行社分社提供的旅游线路）、观影消费券（各县市区电影院观影票）。</p>\n\n<p>二、消费劵商户权利与义务</p>\n\n<p>&nbsp; &nbsp; &nbsp;（一）各商户需是在榆林依法注册设立的商户（包括公司、合伙企业和个体工商户），经营状况及信用良好，无重大失信、违法违规等行为，无发生重大人身安全责任事故。所提供的注册备案申请材料、营业执照、经营许可证等商户信息真实有效。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （二）各商户须严格按照消费券发行文件、实施细则和商户使用手册要求，做好自身营销活动，不变相加价、不以虚假商业信息欺骗、误导消费者。提供符合行业标准的优质产品，保证消费者在享受优惠的同时不影响服务质量，严格兑现服务承诺。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （三）各商户须严格遵循合法、自愿、公平、诚信原则，积极参于2023年&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券活动，通过LED、店内海报等多种方式配合做好营销宣传工作，主动向消费者做好活动的解释及引导工作。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （四）各商户通过发行平台进行商户入驻、产品上架，做好客户接待服务、核销工作等，按照发行要求实时完成接待任务。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;（五）各商户需做好消费券发行以及自身营销活动的宣传解释，不得变相加价、不得以虚假商业信息欺骗或误导消费者。因所提供的产品和服务引发的消费者投诉或争议，乙方自行解决并承担由此产生的责任，甲方有权对乙方的相关行为进行追责。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;（六）各商户需及时在发行平台提交消费券使用过程中产生的真实凭证。全市A级旅游景区、乡村旅游示范村、文化产业&ldquo;十百千&rdquo;工程、剧院、影院提交系统核销账单确认件（确保系统抓取定位符合实际定位范围，否则不予兑付）。旅行社提交系统核销账单确认件、旅游合同、保单、游客在各景区的合影照片、住宿发票及水单（游客完成酒店定位打卡，旅行社确保系统抓取定位符合实际定位范围，否则不予兑付）。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （七）各商户需确保相关消费券核销记录、打卡记录的真实有效，不得以任何形式自行篡改数据或伪造数据，不得以任何方式协助他人虚假交易，保证每张文旅电子消费券与实际交易信息相符。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （八）各商户需严格落实企业安全生产主体责任，加强经营场所的各类安全隐患排查，防止各类安全生产事故的发生，足额购买相应保险，保障消费者的人身安全。并严格落实&ldquo;五位一体&rdquo;防疫措施，统筹做好消费促进和疫情防控工作。</p>\n\n<p>三、服务承诺</p>\n\n<p>&nbsp; &nbsp; &nbsp; （一）信誉承诺。本公司为在榆依法注册，经营状况及信用良好，无重大失信、违法违规等行为，无发生重大人身安全责任事故。所提供的公司注册备案申请材料、营业执照、经营许可证等信息真实有效。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （二）安全承诺。严格落实企业安全生产主体责任，加强经营场所的各类安全隐患排查，防止各类安全生产责任事故的发生，足额购买相应保险，保障消费者的人身及财产安全。</p>\n\n<p>&nbsp; &nbsp; &nbsp; （三）产品承诺。严格按照消费券发行文件要求，为广大消费者提供优质产品及服务，不变相加价、不以虚假商业信息欺骗、误导消费者。</p>\n\n<p>&nbsp; &nbsp; （四）服务承诺。严格按照消费券发行文件要求，提供符合行业标准的配套服务，保证消费者在享受优惠的同时不影响服务质量。</p>\n\n<p>&nbsp; &nbsp;（五）责任承诺。严格落实2022年榆林市文旅电子消费券核销规则，杜绝出现刷单等违法违规交易。对举报、投诉及争议等事宜积极主动配合相关部门做好沟通、解释、协调等处理工作，确保消费者合法权益。因本公司提供的产品及服务问题引发的用户投诉或争议，由本公司自行解决。</p>\n\n<p><span style=\"display: none;\">&nbsp;&nbsp;</span></p>\n', '<p style=\"text-align: center;\">关于个人信息收集使用的同意书</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 榆林旅投旅游集散中心有限公司（下称本公司）&ldquo;畅游榆林&rdquo;小程序系统（下称系统）需要收集与使用用户的个人信息，根据《中华人民共和国网络安全法》等相关法规，特告知如下：</p>\n\n<p>请仔细阅读并理解文本件全部内容之后，决定是否同意并使用本公司系统的各项服务；如果您仍决定使用本公司系统的各项服务，则视为您同意执行本同意书。</p>\n\n<p>第1条 定义</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;1.1 &ldquo;用户&rdquo;：使用本公司系统的自然人。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;1.2 &ldquo;本公司&rdquo;：运营及管理系统的榆林旅投旅游集散中心有限公司。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;1.3. &ldquo;系统&rdquo;：需要收集和使用个人信息的本公司系统。该系统的功能范围可能不断扩展、调整。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;1.4 &ldquo;个人信息&rdquo;：指以电子或其他方式记录的能够单独或与其他信息结合识别自然人身份的各种信息，包括与确定自然人相关的位置、行为等信息，如手机号码、身份证号、商户名称、统一社会信用代码、法定代表人/经营者等。</p>\n\n<p>第2条 个人信息内容和目的</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 2.1 个人信息内容见1.4条。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 2.2 收集/利用的目的</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; （1）识别个人信息主体；</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; （2）实现系统的核心功能；</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; （3）提供与产品和服务相关的咨询或邀请，提供用户有利的信息，处理用户投诉等争议理。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2.3 个人信息收集最小化，本公司不收集超出个人信息必须范围的个人敏感信息，例如财产、健康，生活隐私等个人敏感信息。如确有正当业务需要，应经用户同意后进行最小化的收集和存储。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2.4 用户享有对个人信息的访问、更正、删除个人信息、注销账户等权利。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2.5 本公司收集的个人信息不会用于直接商业营销。</p>\n\n<p>第3条 个人信息的储存和使用时间</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3.1 用户使用系统期间。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3.2 从个人信息收集日开始一直到业务关系终止为止。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3.3 本公司获取的个人所有信息，除了以上提及的收集/使用目的或法律规定的使用目的以外，不会用于其它用途。依据相关法规，如无正当的理由继续保存个人信息，或者个人信息收集使用目的已经达成，本公司会即时删除相关个人信息。用户如要求删除个人信息，且相关法规规定不要求保存此类个人信息时，自接收到用户删除要求后，本公司会于一周内删除所有个人信息。</p>\n\n<p>第4条 拒绝同意权利</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4.1 用户可拒绝接受收集和利用个人信息，但因此而无法实现与本公司的正常业务往来，甚至导致系统无法使用、合同无法正常履行的，所带来的负面后果由用户承担，请审慎留意。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 4.2 用户同意签署此同意书，即表示已仔细阅读并理解以上所有事项，同意相关个人信息的收集和使用。</p>\n\n<p>第5条 个人信息出境</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;系统相关收集和产生的个人信息不会出境。</p>\n\n<p>第6条 同意书的效力和变更</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;6.1 本同意书从用户同意之日起开始生效。&nbsp;如本同意书签署之前，用户已经使用本公司系统的，则本同意书的签署同时视为对之前已经发生的个人信息收集与利用的同意。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 6.2 本公司保留运营或者营业上有重要原因时，对本同意书进行修改的权利。但即使修改也会在《中华人民共和国网络安全法》及其相关法规允许的范围内进行修订。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 6.3 如对本同意书进行修订，本公司将提前至少7天将修订内容、实施时间、修订原因公布在公司系统首页。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 6.4 用户有权利拒绝同意修订。在用户拒绝同意修订的情况下，本公司有权利终止相关服务，禁止用户登录。</p>\n\n<p>第7条 争议的解决与联系方式</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;7.1 本同意书的订立、执行和争议的解决均应适用中华人民共和国法律。</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;7.2 如双方就本同意书内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向本公司所在地有管辖权的人民法院提起诉讼。</p>\n\n<p>&nbsp; &nbsp; &nbsp; 7.3 本公司保留对同意书的解释和修改权利。</p>\n\n<p>&nbsp; &nbsp; &nbsp; 7.4 本公司未行使本协议的任何权利或规定，不构成对前述权利之放弃。</p>\n\n<p>&nbsp; &nbsp; &nbsp; 7.5 如本同意书中的任何条款完全或部分无效，本同意书的其余条款仍有效并且有约束力。</p>\n\n<p>&nbsp; &nbsp; &nbsp; 7.6 若您对本同意书的内容、执行有其它疑问、建议、意见等，欢迎通过下列方式与本公司联系：陕西省榆林市高新技术产业园区榆溪大道高科城C座4层</p>\n\n<p>第8条 附则</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;本同意书可通过纸质签署，亦可通过用户登录点击确认等方式签署，均具有同等法律效力。</p>\n', '<p style=\"text-indent: 2em;\">一、活动主题</p>\n\n<p style=\"text-indent: 2em;\">&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券</p>\n\n<p style=\"text-indent: 2em;\">二、活动时间</p>\n\n<p style=\"text-indent: 2em;\">2023年03月3日-05月15日</p>\n\n<p style=\"text-indent: 2em;\">三、组织机构</p>\n\n<p style=\"text-indent: 2em;\">（一）主办单位：榆林市人民政府</p>\n\n<p style=\"text-indent: 2em;\">（二）承办单位：榆林市市委宣传部&nbsp; 榆林市财政局&nbsp; 榆林市文化和旅游局&nbsp;</p>\n\n<p style=\"text-indent: 2em;\">四、活动内容</p>\n\n<p style=\"text-indent: 2em;\">（一）票券类型：畅游消费券、旅行消费券、剧院消费券、观影消费券</p>\n\n<p style=\"text-indent: 2em;\">（二）发放对象：全市居民和来榆游客</p>\n\n<p style=\"text-indent: 2em;\">（三）领券时间：每周五上午9:00~12:00</p>\n\n<p style=\"text-indent: 2em;\">（四）票券有效期：每个发放周期有效期为7天，领券后在有效期内核销使用，过期自动作废。</p>\n\n<p style=\"text-indent: 2em;\">五、票券细则</p>\n\n<p style=\"text-indent: 2em;\">（一）领取方式</p>\n\n<p style=\"text-indent: 2em;\">1.微信搜索&ldquo;畅游榆林&rdquo;进入小程序；</p>\n\n<p style=\"text-indent: 2em;\">2.进入小程序界面之后选取对应的消费券；</p>\n\n<p style=\"text-indent: 2em;\">3.下滑至最后点击&ldquo;立即领取&rdquo;，即领取成功。</p>\n\n<p style=\"text-indent: 2em;\">（二）使用方式</p>\n\n<p style=\"text-indent: 2em;\">1、微信搜索&ldquo;畅游榆林&rdquo;进入小程序，</p>\n\n<p style=\"text-indent: 2em;\">2、在右下角〖我的〗订单中点击〖未使用〗查找对应的消费券，出示二维码，商家扫码核销。</p>\n\n<p style=\"text-indent: 2em;\">（三）其他细则</p>\n\n<p style=\"text-indent: 2em;\">1.同一设备、同一手机号、同一身份证号等任一条件的，均视为同一用户。</p>\n\n<p style=\"text-indent: 2em;\">2.每个活动周期，每种消费券每人限领取1张，名额有限，先领先得，领完为止。有效期内使用，逾期作废，不予补偿。</p>\n\n<p style=\"text-indent: 2em;\">3.所有票券不设找零，不可提现。</p>\n\n<p style=\"text-indent: 2em;\">六、用户权益</p>\n\n<p style=\"text-indent: 2em;\">1.商家无正当理由拒绝消费者使用消费券者，消费者可依法向有关部门进行投诉。</p>\n\n<p style=\"text-indent: 2em;\">2.消费者使用消费券购买商品或者接受服务后，发现有欺诈行为的，有权要求商家进行赔偿。</p>\n\n<p style=\"text-indent: 2em;\">七、特别声明</p>\n\n<p style=\"text-indent: 2em;\">严禁商户和个人以任何不正当手段套取消费券利益，禁止将榆林市文旅消费券用作其他用途，如查实将依法追究责任。</p>\n\n<p style=\"text-align: center;\">文旅消费券最终解释权归榆林市文化和旅游局。</p>\n', '6m09sEviPM0WBqDWSdQnag==', '0', '', '', '1677686400', '1677772799', '0', '0', 'OYABZ-TUDOW-3ENR7-RX4YQ-IGXUJ-QKFCP', '10', '600', '0');
