INSERT INTO `tp_seller` VALUES ('1', '1667960475', '1677635569', '1', '榆林大剧院', '2010edb7cc54aa949e0880d667c92486', '1677660082', '106.44.246.194', '榆林大剧院', 'https://oss.wlxfq.dianfengcms.com/webupload/b0eed86fe0a26583619a72aa710a5ddd.png', '1677660082', '106.44.246.194', '11', '王娟', '0912-3510000', '9:00-12:30 14:00-18:00', '陕西省榆林市榆阳区明珠路街道榆林大剧院', '<p>榆林大剧院是榆林市重点文化工程，由榆林高新区管委会投资，榆林文旅代建并运营管理；投资概算5.17亿元，占地面积20.33亩，建筑面积41500平方米。大剧院由1202个座位的大剧场、260个座位的实验小剧场、6个放映厅的电影院以及艺术展厅、排练厅、琴房、化妆间、贵宾厅、地下停车场等附属设施构成。是集演、展、教、娱和会议等多功能为一体的综合性文化艺术场所，可承接国际大型交响乐团、艺术团、专业演出团体演出，提供音乐、曲艺、歌舞、文化艺术交流平台，有力提升市民文化品位，丰富市民精神文化生活，打造榆林市文化艺术最高殿堂，引领市民文化休闲生活新体验！</p>\r\n', '109.759334', '38.233361', '4', '2610092009200159232', '榆林大剧院管理有限公司', '中国工商银行股份有限公司榆林西沙支行', '0', '9161 0893 MA70 BUNR 99', '1', '971449726@qq.com', '1', 'https://oss.wlxfq.dianfengcms.com/webupload/3e556cb7de187baefcf9dda3c25c853f.jpg', '', '', 'JYYLDJ274513B7', 'https://oss.wlxfq.dianfengcms.com/admins/6e69b9a0024e76c84abc75c9ab8c6ada.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/7e77bbe9861741869c0d8dd293736dff.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/70ce7dc1c500ebce77192984b5a21bf6.png\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e4485f0660d7a12663d4d4b387ec8ed0.png\"]', '2', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('2', '1667982661', '1668071612', '1', '神木大剧院', '18ddc15acf049b6d87aa2bc17a22eed3', '1668129419', '106.44.247.69', '神木大剧院', 'https://oss.wlxfq.dianfengcms.com/webupload/df1cc57aff978e77e7137f6c30711c32.jpg', '1668129419', '106.44.247.69', '2', '剧小院', '15891125835', '9:00-17:00', '神木大剧院', '神木大剧院位于神木滨河新区和谐广场东北侧，东临滨河大道，西毗神木市政务服务中心，神木大剧院外观整体造型为“卵”型，寓意“城市之卵”，象征城市文化的孵化器。占地面积为2.75公顷，建筑总面积32959平方米，建筑总高度40米，共有8层，是神木的文化标志性建筑物，曾荣获了中国建筑行业工程质量最高荣誉奖“鲁班奖”，属于国家A类剧院。神木大剧院有精彩纷呈的高雅艺术、丰富多彩的文化活动，上演过舞剧、话剧、交响乐、室内乐、儿童剧、戏曲等各类大型演出和综艺晚会。\n', '110.470065', '38.899859', '4', '2710023701201000032903', '神木文化传媒发展有限公司神木大剧院管理分公司', '陕西神木农村商业银行股份有限公司新村分理处', '0', '91610821MA70AX2Y5X', '3', '823592795@qq.com', '1', 'https://oss.wlxfq.dianfengcms.com/webupload/d4c4422070fc0a6b4a2e3371825afd19.png', '', '', 'JYSMDJ98CBA612', 'https://oss.wlxfq.dianfengcms.com/webupload/ee1d1bf2928bdbbf016a5eeb4c9e708d.png', 'https://oss.wlxfq.dianfengcms.com/webupload/8c0c8d5d7d070fedb5661b8ad3f29145.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e4485f0660d7a12663d4d4b387ec8ed0.png\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/70ce7dc1c500ebce77192984b5a21bf6.png\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/cc8687d2bb881d9b23d1c1f7e9ba480e.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('3', '1668038842', '1668071657', '1', '榆林剧院', '1b93e3bfb6d82d715c428150c465027a', '1677756260', '36.45.210.131', '榆林剧院', 'https://oss.wlxfq.dianfengcms.com/webupload/b74ba1b89685aad58d4f48251fb053b1.jpg', '1677756260', '36.45.210.131', '16', '磨铭鑫', '09123448884', '每晚19：30（每周二停演1天）', '榆林剧院米脂婆姨绥德汉秧歌剧', '陕北秧歌剧《米脂婆姨绥德汉》以陕北民歌为基本元素，聚焦陕北传统文化，浓缩了陕北丰厚的民间文化底蕴和独有的地域特色。自2008年10月在陕西省榆林市成功首演以来，至今已在全国各地巡演近400余场，在我国文艺界、社会各界引起巨大反响，先后获得中国专业舞台艺术最高奖——《第九届文华大奖·特别奖》囊括剧作奖、导演奖、音乐创作奖、舞台美术奖、优秀表演奖等全部单项奖；以及《第二十届中国曹禺戏剧文学奖》、陕西省第十届精神文明建设“五个一工程奖”，并曾作为《陕西省第五届艺术节》重点参演剧目，斩获优秀剧目、优秀编剧、优秀作曲、优秀荣誉导演、优秀舞美设计、优秀灯光设计、优秀服装设计７项大奖。该剧曾4度应邀进京献演，走进国家大剧院、全国政协礼堂、保利剧院，深获专家学者和大众的认可和欢迎。\n', '109.753888', '38.289519', '4', '456950100100171100', '榆林市龙行文化旅游运营管理有限公司', '兴业银行股份有限公司榆林分行', '0', '91610800MA70B57J3L', '1', '1479789931@qq.com', '1', '', '', '', 'JYYLJYEFF126EF', 'https://oss.wlxfq.dianfengcms.com/webupload/2dff2f0b83a7735b7ce06345efba946d.png', 'https://oss.wlxfq.dianfengcms.com/webupload/7351daf9d5f14f5acb7ee7fcfda707c7.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/0abb935a6b946cf79e130ec9116c33e4.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/b02054e18f287480d44637b783dc1bc1.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/633f8a29b0765586bd607358110c3d88.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('4', '1671001174', '1677559956', '1', '榆林驼之旅旅行社', 'ccb30f168221347bd45ed31ab2b43d75', '1677727820', '106.36.207.102', '榆林驼之旅旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/cc147224450e46b5844220b9f48cdf46.jpg', '1677727820', '106.36.207.102', '8', '王忻', '18150402374', '9：00-17:30', '驼之旅·豪享', '榆林驼之旅旅行社有限责任公司是榆林旅投旗下全资子公司，公司依托榆林旅投平台、榆林旅游资源优势，以全市一盘棋的运营理念打造旅游车队，提供政务接待、定制游，打通市县区旅游运营网络，实现榆林十二县市区旅游线路全盘运营调度。重点围绕榆林古城、绥德、米脂、清涧，杨家沟革命纪念馆，路遥文化旅游带、黄河太极圣境和北国风光等项目开发运营。对沿黄城市精品旅游线路、特色农产品、旅游商品、文创产品进行线上推广和销售。公司拥有行业中极具竞争力和执行力的团队，掌握丰沛的社会资源。并以扎实的业务能力，强烈的服务意识，保证定制产品得到细致、高效的实施，倾力打造款贡城品牌，款贡城将凭借深厦的品牌基础和高端专业的业务优势，从事公务接待，商务旅游、定制旅游、汽车租赁等业务，加快开发更符合市场需求的旅游新产品矩阵，构建基于大数据背景的智慧营销体系，撑起榆林地接旅游的大旗，做行业的引领者和先锋者。真诚期望文旅企业及各界人士与我们携手演绎款贡风采!\n', '109.754951', '38.291219', '3', '806051701421003239', '榆林驼之旅旅行社有限责任公司', '长安银行榆林上郡路支行', '0', '91610893MA70D2NE7J', '1', '406422497@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/2922e92c7a3a1d90b6cbe322940ef091.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/af22924ab7b06da273cb208e44d650a4.jpg', 'LXSYLTZ2E2A9C81', 'https://oss.wlxfq.dianfengcms.com/webupload/a927583693a9f1137275a9452d574792.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/e1011d553eb5aeb7ec4955c2aaab85d3.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/430f5976d3b9d77f95129d0343e355d1.png\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('5', '1671068751', '1671181864', '1', '榆林市皇冠影视文化有限责任公司', 'c2bb1d875b4683d31b1149baad1cb831', '1677672350', '106.36.9.160', '榆林市皇冠影视文化有限责任公司', 'https://oss.wlxfq.dianfengcms.com/webupload/98aa4d9111edf33602739472f720f53a.jpg', '1677672350', '106.36.9.160', '3', '武丹', '15091400818', '2012年7月12日', '神木皇冠国际影城', '神木市皇冠影城成立于2012年7月12日注册成立，同年年底正式营业。\n 影城建筑面积1300平方米，拥有4个多功能3D标准数字激光放映厅，可同时共可容纳450人观影；大厅还设置各类电玩，让孩子解放天性，同时也可让带孩子的宝爸宝妈也拥有属于自己的休闲时光。\n 神木皇冠国际影城，是一个集休闲、视听、娱乐、产品等多方面于一体的综合性多功能数字化影城，不仅有先进的数字电影放映设备，浓厚的电影文化氛围，同时为满足广大人民群众的电影文化需要，我们将提供有特色的、高品质的服务。\n', '110.494563', '38.834443', '5', '912900046610808', '榆林市皇冠影视文化有限责任公司', '招商银行榆林神木支行', '0', '916108210504088052', '3', '36573721@qq.com', '1', '', '', '', 'YYYLSH236D5F21', 'https://oss.wlxfq.dianfengcms.com/webupload/1d6206763f58d779f508325522f829b1.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/2d6b6c6ba6a668dd8f1242c0f3e413b2.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/78963d3f4dc79ab6f4688304c428c4df.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/fe12e1eae2db6b64f9f1ea022f3bdcf7.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/de54b7831292031d0a0c8842d92a8350.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a5002aa441d84ad26698c1e03ae0948a.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/94de2a0c8f87a75e9d5076bcd58eea08.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/4a6af9b36fc52d6001cd58db16415daa.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('7', '1671071016', '1677558046', '1', '神木大兴影院', '8ee5c7b36af8c01e2d94258909bde73b', '1677667316', '113.143.245.224', '神木大兴影院', 'https://oss.wlxfq.dianfengcms.com/webupload/f86c8125491c5f7890b737e1a6946444.jpg', '1677667316', '113.143.245.224', '3', '刘智军', '13474234224', '2010年7月', '神木大兴影院', '       神木大兴影院：位于神木市铧山路中段神木大兴游乐园内，建筑面积400多平米，是神木市首家3D数字激光影院，有200个座位，曲屏大银幕，良好的观影环境，一流的服务态度，是您和家人休闲娱乐首选的好去处。\n\n      影院附近停车方便，周围有几百个停车位，还有神木最大的游乐园大兴游乐园，购物超市，是您和家人周末放松心情最理想的地方，我们真诚的邀请您和您的家人朋友一起来神木大兴影院观影！\n\n我们的订票热线：0912-8303808\n\n微信公众平台：SMDXYY    神木大兴影院\n', '110.496246', '38.834785', '5', '2710021301201000049942', '神木市九州中原影业有限公司', '神木农商银行城区支行', '0', '91610821552176434G', '3', '251212412@qq.com', '1', '', '', '', 'YYSMDXA8ECC139', 'https://oss.wlxfq.dianfengcms.com/webupload/775ec26374420566eb4bc1713ebbdc37.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/90d9adc20a94e31f41e6f4b296c5f97b.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/45ba1fb3809c7d64a6a662b8585b7d16.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/5ccb37a32e06c786f6678bfadf956487.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/6ba0ba617046e769064b066535f59bee.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/bd7dd93fe865b220cd3342dcb2b0114b.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ae425a4caa933c09d229375859d9e65f.jpg\"]', '0', '0000-00-00 00:00:00');
