INSERT INTO `tp_seller` VALUES ('9', '1671074686', '1677729736', '1', '榆林中万旅行社有限公司', '3bdc46695de79c5280049529766525dc', '1677751253', '123.139.60.12', '榆林中万旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/08c9f0bd3a4ec61a15423b8f9223826e.jpg', '1677751253', '123.139.60.12', '2', '牛晋东', '18628661733', '8:00—18:30', '陕西省榆林市府谷县府谷镇石畔路民信大厦', '榆林中万旅行社有限公司是一家从事旅游行业，经营旅游事业的纯真公司，本着对游客服务为宗旨，一切从游客角度出发，努力为每一次出游的完美行程倾其所有，和我公司合作的国内旅行社都是各省的十佳旅行社，合作的酒店都是五年内的新酒店，旅游大巴都是五年内的准新大巴，导游都是各旅行社的优秀员工，我公司的负责人和员工有经营旅行社10多年的宝贵经验，真诚服务每位游客，为大家的出游保驾护航，为每位游客都买有双保险，选择中万就是选择了舒心和快乐。\n', '111.06967', '39.030129', '3', '61050169735300000444', '榆林中万旅行社有限公司', '中国建设银行股份有限公司府谷府州支行', '0', '91610822MA70BWAL2N', '4', '2388495033@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/abf0c3f2c9d71fea90e86c540872300d.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/f05020ce19737e1634497bd2674f57bb.png', 'LXSYLZW208609B8', 'https://oss.wlxfq.dianfengcms.com/webupload/011de9fb0932e4c23a0e24760471942a.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/e56390d43363dde96d052da6d250721d.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/efa4f58b96ef5552b203cc24a0ae710b.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('10', '1671075985', '1677673686', '1', '金字塔影城', 'a2238eb53df05532b153bd826aa8e3dc', '1677674588', '113.134.221.85', '金字塔影城', 'https://oss.wlxfq.dianfengcms.com/webupload/ea86b6c6ba9d9b2d09b9b85332a91a51.jpg', '1677674588', '113.134.221.85', '4', '白雪', '13109250000', '12：30', '陕西省榆林市绥德县名州镇永乐大道60号永乐园小区', '金字塔影城位于绥德县永乐园小区负一层，设有4个专业设备，同时可容纳近300人观影。安装日本进口NEC放映机，飞达专业音响，画面及音响想清晰透彻、精确逼真。重要空调系统冷暖适宜、并备有空气净化及灭菌设备。影厅设有VIP观影，豪华沙发厅，安装科视设备，大明亮高清银幕。影院的售票厅、食品部、观众休息厅及卫生间宽敞舒适明亮，影片灯箱广告引人入胜，赏心悦目，是大众观看电影的理想场所。\n', '110.265149', '37.510259', '5', '2610090819200146760', '绥德县金字塔文化影视有限公司', '中国工商银行绥德县支行', '0', '916108265756440265', '7', '53376238@qq.com', '1', '', '', '', 'YYJZTY88FE0C12', 'https://oss.wlxfq.dianfengcms.com/webupload/bdd398bba2ab6dd3f0efa26b9ba0576d.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/03ad8de8854a788385ed0b077740a332.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1c2e9b4a362800574982ac3a32726a18.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a43d68d1c3166e6a888bb945129186b3.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e4ebe06ec0c111b22ccd574ee8ec1a76.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b4e4c7362a9c3869f3ad67d3c0d7db2c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b2d48b2638b0e742d90d55837040db24.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/89c4389c0fa904835a0cee4fa842c2f2.jpg\"]', '0', '0000-00-00 00:00:00');
