INSERT INTO `tp_seller` VALUES ('14', '1671082535', '1677729709', '1', '榆林市山山丹丹旅游社有限公司绥德分社', 'e967e5f72f2ad91076d7a2df2168e51e', '1677756337', '123.138.230.205', '榆林市山丹丹旅行社绥德分社', 'https://oss.wlxfq.dianfengcms.com/webupload/4967d2b362561cfcbeaa0fec2eafefd1.jpg', '1677756337', '123.138.230.205', '9', '王成明', '13084844433', '07：30-19：30', '陕西省榆林市绥德县名州镇千狮路28号绥德客运站', '榆林市山丹丹旅行社有限公司绥德分社是榆林市恒泰汽车运输集团旗下的全资子公司，公司经榆林市工商局注册、榆林市旅游局、县旅游局批准成立，是一家主要经营入境旅游、国内旅游服务、票务代理业务的旅游企业。我社拥有实践经验丰富的管理人员和优秀计调、导游的旅游业务专业人才，享有良好的信誉和口碑。 我社依托于恒泰汽车运输集团的企业规模和历史优势，发挥运游结合的运营特点，以“品牌化、规模化、优质化”为目标，为客户提供全方位的旅游出行和延伸服务。     山丹丹旅游绥德分社一直秉承“倾心的服务、愉快的旅游”的经营理念，为客户提供性价比高的旅游、休闲、会展服务和舒适的商旅体验，以专业的能力帮助客户达成美好的出行愿望。 山丹丹旅游绥德分社用精心设计的行程，让游客尽享世界风光；以专业完善的服务，助客户实现旅行梦想。 微信公众号：绥德山丹丹旅游 地址：陕西省榆林市绥德县北门滩8号 电话（传真）：0912- 5793187\n', '110.264129', '37.509247', '3', '2610090809200113730', '榆林市恒泰汽车运输集团有限公司绥德汽车站', '工商银行绥德县支行', '0', '91610826MA703HB88Y', '7', '304608167@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/54bd017d86b2c3692c462d70d44045f9.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/2232bcbb9bcbacaa225a56bf903ca8ba.png', 'LXSYLSS747A2593', 'https://oss.wlxfq.dianfengcms.com/webupload/8e4ec35c0c244a5cf6157c7663ad37e9.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/d8ea66ea1fdfa9ba466207536546e1eb.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c5f05b26cecd74cf80dfa56098c7794c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8880dc36d3977805261712ad60e5a12b.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/f8d0b0aab7eb0250bb0bd8647ec438c3.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('15', '1671082630', '1677729126', '1', 'chenleizy', '6c5aab4090c0b39b4d0345d38ff4a5d6', '1677656045', '61.185.149.232', '中影爱国者国际影城', 'https://oss.wlxfq.dianfengcms.com/webupload/1ec8b449728c655c5063361a1abd8099.png', '1677656045', '61.185.149.232', '4', '马宇航', '0912-3233333', '10:00-22:00', '中影爱国者国际影城(K01榆星广场店)', '榆林中影爱国者国际影城位于榆阳区文化路榆星广场5楼，总投资1500万，总建筑面积高达4000平方米，严格按照现代数字城市影院标准设计和施工，秉承国际影院的时尚风格，装修豪华，高雅大方，拥有6个视听效果一流的影厅，其中有一个中国巨幕厅，所有影厅安装激光数字放映设备，共设803个豪华舒适座椅，可与星级酒店媲美的高大宽阔而豪华的大堂，更让观众仿佛置身于梦幻般的电影天堂，开启普定电影新时代。\n', '109.730514', '38.286546', '5', '26005401040015799', '榆林市中影爱国者国际影城有限公司', '中国农业银行榆林青山支行', '0', '91610800MA703AJL6L', '1', '13109229765@163.com', '1', '', '', '', 'YYYLSZ8DCB8983', 'https://oss.wlxfq.dianfengcms.com/webupload/0c8083d1f64c0a77f63e257ec396ae71.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/8b7a05eee2af6364da674b2f1ffcfa12.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0527fe85a8871dc5735865f059eda833.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/cfcc0fcf78847151b18cb3a336e6212d.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8aadf1bcd8ac0c324e3a5b55097115ec.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/2fa3bc4d2d4878d140e454f9304d7240.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/540bf810862b3ecf094e4ac8c04bc2e8.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/4e80c4a1dc9681aa52ea3606f172fa81.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/35ef9b133b82bb7f2b485ce5e9583172.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/63c4d79d3fad2b405e82a286163d48d8.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e5080d803c45a0efafe526d27ca7c394.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c80f1bf2c5d032bf360796830a8e3060.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0bb3f98b5aed8f9fb7d3a324ca26e92d.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/2439ba8f430c524aca9a06610913