INSERT INTO `tp_seller` VALUES ('16', '1671083355', '1677729747', '1', '榆林康乐旅行社', '410d73c581b6def2e2c12b8efee79a15', '1677652654', '113.200.4.43', '榆林市康乐旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/a1609e796e822e73f2e7462aea7f996e.png', '1677652654', '113.200.4.43', '2', '李亚莉', '17795978285   139091', '08:30-17:30', '榆林市榆阳区西沙保宁路与常乐路十字西北角', '榆林康乐旅行社是致力于做您一生旅游服务商的专业旅游企业。我们的理念是健康快乐伴您一生游！榆林市康乐旅行社有限责任公司，是一九九九年六月陕西省旅游局批准成立，具有独立法人资格的旅游企业，是榆林市实力雄厚的旅行社之一。用科学的管理方法和热情优质的服务，服务好每一个团队，每一位旅游者。康乐旅行社本着“我们销售健康、快乐”的宗旨，凭借严格的管理、高素质的员工队伍和庞大的旅游合作网络，受到广大市民的一致好评。先后被评为陕西省旅游企业“诚信承诺单位”、榆林市旅游行业“先进单位”。通过九年的奋斗，榆林康乐旅行社已发展成为经营国内旅游、旅游车队、出租汽车、餐饮、咨询服务、以及散客自助游、订票、订房、优秀导游服务等多项服务的综合性旅游企业。\n', '109.735469', '38.288633', '3', '26090601040010643', '榆林市康乐旅行社有限责任公司', '中国农业银行文化路支行', '0', '91610800713530976E', '1', '523657238@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/82f0fcbc626da916c7a6b356045b6ffb.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/0cf62acd092ae4b510c42668d7be3ca6.jpg', 'LXSYLSK04D630C9', 'https://oss.wlxfq.dianfengcms.com/webupload/9cffaaab0973625a0096cac55baa26ad.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/571cd428bb4c5e001848b7abc906b16d.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/32415143e4c89634965f365d1bf3bf60.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('17', '1671083392', '1677729696', '1', '途悦假日', 'b41d8fad0b4db2ba284e11dc9a31ad89', '1677639195', '36.45.212.255', '陕西途悦假日旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/39966c4ca0ee82cf2cc74abbbd19c33c.png', '1677639195', '36.45.212.255', '3', '赵冬梅', '13399120381', '08:00至18:30', '途悦假日旅行社', '     陕西途悦假日旅游有限责任公司(前身为陕西中旅假日旅游有限责任公司，成立于2010年5月份)是一个以周边游、国内游、研学游、亲子游、红色考察游为核心的旅游文化公司。“热爱、专业”为公司理念，自公司成立之日起，公司不断探索和发展一条品质与享受相结合的专业旅游服务道路。以“品质化”、“规范化”、“人性化”为发展目标，以全心服务、悉心策划、注重特色为经营理念，立志在满足顾客需求的基础上追求卓越、精益求精，并且不断加大人力及技术等方面的持续投入，迅速发展了一批训练有素、经验丰富、服务热忱、热爱途悦的高素质团队和高素质导游队伍，与全国各地的旅行社、酒店、车队建立了良好的合作关系与业务往来，使各类旅游产品更加完善，力争为游客提供可靠周到、品质优良的全方位旅游服务。      我公司从2015年起致力于研学游品牌的打造，“让每个孩子至少有一次游学的经历”为目标，寻求规范化、专业的研学游方案，让途悦成为青少年成长路的阳光伙伴。而且在人群结构上从中小学生延伸至大学生乃至成，在业务链条上，从研学、教师培训延伸至文化传播。      因为热爱所以专业，因为执著所以完美。途悦力创独具个性的精品旅游服务品牌，从全国海量旅游线路中优化组合，为游客量身打造完美的线路设计和行程安排，实现超值休闲，洗涤身心的目的。      为了保证途悦的服务质量，打造“热爱、专业”的品牌，公司专门设立了“旅游质量监督”岗位，专门负责对所有团队接待质量跟踪，处理游客投诉，收集、整理游客意见，有力地保证“事事有人管，时时有服务，人人都满意”的最佳服务境界，竭诚维护途悦假日旅行社的良好社会口碑。\n', '110.497822', '38.844717', '3', '61050169513700000011', '陕西途悦假日旅游有限责任公司', '中国建设银行股份有限公司黄庄支行', '0', '91610821352312980Q', '3', '376257433@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/a878354d500bdd894dab8cc5bfb60a00.png', 'https://oss.wlxfq.dianfengcms.com/webupload/d25def5afbaa24af1c2eb39007b20bbe.jpg', 'LXSSXTY0BAC6CFA', 'https://oss.wlxfq.dianfengcms.com/webupload/4d90e5b3bf7f37b5d93f98e2e788b5d3.png', 'https://oss.wlxfq.dianfengcms.com/webupload/24c30a29b20bd68f4ac7d47c9613ec3e.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/efc3b3edac83c2980b109ec1aebc9ba3.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('18', '1671083787', '1677729119', '1', 'chenleiask', '6c5aab4090c0b39b4d0345d38ff4a5d6', '1677755386', '111.20.121.235', '奥斯卡影城东沙店', 'https://oss.wlxfq.dianfengcms.com/webupload/d2a2e66aa1dcb634071d60e42b6a5f0b.png', '1677755386', '111.20.121.235', '4', '陈磊', '0912-3239455', '12:00-22:00', '奥斯卡国际影城(东沙店)', '榆林奥斯卡国际影城位于红山金沙路和顺雅苑商业楼C座6楼，影院规模达1400余平方米，是一个集休闲、试听娱乐等多重文化活动汇集多方面与一体的综合性多功能数字化影城，影城采用高清金属银幕，超大、超宽视野的观影效果，让观众在任何一个座位上的视觉、听觉都舒适无比。所有设计和细节都充满专业化及人性化，最大限度地满足了影迷的舒适度需求。本影城内设4个国际先进高清数字厅，其中设有榆林首家4D与大片同步特效、动感影厅，与众不同的观影环境，让您感受不一样的观影体验，流连忘返。超豪华高端大气上档次的装修设计与独特风格，满足影迷视听需求，超高清全彩的LED预告片播放及海报墙将电影氛围在观众步入电影院时，不论从视觉和感观上，都有一种温馨如家，如“影”相随的氛围。使榆林奥斯卡国际影城成为榆林文化产业的新时代。\n', '109.768244', '38.301722', '5', '102085721907', '榆林奥斯卡影城有限公司', '中国银行股份有限公司榆林东沙新区支行', '0', '91610800MA70C50M9A', '1', '171939245@qq.com', '1', '', '', '', 'YYYLAS21D3400D', 'https://oss.wlxfq.dianfengcms.com/webupload/93e5030a8cc3107aa3fd67f06eb498b3.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/cc6b83164189f570295b539153de09ed.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/6844e7da880a303ebdf5d5dc090f70b9.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ae062990e16af34f623167eceac1c840.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/6bbb76c46ee373a5f39b99807f2632b4.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/58e572a433e774dd8b457ad9930d19fb.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b72054351a8731c561a97ad4d4f75e2c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8cc4883dc546e8b5956ad3654832eeb8.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b18a04401160cd478facc456c3b0f1cf.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7c83229ea13e49596c85c9d5f4196342.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('19', '1671086029', '1677729095', '1', 'chenleijm', '6c5aab4090c0b39b4d0345d38ff4a5d6', '1677688069', '223.104.205.136', '绥德县江美影城', 'https://oss.wlxfq.dianfengcms.com/webupload/1720a5808c067d8d067b24907421bc41.png', '1677688069', '223.104.205.136', '2', '马超', '0912-5783777', '12:00-22:00', '江美国际影城', '绥德县江美国际影城按照城市数字影厅标准打造面积1500多平米3个专业的放映厅260个座位，其中3个3D影厅，错落有致的分布在影城的内环境温馨格调高雅.和全国各大影院同步上映各类中外大片经典影片.丰富的节目令人目不暇接为您提供了更多的选择。\n', '110.261284', '37.503287', '5', '61050110734600000172', '绥德县江美文化传媒有限公司', '中国建设银行股份有限公司绥德县支行', '0', '91610826MA70A3M7XQ', '7', '385896605@qq.com', '1', '', '', '', 'YYSDXJ09045975', 'https://oss.wlxfq.dianfengcms.com/webupload/4bbffc72e3ac347280d6729d6adf3a5f.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/3cac277edafabd3477063da848e765ab.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/d32c7296de8479365d5f524a486350bc.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/d851eab33f05dd2f328c33a6587bca39.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c1fd6e5330c46a1819d38a2e2981f55a.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/53da953ddc98f95ba2756ab264c07be1.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8c1a743c668659e6a2b65c04ac0d9e36.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c96b722899b7801af09a14767f0bf1f1.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7321178192058f3bfdc25ba9557f9cd1.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('20', '1671086149', '1677729103', '1', '7880555', '2f2d3b16d5ed62b4add9c9f5bae7f79b', '0', '', '横山区龙泰国际影城', 'https://oss.wlxfq.dianfengcms.com/webupload/8c27c088340b788f4ca15b17b4f3b9f4.jpg', '1671086149', '221.11.117.250', '0', '黄彩平', '13239269299', '9:00-23:00', '榆林市横山区百货大楼四楼', '榆林市横山区龙泰国际影城位于横山县解放西路中段，占地1500多平方米，拥有放映厅3个，可共同容纳300多人同时观看，座椅均采用专业人体工程学影院标准座椅，开放式票房可供观众选择心仪的观影座位，给观众提供最舒适的感受，让您在享受美轮美奂的视觉效果的同时，可以感受到无与伦比的震撼音效，切身体会电影带来的视听盛宴。 榆林市横山区龙泰国际影城环境优雅，服务热情，档次奢华，影城引进世界一流的比利时巴可放映机和5.1声道数字环绕立体声影院影响设备以及是10米宽的巨幅银幕，视觉和声学环境全面超过五星级标准，这些高端科技的专业组合，带给观众前所未有的真正顶级的视听震撼，同时也树立了影音观赏理念的新标准。 2014年以来一直从事横山区电影放映服务，大力宣传文化事业。\n', '108', '37', '5', '61001699210052501705', '榆林市横山区龙泰国际影城', '中国建设银行股份有限公司横山区支行', '0', '92610823MA704CG062', '2', '540764535@qq.com', '1', '', '', '', 'YYYLSH6FC58CB8', 'https://oss.wlxfq.dianfengcms.com/webupload/7a0ad4836a2b5f51d7fb70267c2ff33f.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/2e5b0dc3f8e72597c050df8ec0a80f1a.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/98c099172b56119303f46e4d46a93b87.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/19b4068e535ecb0bf70b8b53020c82d8.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/31b98a19b4dd858bf08085d6cc7814e9.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/6dd99d57eca556ea8e611eb3b2ae5e39.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/beb465dbfd0fee472d842d4d44882908.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/9b0cca9427997c702692d0ad924b5d31.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/5c82eaaf26e7c06b596c7f251e7b1eab.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/111fd7cab2dbd1fd51696b26649157ad.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('21', '1671086594', '1677729668', '1', '陕西舒翔国际旅行社有限责任公司', '16a42da806b153e379339a313d72c7d1', '1677647977', '106.36.207.102', '陕西舒翔国际旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/88a973c47af139417f7eb23c97c18a6d.jpg', '1677647977', '106.36.207.102', '2', '王金金', '15596585818', '08：30---18:00', '银通嘉园B座2楼', '      陕西舒翔国际旅行社座落于塞上历史文化名城——榆林，位于交通便利的榆阳区上郡南路银通嘉园B座2楼，公司2006年9月成立，经陕西省旅游局批准，市工商局注册成立，严格按照法律法规要求缴纳了旅行社质量保证金、旅行社责任保险等。是一家具有独立企业法人资格有限公司，公司主要为广大游客提供各地旅游、商务考察学习、休闲度假观光、户外拓展，个人自由行，代订酒店、门票、旅游用车、承办会议、组织自驾游等专题旅游，以及开发各类旅游产品等。        公司自成立16年来，以良好的品牌形象，热情周到的服务及合理的价格赢得了广大旅游者的信任和支持，备受各界人士及行业关注.。于2008年被评为榆林市旅游协会副会长单位；2009年被评为行业年度经济企业单位，2010年被评为榆林市旅游地接工作先进单位；2011年被评为守合同重信用企业；2012年被评为榆林市十佳旅行社；并与于2012年收获榆林古塔中学敬赠“情系教育 造福桑梓”的美誉；2018年再次被评为榆阳区十佳旅行社；同年被榆林市教育局和榆林市旅游发展委员会批准为研学旅行社。\n', '109.77887', '38.236363', '3', '102805791618', '陕西舒翔国际旅行社有限责任公司', '中国银行股份有限公司榆林长城路支行', '0', '91610800790797471N', '1', '472119376@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/4ad27a58ff8a0c930454b9d52f8dfeab.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/b4fc2904d286c162cd754397661fcb71.jpg', 'LXSSXSX72A9934A', 'https://oss.wlxfq.dianfengcms.com/webupload/5f1771c7011093690acd4fdd9cb7197a.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/d72f29390cb617bb556e7a0c4abd2f63.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/46a673b3c2c7e8c81fae8279add4ce71.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('22', '1671087094', '1671172263', '1', '18691257070', 'f1ff979e77ce8c4e4d3f4a061897f99c', '0', '', '榆林市美佳利得旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/724acb7cacdf54bd33e36b44831acd87.jpg', '1671087094', '113.201.132.33', '0', '张莹', '18691257070', '9：00—17：00', '陕西省榆林市榆阳区航宇路街道航宇路161号通源大厦二楼', '欢迎来到榆林市美佳利得旅行社，联系电话0912：7779888联系手机是15991218880 主要经营旅游线路; 旅游产品;公司的经营理念是：诚信服务，合作共赢。始终坚持用户至上 用心服务于客户，坚持用自己的服务去打动客户。\n', '109.747586', '38.260695', '3', '6222022610000483408', '马佳楠', '工商银行榆林分行榆阳区世纪广场支行', '0', '9161080266796350XK', '1', '59369810@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/2d5d8ba2962c694a2a0ff8a42ed8bfa5.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/7b3882a3e57c4abdde2b2515a3896afc.jpg', 'LXSYLSMBB2C5906', 'https://oss.wlxfq.dianfengcms.com/webupload/641e2f06e34b3b95972dd39a86d86229.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/698b57659fc204c7ae96f64add5105d2.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/9e19bd12260fe4610eb79de8eb1f4fed.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('23', '1671089032', '1671162474', '1', '13468808110', 'ddcdf0f0410bee4eab37169c1ba9e41b', '0', '', '榆林市大洋旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/9257d924b08e2d17607f5ffdd7bc5396.jpg', '1671089032', '36.43.232.181', '0', '刘洋', '13468808110', '8:30-20:00', '榆林市东恒百货', '榆林大洋旅行社有限责任公司成立10年来一直本着：讲好榆林故事，做榆林城人的理念，立足本土，志在宣传大美榆林。专注于榆林古城六楼讲解；榆林12县、红色旅游、特色榆林美食线路。全国线路齐全。\n', '109.75812', '38.280339', '3', '961006010000938985', '榆林市大洋旅行社有限责任公司', '邮储银行榆林乡企成支行', '0', '91610800085973953H', '1', '1162588854@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/f424f85829a8af316a742a3a96c1c7a5.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/d611adfa4a0da0f1a23367dcfc27dd95.jpg', 'LXSYLSDC89C16CC', 'https://oss.wlxfq.dianfengcms.com/webupload/81f2551f143b2f866c2b53a6bb0cbcdd.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/c9971a55d5ade6c5afc7f45e5ede1ad4.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c369bf0d64370a800fab781b6ca0596f.jpg\"]', '0', '0000-00-00 00:00:00');
