INSERT INTO `tp_seller` VALUES ('27', '1671091564', '1677563523', '1', '榆林旅游百事通', '7bceb2196c30d482d695a1165a0c1843', '0', '', '榆林旅游百事通', 'https://oss.wlxfq.dianfengcms.com/webupload/70a632e018fb6275e30cc27b14b2c66e.png', '1671091564', '106.44.231.110', '0', '胡晶', '13310921079', '全天', '榆林市肤施路市公安局', '<p>旅游百事通是全国旅游企业百强前十名，中国最大的综合性旅游集团之一，重庆海外旅业集团倾力打造的全国性旅游连锁超市。 旅游百事通采用超大连锁超市运营模式，2010年已成为全国加盟门店最多，收客量最大的旅游龙头企业，旅游百事通汇集国内外上千条旅游线路资源，以统一形象设计、统一产品采购、统一分销平台、统一培训、统一结算、统一合同发票、统一售后服务的集团化经营模氏。</p>\r\n', '109.763847', '38.269714', '3', '102442985231', '榆林旅游百事通国际旅行社有限公司', '中国银行股份有限公司榆林榆阳支行', '0', '91610802068677202X', '1', '422811436@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/53eb2fdf92a81230d6a2e9464ac29e03.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/883b4d46c5d1c817c53d724178eb986a.jpg', 'LXSYLLY72547497', 'https://oss.wlxfq.dianfengcms.com/webupload/ba7df9a14101d89e9c0d3988791a2de9.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/644fc026ce5decdf829f114feb75cee9.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a60e6d8c94adc4fadc268fc1ec865c9c.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('28', '1671092518', '1671181495', '1', 'HXYC8498818', '4e71002969fcd46813b869e931aedf4b', '1677488209', '106.44.148.219', '锦界华夏影城', 'https://oss.wlxfq.dianfengcms.com/webupload/74ac48ab1cc682c89e20a378197bdeec.jpg', '1677488209', '106.44.148.219', '5', '王刚', '15399305188', '12:00-21:30', '陕西省榆林市神木市锦界镇华夏电影城(锦界店)', '      华夏电影院由神木市金蝉文化传媒有限公司申请加盟完美院线，斥巨资历时三个月营建完成。营业面积700平方，分三厅（一2D厅， 二3D厅），合设300坐席。影院设备采购美国科视2K放映设备;广州飞达环绕音响系统;深圳幻影3D设备及三块高端金属大幕。将为您呈现场场震撼，幕幕精彩，身临其境的\n电影艺术盛宴!\n   \n\n地址：榆林市榆神工业区锦大路口锦都大厦三层\n电话：09128498818\n手机：15399305188\n', '110.182762', '38.752251', '5', '2710022701201000026778', '神木市金蝉文化传媒有限公司', '陕西神木农村商业银行股份有限公司锦界支行', '0', '91610806MA7032116D', '3', '673904808@qq.com', '1', '', '', '', 'YYJJHX1933BF77', 'https://oss.wlxfq.dianfengcms.com/webupload/dda988adea99df0aefac706d5d86e6f7.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/937349f32433427496eed1400f4c6e0d.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b81d8883cc883cf58a07f664924602e5.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a5f3fd0631c3682ccbda3edd7c132473.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c5e56f617aa1a6c986fb2aa3bd60c061.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/46ce07897d9be19d88cbbc4fe95cc6c3.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/f5ce0f3bf9251fb1372edb398c916f46.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e40891f7571e71fec160f838ceae2a15.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/bbb26f26eee079e0f5665b4e19dcfd0e.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('29', '1671092904', '1677729041', '1', '清涧县紫金城影院有限公司', '6c5aab4090c0b39b4d0345d38ff4a5d6', '1677655864', '111.18.250.90', '清涧县紫金城影院', 'https://oss.wlxfq.dianfengcms.com/webupload/6fba2ba5d7bee363cd7ca7ff98532f51.png', '1677655864', '111.18.250.90', '3', '张蕾', '0912-5221222', '12:00-21:00', '紫金影城', '       清涧县紫金影城位于清涧县岔口紫金花园3楼，总投资500万，总建筑面积达980平方米，严格按照现代数字城市影院标准设计和施工，是清涧县城区目前唯一数字影城，秉承国际影院的时尚风格，装修豪华，高雅大方，拥有3个视听效果一流的影厅，所有影厅安装激光数字放映设备，共设350余个豪华舒适座椅，可与星级酒店媲美的高大宽阔而豪华的大堂，更让观众仿佛置身于梦幻般的电影天堂，开启普定电影新时代。\n', '110.112617', '37.106832', '5', '2710070401201000021260', '清涧县紫金城影院有限公司', '陕西清涧农村商业银行股份有限公司南郊支行', '0', '61910830MA7031BK2W', '11', 'qjzi123@163.com', '1', '', '', '', 'YYQJXZ0BE9CD6C', 'https://oss.wlxfq.dianfengcms.com/webupload/3f6657faf06b1f379e68be897e335fc7.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/41c059ee84e8d5ff07e8f70e5decf6e1.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/2159458487d4d0f8eef99d4d4c3c7f9e.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8b895c8172e70a8ef5751cf3046c3e85.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/21aa64aba78b96073da985c6501e2bea.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c1738050034209036c4c298a55a3641a.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/248c3c75627d04d2adc9c2917d62a1c2.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/3e3d25ecf000f1b4a28f33dcd79ab765.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('30', '1671092914', '1677729686', '1', '神木市驰骋旅行社有限公司', '8a05d09b7b70bf502c022f355eb82110', '0', '', '神木市驰骋旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/4d8c36fa7cf3864bfa48576b78debc5a.jpg', '1671092914', '113.143.244.176', '0', '李蟒', '15091400168', '08：00-11：30  14：00-17：30', '陕西省榆林市神木市麟州街道水龙路大兴庄小区西侧', '一   公司简介 神木市驰骋旅行社有限公司是由原神木县阳光假日旅行社有限责任公司更名而来，成立于2008年元月，经营许可证号为：L-SNX00477.      我公司主要经营：入境旅游业务、国内旅游业务、旅游景区景点的开发经营推广，研学旅游、游学培训、个性化旅游产品的制定；旅游商品的设计开发推广经营；体育运动娱乐项目的建设、教育推广（不含危险项目）；水路旅客运输；代办企事业单位商务差旅服务、代办疗休养服务、代订车、船、飞机票、酒店、农副产品经销。       我公司成立以来秉承以人为本，诚信经营的原则，在市场上赢得了良好的口碑，获得众多顾客的认可。经过数年经营，我公司摸索出一套独特的服务体系，能够在旅途中最大限度的体现旅游这种休闲放松的本质，有别于过去那种走马灯式的观光旅游；从食宿行等硬件上做质的提升，在服务的软件上配备讲解精、服务意识强的优秀导游，杜绝人为因素的低质量服务！ 二  研学部特点和优势 我公司立足神木，放眼全市旅游市场的发展，在全市旅游行业中率先转型经营，于2016年初筹备创办佳县白云山黄河漂流，2017年4月27日经相关部门验收合格正式营业。黄河漂流是我市第二家（红碱淖是第一家）合规合法的水上娱乐项目，是我市第一家黄河水上娱乐项目。      2016年我社根据市场发展、政策导向，成立了专门的研学旅行服务部，聘请陕西户外联盟主席、西安外国语大学人文地理研究所对外联络处主任、开拓者野营登山俱乐部主任、资深户外教练、中国户外的早期探索者任真老师为研学部顾问导师，指导研学部相关工作。聘请有丰富经验的持研学旅行辅导员证的朱星老师为研学部经理；请神木市教育中心郭文林、神木市第四小学刘俊霞等数位老师为特聘研学辅导员。在2015年我们就开始关注研学旅游的相关政策动向，并专门组织相关人员去照金、翠华山等周边比较成熟的研学基地做实地考查，学习研学经验。在2015年“十一”长假期间，首次接待了由西安旦雨研学创新中心组织的专业游学团，获得了圆满成功，学习了宝贵经验。之后，我公司研学部根据自身特点，陆续安排了神木陕北民俗大观园、佳县白云山、赤牛坬、神泉堡、米脂杨家沟、绥德郝家桥、补浪河女子治沙基地等地数批研学旅游，取得了良好的社会效益，获得了学生家长的好评。\n', '110.495335', '38.835554', '3', '61001695137052503778', '神木市驰骋旅行社有限公司', '中国建设银行股份有限公司神木黄庄支行', '0', '916108213056934183', '3', '373454412@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/14d8588f8631e1f66a4ae3a59cfdcdb3.png', 'https://oss.wlxfq.dianfengcms.com/admins/7505c9a8c88f534d23a689d5fb5bed5b.jpg', 'LXSSMSCE991097F', 'https://oss.wlxfq.dianfengcms.com/webupload/adf7e7b11125b25fb05474dabcdba770.png', 'https://oss.wlxfq.dianfengcms.com/webupload/2a34c3774edfad02ec00d18ab39ee8e9.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/5648bd47a70a7ac64d136b684f895ea2.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('31', '1671098004', '1677751400', '3', 'Yl-8121212', 'd77fb539f682b42e8db87438c2327cd5', '0', '', '榆林国际旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/2b59f58e242ffa1d308031a5da08cdd6.png', '1671098004', '111.19.73.85', '0', '刘翔翔', '13720460690', '8:00-17:30', '榆林人民大厦', '榆林国际旅行社有限责任公司成立于2005-09-08，企业地址位于陕西省榆林市高新技术产业园区明珠大道人民大厦一楼办公区(商务中心)，经营范围包含：国内外旅游服务;文化旅游咨询服务;旅游景区、项目、基础设施的规划、建设、开发、运营、管理服务;日用百货、工艺品、食品及饮料的生产与销售;赛事活动策划、会议会展服务、文化艺术交流活动、企业形象策划;酒店管理服务;企业管理服务;互联网信息服务;汽车租赁服务;舞台、灯光设计服务;音响设备的安装、租赁、销售; 航空客运销售代理服务 运输代理服务;游乐设备、环保设备、办公设备、酒店设备、体育用品及器材的安装、设计、销售及租赁服务;旅游信息、资料的编绘;摄影服务;广告设计、代理、发布。\n', '109.7', '38.2', '3', '26005401040003068', '榆林国际旅行社有限责任公司', '中国农业银行股份有限公司榆林青山支行', '0', '916108007799115367', '1', '1328726303@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/admins/ad97eda56c6b0c86f4f246f1ec0fc891.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/df9ee0da8845a4b240b1b0b129bb541d.jpg', 'LXSYLGJ086F06E5', 'https://oss.wlxfq.dianfengcms.com/admins/129cc54e93d8220c22aa21435b79593c.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/326d2701a233e298a3b46acceac8d22d.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/aa8ae01b4bf8b3f8099d2991977280fc.jpeg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('33', '1671099926', '1677751026', '1', 'Zj123456', '467902c65e48f35f758bc125608cb436', '1677676242', '111.18.229.127', '陕西洲际国际旅行社靖边分公司', 'https://oss.wlxfq.dianfengcms.com/webupload/49b46029fe1bd35e30f0720acb19adf6.jpg', '1677676242', '111.18.229.127', '9', '樊焕玲', '13992293974', '00：00-23：59', '陕西省榆林市靖边县张家畔街道风干羊肉剁荞面福乐园小区', '         洲际旅游成立于2019年，是榆林地区专注旅游服务的品牌，产品和服务覆盖跟团游、休闲度假游、主题定制游、单项（机票、酒店、门票）预订等多项服务，公司秉承“一次选择、一生朋友”服务理念，不断整合资源、打造产品、提升服务，成为游客信任的旅游服务商。\n', '108.793455', '37.59862', '3', '6222032610001861121', '樊焕玲', '陕西榆林工行陕西省榆林靖边县城西支行', '0', '91610824MA70AX717X', '5', '631617515@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/cec286d5dc3a57b9b833b4649046e3dc.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/3ad9128289a3fe3aa8f837d247a5a7c7.jpg', 'LXSSXZJ067B6F41', 'https://oss.wlxfq.dianfengcms.com/webupload/0ec3e603780a147a2de02e7956c8ad14.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/d3193c4c6a998e648034c78f7cec4b63.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a796973a329d20659641241ac017d4c9.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('34', '1671100937', '1671100937', '4', '陕西信天游国际旅行社有限责任公司', '21fe664ae720d9ea4651d473eefb4f5c', '0', '', '', '', '1671100937', '219.144.19.160', '0', '', '', '', '', '', '0', '0', '3', '0', '', '', '0', '', '0', '1669091144@qq.com', '1', '', '', '', '', '', '', '', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('36', '1671103328', '1677729599', '1', '榆林中辉假日旅行社股份有限公司', 'ddc37a83341397b0985a6dbdd1fdef43', '1677649683', '117.23.106.96', '榆林市中辉假日旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/e6f9e70d7eab0a617d30627bc26fae47.jpg', '1677649683', '117.23.106.96', '1', '冯永刚', '18166686005', '6:00~22:00', '榆林市榆阳区肤施路186号', '      榆林市中辉假日旅行社股份有限公司，成立于2012-06-08，由陕西省榆林市旅游局批准，经陕西省榆林市工商局登记注册，并足额缴纳质量保证金的一家旅游企业。我公司注册资本100万人民币元，坐落于榆林市肤施路186号，许可证号：L-SNX00717。我公司的经营范围包括入境旅游业务。国内旅游业务等全方位的旅游服务。我公司拥有专业的技术和销售团队，其中固定全职员工人数12人，兼职业务人员35人。公司自成立日起，公司不断探索和发展一条品质与享受相结合的专业旅游服务道路。公司以“品质化”、“规范化”、“人性化”为发展目标，以全新服务、悉心策划、注重特色为经营理念，立志在满足顾客需求的基础上追求卓越、精益求精，并且不断加大人力及技术等方面的持续投入，迅速发展了一批训练有素、经验丰富、服务热情、热爱中辉的高素质团队和高素质导游队伍，与全国各地的旅行社、酒店、车队建立了良好的合作关系与业务往来，使各类旅游产品更加完善，力争为游客提供可靠周到、品质优良的全方位旅游服务。如果您对我们的产品、技术或服务有兴趣，随时欢迎您的来电或上门咨询。\n', '109.759838', '38.278451', '3', '100800232260010001', '榆林市中辉假日旅行社股份有限公司', '中国邮政储蓄银行榆林市乡企城支行', '0', '91610800596692668 E', '1', '1215023710@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/a2826be8de6f923c4e20824e59eee64d.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/b937eb5d45aa9046c2692d9ee2866b5a.jpg', 'LXSYLSZ1CE7C918', 'https://oss.wlxfq.dianfengcms.com/webupload/a7c1932914f90a18c80573a39e7dee15.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/ade15e2c831bb8905e434baf83e2d065.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/9e0e075cc3e627929613cd3074daf4b1.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('37', '1671106527', '1677729592', '1', '陕西羊老大国际旅行社有限责任公司', '222ebf16196a7a904be3616e8dafb350', '1677749734', '1.84.220.235', '陕西羊老大国际旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/77c8dd3d3a8159658dd1eaa3ac97a433.jpg', '1677749734', '1.84.220.235', '3', '高珊', '18091257007', '长期', '陕西省榆林市榆阳区航宇路街道榆阳西路280号二毛家属院', '陕西羊老大国际旅行社有限责任公司成立于1998年3月，历经20多年的发展，是榆林经营时间早，规模大，信誉好的旅游企业。主要品牌产品有：“畅游天下”集散中心、“快乐周末”周边游、“周游世界”出境游、“励志成长”夏冬令营、“幸福老人”夕阳红、“自由自在”自由行亲子游、青年汇、精致小团定制游等。\n', '109.738891', '38.278413', '3', '2610092009024801142', '陕西羊老大国际旅行社有限责任公司', '工行西沙支行', '0', '9161080071971512X2', '1', '1065858409@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/e6c5130ada0433d019ddbee5d21cdd6e.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/4010081cb6d970cb50148c4271a198c3.jpg', 'LXSSXYL6A157D8F', 'https://oss.wlxfq.dianfengcms.com/webupload/6998d52c8db41b5bb61d6496d59ced6f.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/17152c747ce95f2008d16b2edf5896e4.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8cd1d1f52bb1d6667625fcb6188d742e.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('38', '1671106710', '1677637717', '1', '夏都旅行社', '634a88fa14846c11a40194bf48e9f20d', '0', '', '靖边县夏都旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/fcf3e60f106343182e57d9f4f12160bd.jpg', '1671106710', '123.138.80.77', '0', '高珊珊', '13669146222', '八点至五点半', '人民路广电局三楼', '夏都旅行社成立于2002年4月15位于靖边县人民路广电局三楼，是经陕西省旅游局批准成立的具有独立法人资格的旅游企业。旅行社拥有整套先进的旅游服务设施和一批训练有素，业务熟练的从业人员，业务网络遍布全国各地，旅行社以承接团队及个人国外观光旅游、学习考察、代订房、车、船、机票等主演业务。 夏都旅行社以大夏国都靖边为中心。辐射宁、陕、蒙三省（区）且首开汉回蒙民俗风情旅游线，“恪守诚信，质量至上，打造品牌，竭诚服务”为宗旨，以挖掘大夏国都统万城深厚的人文旅游资源为己任，以提供高质量，高品位的集食宿、旅游、娱乐为一体的优质服务目标。  \n', '180', '180', '3', '103608415337', '靖边县夏都旅行社', '中国银行股份有限公司靖边县支行', '0', '9161082474860500XQ', '5', '1635181581@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/8693f6dba8b21482a00f75ffa174cdca.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/4c723061f22868dac4f5288f2814805b.jpg', 'LXSJBXXAE82D1FA', 'https://oss.wlxfq.dianfengcms.com/admins/cd7ce68dafe18fef069c231c51fe2c5b.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/f411f4dc55d6df0b9f10e72b3ea6c39b.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c63236109448418cb50010a4982f7ca9.jpeg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a5ecd0a692f17eaa24dda75b83116d74.jpeg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('40', '1671151442', '1671181406', '1', '吴堡县大世界影城', '4c6ba935fe52679f7b5860bf01d7dc79', '1677668055', '117.23.100.173', '吴堡大世界影城', 'https://oss.wlxfq.dianfengcms.com/webupload/c1a2b2cf68b285ba9b190c72c90d1c38.jpg', '1677668055', '117.23.100.173', '5', '贾肖荣', '18966954168', '15：00—20：00', '陕西省榆林市吴堡县宋家川街道滨河商城吴堡县中心广场', '吴堡县大世界影城是一家全国大片同步放映的豪华3D、高清数字影院 。内设3个放映厅，其中专设一个VIP厅。采用了全进口NEC放映机。采用Le-Vision (乐视)被动式机架式3D系统(眼镜轻、薄)，金属增益幕/高增益荧幕.\n', '110.739775', '37.451667', '5', '26045101040008032', '吴堡县大世界影城', '中国农业银行吴堡县支行', '0', '91610829078631363Q', '10', '419043042@qq.com', '1', '', '', '', 'YYWBDS49ECFC4E', 'https://oss.wlxfq.dianfengcms.com/webupload/d5fd315e793d95fc800ef667b8b4fbdb.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/a069f0d397c10224df16ddd300459fbc.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ef460f56c673144a677eb181faa77192.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/51df2e59ec0bcf307a0b6fd80496e501.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/216a55c06fd65f64b9e8b802539468a2.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('41', '1671153348', '1677729583', '1', '榆林三边国际旅行社有限公司', 'c044b71d2e3c30fa167315cc2754ef7e', '0', '', '三边国际旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/aa10db04c483a6e70f09548f2bd431c1.jpg', '1671153348', '117.36.174.244', '0', '段玉宁', '15929686776', '早8晚7', '陕西省榆林市靖边县张家畔街道至味凉皮环亚大酒店', '榆林三边国际旅行社有限公司成立于2012-04-23，注册资本为300万元人民币，统一社会信用代码为91610824593325192G，企业地址位于陕西省榆林市靖边县人民路转盘阳光大厦二楼802室，所属行业为商务服务业，经营范围包含：办理入境旅行业务及国内旅游业务；代售飞机票、火车票*（依法须经批准的项目，经相关部门批准后方可开展经营活动）。榆林三边国际旅行社有限公司目前的经营状态为开业。\n', '108.79687', '37.596027', '3', '100740263200017788', '榆林三边国际旅行社有限公司', '中国邮政储蓄银行陕西省榆林市靖边县西街支行', '0', '91610824593325192G', '5', '2325966757@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/d5633e3f126f6144f8c51cb49118078c.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/0de8856008ec05068f397f5a9a3544a5.jpg', 'LXSYLSBC5A6AA91', 'https://oss.wlxfq.dianfengcms.com/webupload/f345c4b051e8b7334b55e114c12aa2dc.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/af448bd3e5ff0c4e5fd9f72766c456d1.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/322ac4a42a93a46eca50982222d1fa12.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b69f639382cb7b117689ad3f5c102303.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('42', '1671154160', '1677729567', '1', '榆林市长泰国际旅行社', '1e2d0f0c179cc682123904ef17d09693', '1677673064', '36.41.179.210', '长泰国际旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/67689c4adf612e5ba13b10bba1444577.png', '1677673064', '36.41.179.210', '8', '叶力铭', '18691233599', '周一至周日09:00-18:00', '长泰国际旅行社', '我诞生啦：2013年经省旅游局批准成立； 我的荣誉：2018年被评为“年度十佳旅行社”； 我的业务：精品旅游，商务考察，团体建设，亲子户外，蜜月旅拍，私人订制，出行租车，全球机票； 我的终极目标：共筑榆林旅游市场美好未来；撸起袖子加油干，从服务客户到服务社会。\n', '109.75638', '38.247861', '3', '102839748993', '榆林市长泰国际旅行社有限责任公司', '中国银行榆林西沙支行', '0', '91610893071279811J', '1', '819173098@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/b6504f3da409c1a7d93e4f81e58ac734.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/8edb5f4a2b49669d208ef128604910a0.jpg', 'LXSYLSC52433D37', 'https://oss.wlxfq.dianfengcms.com/webupload/48f696c1fc10ea17ed97cccea32ae857.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/9409112ee424f1ed6adcb36e6d40e799.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/66d1df08231a5550382d285145d33c5a.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('43', '1671154918', '1677729554', '1', '18992216992', 'fecb66dc74176fe388694ba1f41bc5c8', '1677582082', '113.201.88.101', '神木市麟州星光旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/9e93273e011b35af490830fc6379fa83.jpg', '1677582082', '113.201.88.101', '1', '孟鑫', '18992216992', '8：00-22:00', '神木杨业公园游客服务中心隔壁', '神木市麟州星光旅游有限公司，开展国内游、入境游、周边游、研学游、会议会展服务、党建活动、红色游、团建培训、学习考察等活动，公司LOGO为一只麒麟+泛泛星光，麒麟则代表着麟州古城，星光代表着希望的曙光，合起来便是：希望的曙光照耀在麟州古城，迸发着无尽的潜力，像麒麟一样，勇往直前。公司始终坚持核心理念：三金标准，即品质金-服务金-信誉金，摸索出了一套完善的接待服务标准，对游客进行游前叮嘱，游中问候，游后反馈，极大的促进了本公司的发展。公司自成立至今，接待游客10000余人，无一投诉，好评不断，市场反映积极良好。麟州星光坚决抵制低价游、购物团，让游客的旅游体验回归最初的状态！ 分别获得了由文旅局颁发的“文明经营场所”殊荣与“优秀组织奖”。这不仅仅是一种奖励，更是将神木旅游推向全国乃至全球的动力源泉！ \n', '110.464734', '38.907376', '3', '806051501421001475', '神木市麟州星光旅游有限公司', '长安银行股份有限公司神木市东兴街支行', '0', '91610821MA70A5BM8K', '3', '571191857@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/0bf879c7db67e02990674bdebf2f9ab5.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/ee5bbbb331433812b8d5333d238899c5.jpg', 'LXSSMSL96CB3B7C', 'https://oss.wlxfq.dianfengcms.com/webupload/19bcc996e6279235d65a6ec6f317c346.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/a9e2c8a442bc2ab7625256220fd83a36.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7289d85aabdc1d5e340e8defef979ae9.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('45', '1671157969', '1671181263', '1', 'Ask3825647', 'caf2a0b45934e11bde70842c1e780311', '1677588292', '112.46.76.214', '榆林奥斯卡古城店', 'https://oss.wlxfq.dianfengcms.com/webupload/f88f88cd204e6a3b3cad3a616e02f927.jpg', '1677588292', '112.46.76.214', '3', '18291240003', '0912-3825647', '11:30-23:00', '榆林新建南路107号', '       榆林奥斯卡影城，是一家按国际影院理念打造的新型标准化数字电影城，座落在市区最繁华的二街商业经贸圈，左右与国贸、百家、等知名商城、超市为邻，南北有世纪广场、凌霄广场遥相呼应，地理位置优越，交通便利，客源众多。影城内设3个观众厅，引进国外专业数字电影放映系统和一流的数字还音设备，将精美绝伦的声画效果全景呈现，让观众在这里可以充分领略到无与伦比的视听盛宴享受与超乎想象的动感震撼效果。\n', '109.754974', '38.285926', '5', '2610090309200180082', '榆林光影界影视文化有限公司', '中国工商银行股份有限公司榆林金沙路支行', '0', '91610800MA70DCHCXR', '1', '1349778978@qq.com', '1', '', '', '', 'YYYLASF167B208', 'https://oss.wlxfq.dianfengcms.com/webupload/957c00aaa86efa422a673b53d6ab58fb.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/a2c0847b2fafe657c63a2a7b2338f6c7.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c92b9dc4e0684f289a12446c524c5eaf.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/fe8e205232fcbb334f31bffce5b2d7b3.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c0d9ad6d2729307ed1285f776f5685cf.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/535cd45c6166c926e48f75da0c1bbbe3.png\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/6a62f376c4909f2d72fbd7f65724d054.png\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/56c354b1c86056bedc862a8cc712b516.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/04d95e46911fec40a73d10ebbb990707.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/71a41b4a7af7e1d37df1cf518bd2c162.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ea076881ed42e85836dd4f5ef34c1ed6.jpg\"]', '0', '0000-00-00 00:00:00');
