INSERT INTO `tp_seller` VALUES ('49', '1671170331', '1677729527', '1', '陕西盛世华堂旅行社有限责任公司', '7cbca6da05b69946556faed0c4c22556', '1677566820', '113.143.241.3', '陕西盛世华堂旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/efa695014022529972d7689c86bd5282.jpg', '1677566820', '113.143.241.3', '5', '奥龙梅', '15122725657', '8：00-18：00', '陕西省榆林市神木市迎宾路街道刘一锅(迎宾路店)迎宾广场', '陕西盛世华堂旅行社有限责任公：立足陕西，服务神木。隶属于华堂集团，其参股企业有天津华堂投资、北京华堂会议服务、华堂工程等是中国旅行社协会会员单位，天津市旅行社协会会员单位，中华旅游联盟会员单位。主营国内游、自驾游俱乐部、地接旅游、红色研学游、亲子游、干部红色培训等业务！做旅游我们不仅认真，而且专业，给我们一次机会，我们还你一次完美旅行！公司地址：迎宾广场南侧华堂国际旅行社，咨询热线：0912～8598610\n', '110.504498', '38.81201', '3', '806050501421001599', '陕西盛世华堂旅行社有限责任公司', '长安银行股份有限公司榆林开发区支行', '0', '91610800085973476C', '3', '2161655924@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/b20a4737f2994c9c730e76e987eecb33.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/8d8040672150acdad2113e7ceed0a44b.png', 'LXSSXSS9A40EDFD', 'https://oss.wlxfq.dianfengcms.com/webupload/d1f80cc9ebaed392b21a27fcfb9ccf91.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/c5067be42b10080ead487ce03f0488ef.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ab4754841bb15597b56353262150b8a2.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('51', '1671173883', '1677658470', '1', '靖边县华夏星光国际影城', '7084b111a00aefbe0ce1db88d06890e8', '1677658542', '36.41.183.186', '靖边县华夏星光国际影城', 'https://oss.wlxfq.dianfengcms.com/webupload/ae867e63a32488fe1be86e6604c7c2a6.jpg', '1677658542', '36.41.183.186', '2', '郭江', '18700214443', '10：00-23:00', '靖边县东大街建华商厦6层华夏影城', '靖边县华夏星光影城所在院线为华夏联合院线，是华夏电影发行有限责任公司（简称：华影公司）下属单位。华影公司是经国家广播电影电视总局批准，由国内具有实力的19家国有电影单位参股投资的股份制有限责任公司，注册资本6000万元，于2003年8月8日正式挂牌成立，面向全国发行国产和进口影片。靖边华夏星光国际影城是华夏联合院线在陕西省靖边县投资的旗舰影院，所有放映设备均为进口索尼4K数字放映设备，影城5个影厅都是3D巨幕放映厅，所有3D设备全部采用世界顶级的REALD偏振设备。高还原的环音系统配合高增益金属反包大幕让您身临其境。\n', '108.809116', '37.594681', '5', '61001697508052511405', '靖边县华夏星光影城管理有限公司', '中国建设银行靖边县支行', '0', '916108243523049052', '5', '472334953@qq.com', '1', '', '', '', 'YYJBXHA77309E0', 'https://oss.wlxfq.dianfengcms.com/webupload/9248c5a1296d035f5ab7a266a61999bc.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/8ab2d1019bc80c92717e14eb6988b8cf.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/4c682fbef790ab2c0e3e99b8accaa519.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/98e6cf582483bb880eee5032c7c78523.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/75f9201027c1964bd5e7ede3605f28a6.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/4fac02a9499dd29cd6aec67f1fa4d163.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/bbdc56c680027a60554a2c9f5bd568a3.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('53', '1671182580', '1677673237', '1', '文投国际影城榆林大剧院店', 'df949166fe15164fc369460d11281be0', '1677730429', '117.36.168.239', '文投国际影城榆林大剧院店', 'https://oss.wlxfq.dianfengcms.com/webupload/35bd92ccd930ba620dd484e7436c6d6a.jpg', '1677730429', '117.36.168.239', '3', '史小红', '0912-8150088', '9:30--24:00', '陕西省榆林市榆阳区明珠路街道榆林大剧院负一层', '文投国际影城榆林大剧院店位于榆林市高新区榆林大剧院地下一层。建设面积约2000平米，共设有6个豪华舒适放映厅，总座位数近900个，其中包含1个激光巨幕杜比全景声厅、1个全真皮可躺式VIP沙发厅、全影城配备沙发座椅、全影城激光放映，融合了集演、展、教、娱和会议等多功能为一体的综合性文化艺术场所。 地址：榆林市高新区榆林 大剧院负一层（由榆林大剧院西北角三角玻璃入口处进入）                     电话：0912-8110088\n', '109.76109', '38.23251', '5', '61050169500800002018', '榆林文投文悦文化传播有限公司', '中国建设银行股份有限公司榆林分行', '0', '91610893MA7K2G651W', '1', '455680778@qq.com', '1', '', '', '', 'YYWTGJ90DB7FF5', 'https://oss.wlxfq.dianfengcms.com/webupload/cf726f8c8e66c6d9cde3aeea9f5fb238.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/8ac9ae0e12b5535292503beb00e07700.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b6f79b04ebc48046b7f3294eff48e1d9.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/97c14798b40ea43b889bdc2cb13ec8ad.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e1c97acf4790341d7e119644d274c6c8.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7519cb4612e3929ea7f003a7233abf67.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7143f4ce1469c1b44b231456c0867bbf.png\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('54', '1671183071', '1677579227', '1', '榆林市榆阳区丰泽园影城', 'e10adc3949ba59abbe56e057f20f883e', '1677667280', '1.82.103.112', '榆林市榆阳区丰泽园影城', 'https://oss.wlxfq.dianfengcms.com/webupload/9f83cebb4a037e019a17e7c370b3ba96.jpg', '1677667280', '1.82.103.112', '2', '付小军', '15309126988', '中午十二点', '丰泽园影城', '丰泽园影城配有符合人体力学和供了极致舒适宽松德观影体验。丰泽园影城成立于2019年3月，隶属于深影橙天院线公司加盟影院。内容丰富的电影。影城坐落于榆林市榆阳区环城北路丰泽园小区5号楼一层，经营面积达3千平方米。作为化影厅，满足所有最新中外优秀大片全国同步上映的需求。订票电话:0912-3430888\n', '109.735351', '38.315812', '5', '2710012901201000037546', '榆林丰泽鑫影城有限公司', '陕西榆林榆阳农村商业银行股份有限公司长城北路支行', '0', '91610802MA70AM8U03', '1', '584935970@qq.com', '1', '', '', '', 'YYYLSYC793F0D4', 'https://oss.wlxfq.dianfengcms.com/webupload/e3d8a4efc422e8f3044ffbfe28efc8c5.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/d20455abe6b08f1deabc9e8f0562929f.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/b0a8b089c13530b8577ab654d2084f2d.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7a0eae8da49b5022812b90604d287804.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/eb84b41ede26caceea669229c4b09b5a.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e63ec32793e9fc3037dbf0d21e9fcc87.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/250df63f0fa28e588e56dd2933a96e0b.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8ef7c2b55df8d11803be11fcf10b4bab.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('55', '1671185062', '1677653727', '1', '中影星天地国际影城', '8fbc50e324ce78cd2bc4d68d391bcbcf', '1677653752', '117.23.100.244', '中影星天地国际影城东沙店', 'https://oss.wlxfq.dianfengcms.com/webupload/c00dc2802568fd29b45dadedb0c735f6.jpg', '1677653752', '117.23.100.244', '1', '贺燕', '15336231110', '10：00-23:30', '中影星天地国际影城', '中影·星天地国际影城东沙店是一家按照全国一线影院标准建设的国家星级标准电影城，影院设计风格时尚，秉承“电影艺术人生”的概念，配有符合人体力学和最佳观赏角度的舒适座椅，阶梯式座椅提供了极致舒适宽松德观影体验；影城拥有行业最高放映设备“RGB三色激光放映系统”，顶级“杜比数字影院环绕声系统”，各方面都给您都给您带来超前的观影享受，让您可以体验到无与伦比的视觉和听觉的震撼，让您身临其境般投入每一场电影当中，留下最为难忘的观影之旅。\n中影星天地影城成立于2020年12月，隶属于中影数字院线（北京）有限公司加盟影院，可同步上映中外各大影片，风格各异、内容丰富的电影。\n影城坐落于榆林市东沙新区银沙路与望湖路十字路口国贸邻里荟购物广场三楼，经营面积达2400平方米。作为一家全数字化影城，拥有6个2K全数字化影厅（包括：中国巨幕厅、豪华VIP厅、商务厅），可容纳730位影迷同时观影，满足所有最新中外优秀大片全国同步上映的需求。\n', '109.761589', '38.307049', '5', '2610095009200150692', '陕西星天地国际影城有限公司', '中国工商银行股份有限公司榆林榆阳区支行', '0', '91610800MA70CQ3R6F', '1', '516080454@qq.com', '1', '', '', '', 'YYZYXT70A08E70', 'https://oss.wlxfq.dianfengcms.com/webupload/bfc568fb7891e860b7fd8b76ac654f0e.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/d9a7c5a84886f17f143c99c242750c96.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b60d6ff764bdd34dc5f08e978a9f9689.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/041917b7bda15885e9ed6a9fcc30fd1e.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/2869e5fd6391feca8903e9891ffc6389.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b6f758bf9dd76cc796ce810bb87c67bd.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/9c1f5e5bbf1099af3209006f2567730f.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/319afed4936faa5be878eddc16249747.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('56', '1671185333', '1677746275', '1', '文投国际影城榆林店', 'df949166fe15164fc369460d11281be0', '1677730191', '117.36.168.239', '文投国际影城榆林凯信店', 'https://oss.wlxfq.dianfengcms.com/webupload/ddd0370fbdefb64e6236c7850dc431b7.jpg', '1677730191', '117.36.168.239', '3', '史小红', '0912-6080600', '9：30--24：00', '榆林文投影城', '榆林文投国际影城是隶属于陕西文化投资集团下属影业公司，属国有企业。2011年文投影城按照国际标准的五星级豪华影城投资打造的榆林第一家超豪华五星级电影院。影院设置9个豪华影厅。总座位数达到853个，最大的一号厅可容纳193人。目前引进了国际进口高端品牌巴可激光放映机，巴可激光放映机取代了原有的氙灯双机放映系统，亮度提升至60000流明，画面显示亮度是传统氙灯的四倍，更有内置3D技术，使整个画面更加通透、绚丽，颠覆了以往大荧幕画面亮度差，视觉效果差等劣势。文投影城以超一流的服务为宗旨，力求给影迷朋友带来最彻底最震撼的观影体验！  风里雨里，我们在文投影城等你！ 地址：榆林市长城南路西凯信世际广场6楼 客服电话：0912-6080600/6080800\n', '109.750953', '38.282703', '5', '17410154800000280', '榆林文投影城有限公司', '浦发银行榆林分行', '0', '916108005778349158', '1', '421374075@qq.com', '1', '', '', '', 'YYWTGJ9EF23163', 'https://oss.wlxfq.dianfengcms.com/webupload/253803aed84aab661fd57b83241551b6.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/3fdae6a50c7c748dd6c7448a9b64c716.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0124c87d38d6ab5ba58a00027e2f418c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/5ff13bab9920ebf2f30d08f33f416fd4.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/644bc094229789fb4b2683771a0be81d.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0d8f83adee34c71c82d76216ecd16340.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/bcce46f38e5912337bf2b095e8672ac5.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/78545411c1aec2dcc219e0c2e263a5af.jpg\"]', '0', '0000-00-00 00:00:00');
