INSERT INTO `tp_seller` VALUES ('59', '1671243752', '1677729516', '1', '盈科美辰国际旅行社有限公司榆林分公司', '001691a5b06bd79665cc916bf254c1b3', '0', '', '盈科美辰国际旅行社榆林分公司', 'https://oss.wlxfq.dianfengcms.com/webupload/c7129626be584bd34c84563aafaa67fe.png', '1671243752', '111.18.228.53', '0', '冯永刚', '18166686005', '9:00－17:00', '榆林市高新技术产业园区榆林大道羊老大电商孵化园3F24号', '盈科美辰国际旅行社有限公司 (简称“盈科旅游”)，隶属于北京盈科环球控股有限公司（www.yktour.com.cn），总部位于中国·北京朝阳区金和东路20号院正大中心2号17层。 盈科旅游创立于2016年1月，注册资本6亿元，分公司遍及中国200多个地级市，拥有5000余家营业部——渠道规模处于国内旅游行业领先地位；盈科旅游秉持诚信、开放、包容、共享的企业文化，致力于打造具有全球视野、本土智慧的国际化旅游集团。 《魅力中国城》是由中央广播电视总台主办，央视财经频道、盈科旅游联合制作，IP共享，由盈科旅游耗资4.6亿重金打造的大型城市文化旅游品牌推介节目。 2017、2018、2019年连续三年三季联播，全国64个城市主政者参与，以文艺、科技、创意等多种形式全面展示城市旅游资源和文化特色，凸显城市发展成果和未来发展目标，向全球推介。榆林市也在中央电视台参加了此次节目竞演。 2017年、2018年连续两年，《魅力中国城》被中央广播电视总台列为年度台级重点节目。如今，《魅力中国城》观众覆盖人数超4亿，已经成为文旅行业现象级IP。 《魅力中国城》堪比一部中国的“城市百科全书”。作为一档大型城市文化旅游品牌推介节目，《魅力中国城》在文旅脱贫、城市转型、生态保护等方面为城市提供了强大的助力，让参与城市更加充满信心地面向未来，走向更加美好的明天！\n', '109.739258', '38.233536', '3', '102480129273', '盈科美辰国际旅行社有限公司榆林分公司', '中国银行榆林高新技术产业园区支行', '0', '91610893MA709P63X9', '1', '1362787984@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/e8e5515ea24432327a24acf6972d5855.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/3f6c110d0ddf08b8852875d371a56d88.jpg', 'LXSYKMC3FDD5680', 'https://oss.wlxfq.dianfengcms.com/webupload/2be61f538c21b8297c7b872a24fbcbf4.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/f03066cfa3832f03edc72edac817c9a7.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/83afd91e2ea141a19c0eb8c282e67990.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('60', '1671416870', '1677729506', '1', '15229522762', '9956816b7cb2a29c7d8bef5785002f64', '1677652315', '117.36.192.210', '榆林市山丹丹旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/432c03d3d38d3e81b18060bd12f1b778.jpg', '1677652315', '117.36.192.210', '3', '尚林林', '15229522762', '8：00—18：00', '榆阳区新建南路1号', '榆林市山丹丹旅行社有限公司是榆林市恒泰汽车运输集团旗下的全资子公司，拥有14家直营分社及服务网点，分布在榆林市12个县区。旅行社依托于恒泰汽车运输企业的规模与历史优势，充分发挥运输与旅游结合的运营特点，以“品牌化、规模化、优质化”为目标，为客户提供全方位的旅游出行及延伸服务。榆林作为五省一市旅客集散中转地，旅游发展形势良好。我司现已与各县区文旅局合作建成榆阳区南北车站、榆林火车站、榆林机场T2航站楼、神木车站旅游集散中心，米脂县旅游集散中心已启动建设，其他县区正在积极协调旅游集散中心合作事宜。\n', '109.756805', '38.282768', '3', '61050110411300000110', '榆林市山丹丹旅行社有限公司', '中国建设银行股份有限公司榆林长城路支行', '0', '91610802776980122c', '1', '1948561652@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/381be905400d71ca554ae53dcc9cbbf2.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/ca99f5c9c39f77ae757ca8db4cc83369.jpg', 'LXSYLSSD6B30569', 'https://oss.wlxfq.dianfengcms.com/webupload/2c3fab4524fe170533c5798aaeff070b.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/4f5a74de966cc238fafbe9d3c86e3975.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1b228e5786efbda86925ac722688367d.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('63', '1671423252', '1677728778', '1', '15547760067', 'c0e1fdbeedca377dfc015c12f61e6759', '1671498134', '124.23.133.116', '二郎山景区', 'https://oss.wlxfq.dianfengcms.com/webupload/e3a57116f82788d841fcb0e290887773.png', '1671498134', '124.23.133.116', '1', '刘晓坤', '15547760067', '08：00-17：30', '二郎山风景区(东门)', '神木二郎山，麟州胜景，国家4A级景区，因山体形状如骆驼双峰，又名“驼峰山”。海拔高度1082米，素有“陕北小华山”的美称，是神木的标志性景观。儒释道三教合一是二郎山的独特之处，地藏洞、二郎庙、三教殿，祖师庙，娘娘庙等百余间庙殿亭阁，错落有致的分布于山脊之巅，是人们心中的祈福圣地，塞上神山。\n', '110.499807', '38.810138', '2', '2710021301201000122247', '神木市杨家将文化创意产业发展有限公司二郎山分公司', '陕西神木农村商业银行股份有限公司城区支行', '0', '91610821MA70EL5PX0', '3', '574554853@qq.com', '1', '', '', '', 'JQSMEL9393C88C', 'https://oss.wlxfq.dianfengcms.com/webupload/fd3aec7fd0166d5d415afb48bba3b93e.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/f0523609a98dcc2fd6330cce170e4d0f.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c0d886eb19f3191f4a7485aacaf166d5.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/fc196d7f46517944412811e52d21f1a0.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('64', '1671423369', '1671590472', '4', '靖边县万达恒业影城', '5da2ba6fbe567484f98fd146def35558', '0', '', '', '', '1671423369', '111.21.229.162', '0', '', '', '', '', '', '0', '0', '3', '0', '', '', '0', '', '0', '12436826@qq.com', '1', '', '', '', '', '', '', '', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('65', '1671427476', '1672735553', '1', 'Ylygyc@163.com', '6c7f76c29784075b110b84e40672fcdf', '1677653379', '113.200.209.41', '榆林市阳光国际影城', 'https://oss.wlxfq.dianfengcms.com/webupload/350953871784502c0ca004ab57bfeacd.jpg', '1677653379', '113.200.209.41', '3', '朱腾飞', '17795976161', '9:30-23:00', '陕西省榆林市榆阳区明珠路街道阳光国际影城(邮储银行VIP体验店)阳光广场', '榆林阳光国际影城是按照国际化标准兴建的多厅影院，影城共有4个影厅，共有500坐席。立足于榆林市高新区购物中心地带，采用国际最先进的放映设备，配合阳光一流的服务理念，所有设计和细节都充满专业化及人性化，最大限度的满足了影迷的舒适度需求。影城超大的整壁式高清晰银幕、独特的阶梯式座椅设计、国际最先进、最尖端的进口数码放映设备和双制式数码立体声专业音响系统融合成顶级的视听享受，使每位影迷均置身于逼真的高清晰场景和震撼的超级视听效果，感受非同一般的梦幻体验。\n', '109.759637', '38.238403', '5', '961009010001780714', '榆林市阳光影城有限公司', '中国邮政储蓄银行榆林市分行', '0', '9161089330530382xp', '1', '491897021@qq.com', '1', '', '', '', 'YYYLSY190048B3', 'https://oss.wlxfq.dianfengcms.com/webupload/98c51a18349fcc4a6373c4560e73f0a0.png', 'https://oss.wlxfq.dianfengcms.com/webupload/69e8d0a6848175da1d50e9e38aa406c0.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/830ba4b14b9e292a9802d9c04f27c22c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0da147a520f7d589fce716dcf0e6392b.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/85626cc4edd9682650dd4c7a4b18d445.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/6605e6a8be14668283c3c13ca322f611.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/14b086237673eb2108c306ff909ed269.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/5c04e8190fb4f57d4bd010f2dc1f36a7.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b7a7cd2639578ab470f3d716267367af.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/81bb0d92c61af03df24b5900c62ba797.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('66', '1671429305', '1677737052', '1', '佳县白云山旅游服务公司', 'adc29f404c5d8ef6ce142213ae2235fe', '1677737144', '106.36.152.122', '白云山景区', 'https://oss.wlxfq.dianfengcms.com/webupload/1abc3fbf20866ffb7e6141ee5e835330.jpg', '1677737144', '106.36.152.122', '1', '刘军泽', '15319637677', '夏季 早 6 时 — 晚 18时、冬季 早 7时 — 晚 17时。', '佳县白云山旅游服务公司', '佳县白云山旅游服务公司成立于1987年6月，公司注册资金108万元，主营白云山景区旅游门票及旅游服务等项目。公司拥有办公住宿以及营业售票房等占地面积约1.2万多平方米。 2021年初公司景区管委会为发展旅游事业，增加注入资产及资金1.08亿之多，打造白云山景区更好的为游客服务。    公司现有职工89人年接待游客180多万人次，营业收入近千万元。主要以经营景区门票业务和旅游服务。“优质服务、信誉第一”为公司公司的立身之本，严格管理、效益至上为公司的经营管理理念。2017至2019度被榆林市宣传部榆林市文化广电新闻出版局评为领军企业。\n', '110.519703', '38.000361', '2', '20361089900100000464701', '佳县白云山旅游服务公司', '中国农业发展银行榆林市分行营业室', '0', '91610828MA7030X571', '9', '1440386131@qq.com', '1', '', '', '', 'JQJXBY4D8DC74E', 'https://oss.wlxfq.dianfengcms.com/webupload/b0dcfa2ab0798571ed2c25950375b858.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/28e02e6ac21255b071ad73645ec2d5d4.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/567ad7d5a09e50c666a32c290682191b.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/d91e833551edc09a5e3c1464761fdc4f.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('69', '1671436195', '1671495428', '4', '榆林市龙行文化旅游运营管理有限公司', 'dcc8f42d32853bd435511d6bc6a7ba4a', '0', '', '', 'https://oss.wlxfq.dianfengcms.com/webupload/38d5e737ffa8696bdc3b8c131b62a393.png', '1671436195', '111.18.208.12', '0', '', '', '', '', '', '0', '0', '3', '0', '', '', '0', '', '0', '1032113544@qq.com', '1', '', '', '', '', '', '', '', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('70', '1671437873', '1672735507', '1', '陕北古风文化园', '44fdb9a694b0271c38bc884cce250daa', '1677671639', '223.104.205.137', '陕北古风文化园', 'https://oss.wlxfq.dianfengcms.com/webupload/73ff027609ec5db6a6a5fb3098631c6c.jpg', '1677671639', '223.104.205.137', '13', '陈彦', '18791827118', '9：00-17：:00', '榆林市高新区轻工路1号', '陕北古风文化园系朔方文投名下投资的文化园区其中朔方博物馆为核心，朔方博物馆筹建于2017年，是以陕北地区自然演变和历史文化为展陈主题的非国有博物馆。朔方博物馆立足陕北，收藏、陈列了陕北地区自然演变的见证物和人类文化的遗存物等大量珍贵藏品。博物馆以历史年代为主线，主要展出远古时期陕北地区的动植物化石，石器时代的各种文化类型遗留物，以及夏商周至明清时期的历史遗留物等，突出反映了陕北地区农耕文化与游牧文化相互冲突、相互融合的历史特点。     此外，博物馆设置了两个临时展区：陕北汉画像石展区和明清古家具展区，给博物馆六个陈列展览填补了更加丰富的历史文化内容。陕北汉画像石主要展示了东汉时期陕北的社会风貌以及中国古典美术的发展；明清古家具陈列则集中展示了中华古家具的简约造型、精湛雕刻和悠长意蕴，充分表达出中华传统审美的精髓所在。    博物馆立足传统文化，又相应延伸出了博物馆研学实践基地的社会服务项目和博物馆文创产品的开发运营项目，通过自媒体和线下活动的宣传，在双休天和节假日吸引了大量游客，尤其是根据不同时间段和体验人群制定的一系列专属课程得到了体验者的广泛好评，我们旨在通过博物馆社会宣传的重要功能推动本土文化产业的进一步延伸，同时也客观上丰富了非国有博物馆的经济源泉。相对于研学活动的如火如荼，我馆文创产品的销售运营则不容乐观，尤其是在近三年的特殊时期下，在提升文创产品的畅销度上更显乏力，但不妨碍大众对其喜爱和关注程度还是一直保持上涨的态势，究其原因是其充分吸收了具有地方特色的文化元素，彰显的是地方代表性文化的内涵和底蕴，表达的是人民群众喜闻乐见的艺术品味，作为文化的传播者我们希望能打好地方文创这张牌，进一步挖掘本土特色文化以及更好地传承濒危的传统手工艺，不断加强文创产品的价值赋能，满足受众的审美和情感需求，来激发榆林乡村振兴的不竭动力。\n', '109.745227', '38.224708', '2', '6214859120768443', '孙庆国', '中国招商银行', '0', '91610800052138968M', '1', '441049571@qq.com', '1', '', '', '', 'JQSBGF8CD1FA9B', 'https://oss.wlxfq.dianfengcms.com/webupload/ffde1d01619a7f845ba1bbfbac3eaac6.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/57b45c62b73b56591e16d950739a4f57.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8135cab2b932a0f5d269b36d24ba76d2.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/baf2810b930187afb30e0da31371d5b7.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('71', '1671442186', '1677728794', '1', '陕西塞上旅游发展有限公司', '994edef89864d312aa3325c7a835edbb', '0', '', '军旅文化园', 'https://oss.wlxfq.dianfengcms.com/webupload/c409952ae606bdfc884b061c32a68d85.jpg', '1671442186', '111.18.115.195', '0', '刘树丽', '13992208532', '9：00—17：00', '榆林军旅文化园', '陕西塞上军旅文化园位于榆林市榆阳区芹河镇纪小滩村补龙湾，距市中心8公里，毗邻火车站高铁站、榆阳机场、包茂高速等交通枢纽。 国区占地 363 亩规划总投资3亿元现已投资1.4亿多元建成了对越自卫还击作战纪念馆、南疆记忆馆、榆林革命史纪念塔、仿真武器展区、军事拓展训练区、研学旅行体验区、军旅大舞台、水上乐园、游乐园、采摘园、一品花海、餐饮住宿部、大会议厅，可同时容纳1000 多人食宿、教育、培训、开会。 园区主要以红色文化展览、国防安全教育、爱国主义教育、军事科普教育、党员干部警示教育、军事拓展训练、研学旅行实践、党建团建活动、军事文化展览、会议培训、观光旅游为主要内容面向社会开展各类特色活动。目前已开展培训活动 1400 多期，培训人员 16 多万人次;接受爱国主义教育、开展国防教育、体验军旅生活者达 166 万多人次，向社会各界免费开放教育场馆，减免门票、停车等费用3300 多万元。 走进陕西塞上军旅文化园，让我们共同领略共和国旗帜上血染的风采，铭记人民英雄攻坚克难、不怕流血牺牲、无私奉献的爱国主义精神传播社会正能量!\n', '109.639094', '38.317734', '2', '2710010101201000092223', '陕西塞上旅游发展有限公司', '陕西榆林农村商业银行股份有限公司', '0', '9161080259330878XF', '1', '2960274347@qq.com', '1', '', '', '', 'JQSXSS26D43A10', 'https://oss.wlxfq.dianfengcms.com/webupload/75569aacfd921f21a4e12483938c6348.png', 'https://oss.wlxfq.dianfengcms.com/webupload/67bf73623da13ec203ac1cb3a69f56fd.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/e3ec21b6fc15dfeb1de4287f393cc9ba.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8ff28f58fce29cfb5f2cf12b948ea0ff.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ae12d31da13eb1000c00874b50a826ea.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('76', '1671497426', '1672735447', '1', '红石峡景区', '8e36e57dd23fc8f60c62a5d4a2195e0b', '1677718423', '124.89.71.23', '红石峡景区', 'https://oss.wlxfq.dianfengcms.com/webupload/06c389b081318111b9fcbc6bcb864227.png', '1677718423', '124.89.71.23', '8', '贾卫兵', '15389597688', '8：00-17：30', '陕西省榆林市榆阳区鼓楼街道红石峡景区红石峡生态公园', '红石峡位于榆林市城北3公里处，距离榆林市区仅5公里。红石峡谷长约350米，峡谷东崖高约11.5米，西崖高13米，东西对峙，峭拔雄伟。峡内榆溪河水穿峡而过直达城西。古代驻守榆林的文人墨客甚至武将都喜好到红石峡题刻以抒发边塞豪情壮志，所以红石峡又是长城书法艺术的一大宝库。从题字的内容，可以看出榆林古时“九边重镇”的地位。此外，还可以欣赏到宋元时期的石窟艺术。赶上晴天，就可以一睹“红山夕照”的风采：夕阳之下如同晚霞一般绚丽的红石峡风光。是著名的“榆林八景”之一。\n', '109.724002', '38.328695', '2', '456950100100171100', '榆林市龙行文化旅游运营管理有限公司', '兴业银行股份有限公司榆林分行', '0', '91610800MA70B57J3L', '1', '18591227138@163.com', '1', '', '', '', 'JQHSXJ08D8FA15', 'https://oss.wlxfq.dianfengcms.com/webupload/c1837728568db21f6756408e17365e6b.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/56d93f4c6be1cc42a208831c8b72a658.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/6393f5bd879561f7593af79001d8f177.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b747967d1e738f7c721a6702ceb7f72b.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('77', '1671497759', '1671520935', '1', '镇北台景区', '8e36e57dd23fc8f60c62a5d4a2195e0b', '1677720179', '1.82.101.141', '镇北台景区', 'https://oss.wlxfq.dianfengcms.com/webupload/ba1ac332a71504390f3d412a66473285.png', '1677720179', '1.82.101.141', '6', '刘建华', '13109225252', '8：00-17：30', '陕西省榆林市榆阳区鼓楼街道镇北台长城景区', '镇北台，位于陕西省榆林市榆阳区的红山顶上，建于明万历三十五年（1607年）四月至明万历三十六年（1608年）七月，占地面积5056平方米，属于明长城防御体系的观察所之一，是中国古时重要的关隘和军事瞭望台，为中国古长城沿线现存最大的要塞之一，素有“中国长城三大奇观之一和万里长城第一台”之称。\n', '109.732762', '38.336658', '2', '456950100100171100', '榆林市龙行文化旅游运营管理有限公司', '兴业银行股份有限公司榆林分行', '0', '91610800MA70B57J3L', '1', '1017793887@qq.com', '1', '', '', '', 'JQZBTJ8630D678', 'https://oss.wlxfq.dianfengcms.com/webupload/070e0dfb9c0c0dd609f7caf6b73dcb5f.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/f66d7c84ffe41df830e0076ee0c101ed.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/3c854dd9c1c11e93675ec3cfb36c1b7d.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/eaef4a6473247187e2db2be2f6e03b4f.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('78', '1671505745', '1677729455', '1', '靖边康乐旅行社', '097cbe3b9a296d29d21744745daf1e34', '1677640632', '223.104.205.177', '康乐旅行社靖边分公司', 'https://oss.wlxfq.dianfengcms.com/webupload/8e196ce67e8a820dacdf4b6ad59c7405.jpg', '1677640632', '223.104.205.177', '4', '张玉霞', '18609127506', '8:00-17.30', '紫园宴会中心向南100米永冠超市4楼', '榆林康乐旅行社于1999年6月陕西省旅游局批准成立，具有独立法人资格的旅游企业，史榆林市实力雄厚的旅行社之一。\n', '108.800176', '37.588958', '3', '26090601040010643', '榆林市康乐旅行社有限责任公司', '26090601040010643', '0', '91610824MA7039K90', '5', '294489614@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/58b660b7376310b4bb8ee1a72ad8f3f9.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/0b8c8a1908ba58875607c59b7a87f9d2.jpg', 'LXSYLSKD1F3826E', 'https://oss.wlxfq.dianfengcms.com/webupload/b5baf6ce909b88ca76c9f62b966b5f95.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/bc518ca5a01a10bbf4522114730fde40.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1d9977f1828d3955b5b2bae685862963.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('80', '1671509764', '1677727951', '1', '大漠漂流', '4b64ebf315b8a6d1a25190a0f76c5dd4', '0', '', '大漠漂流', 'https://oss.wlxfq.dianfengcms.com/webupload/5140648948caecbf674d97c8b438b3c0.png', '1671509764', '113.135.194.18', '0', '张磊', '13572681155', '09:30-18:00', '陕西省榆林市榆阳区孟家湾乡圪求河大漠漂流景区', '圪求河大漠漂流全程4公里，漂完全程需1小时，河道两岸景色不同，沙漠漂流仿佛在各种景致当中穿越，让人目不暇接，感触颇深！一座长达130米的网红玻璃滑道镶嵌在上码头沙海当中，顺着滑道飞入河中，把人造加自然完美的融合在一起，漂流路线可分为四段。         第一段我们称之为“穿越绿洲”。欢乐的游客乘舟下水，此时的河道两岸郁郁葱葱沁人心脾！置身在绿洲丛林，一边是田野一边是绿树，凉意顿时袭来！好不惬意！         第二段“沙漠行舟”游客乘船顺流而下刚经历了丛林绿茵又进入鸣沙弯道，河道两岸沙丘起伏穿越其中仿佛在沙漠中行舟，这里能看到千只沙燕在沙丘上筑巢，盘旋在半空当中，沙漠、燕子、碧水共同构成一副人与自然和谐相处独特风景。       第三段“芦苇丛林”沙漠中驶出便来到芦苇荡中，水流缓慢，芦苇高高耸立，岸边蛙叫不绝于耳，苇稍随风摆动，林间百鸟争鸣，此刻凝心静气，快意凉爽，让您流连忘返！ 第四段“雾化仙境”2022年最新投入100米雾化设备，人工在自然河道造景，此时漂流已经接近尾声，当小船缓缓驶入雾化仙境当中，仿佛在仙境漂流，喷雾水经过六级净化雾化到空中，朦朦胧胧湿润凉爽，过往游客无不竖起大拇指，雾化仙境起到了画龙点睛的作用。\n', '109.591128', '38.586284', '2', '61050169004300001471', '榆林圪求河乡村旅游服务有限公司', '中国建设银行有限公司榆林高新技术产业园区支行', '0', '91610802MA70CXWD5Y', '1', '1401894655@qq.com', '1', '', '', '', 'JQYLGQ033FBDFC', 'https://oss.wlxfq.dianfengcms.com/webupload/f10d68278da6c51a584a4505d1e855e9.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/a2e669cd0ca2497219ff714a14426e9a.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/64677cc0057ccf67b53a5bfc7a255145.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/f283245ceba9b97606f9ff36504a8286.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('82', '1671513147', '1671513147', '4', '榆林市榆阳区容大影城', 'a409357e26b91db72d02a3ddb0fad755', '0', '', '', '', '1671513147', '1.84.216.2', '0', '', '', '', '', '', '0', '0', '3', '0', '', '', '0', '', '0', '1379707999@qq.com', '1', '', '', '', '', '', '', '', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('86', '1671525100', '1677728737', '1', 'BLW', 'fdf21bad684decb5ddc9aa639a111205', '1677632737', '106.36.10.78', '碧麟湾景区', 'https://oss.wlxfq.dianfengcms.com/webupload/2b523715a00e459eb533dba122be463e.jpg', '1677632737', '106.36.10.78', '4', '李成', '15191822973', '09：00—18:00', '榆林市神木市迎宾路街道办解家堡村碧麟湾景区', '碧麟湾位于神木市迎宾路街道办解家堡，距神木市区10公里处，仅15分钟车程。处于秦晋蒙三省交汇地带，地理位置优越，交通便利。\n碧麟湾景区总占地面积4200亩，水域面积500余亩，始建于2012年，总投资2.8亿元。 石山傲然如麒麟，蜿蜒寒碧卷深情。东汉许慎有言，“碧，石之青美者”，亦指湖清如碧; 麟，是中国古代四大灵兽之一，神木古称麟州。而景区的麟波湖恰似一只麒麟，蜿蜒盘卧于景区中央，故取名碧麟湾。\n碧麟湾景区是以生态农业为依托，以湖光山色揽胜，集休闲旅游，研学拓展，近郊游乐， 康养度假，宴会宴请等多功能为一体的综合性旅游景区。景区现有水上，地面，高空三大板块二十多个游玩项目。\n【观光游船】12艘游船，您可以自驾画舫，泛舟南北，也可乘快艇畅游，尽享惬意时光。\n【疯狂海啸池】在这里您可以体验3米高的人造水浪，不用去海边，也能体验“海上巨浪”的震撼和刺激。\n【露天泳池】喜欢游泳的小伙伴可以在这里尽情嬉戏游玩。\n【儿童水魔方】10多项水上游玩项目，梦幻水城堡、水际争霸、活力大冲关适合亲子游玩。\n【嘻哈乐园】内融合了30多种游乐设施，有蹦床，攀岩，考古基地，粘粘乐，疯狂斗牛，健身投篮，VR等项目。\n【高空滑索】一索横跨麟波湖，只需40秒便可抵达对岸。\n【9D玻璃桥】全长268米，距湖面垂直高度108米，犹如一道彩虹，将景区全貌尽收眼底。\n【玻璃滑道】原始自然，滑行快速，老少皆宜。\n【高空漂流】全长1200米，蜿蜒曲折，以山而建，漂流滑道落差大，速度快，坐在皮筏中犹如过山车一样。    \n【步步惊心桥】需要你一步步的迈过悬空的每一块桥板，游客在感受空中漫步的同时，还可以俯瞰麟波湖。\n【玻璃挑战桥】步步惊心桥的升级版，所有板桥都用玻璃替代，进一步增加了刺激的程度。\n【悬崖秋千】顾名思义乘坐着十几米的大秋千在百米悬崖边高速荡漾，网友戏称人在前面飞，魂在后面追。\n【又见侏罗纪】恐龙园是以恐龙为主题，融合博物、科普、娱乐为一体的综合性主题乐园。\n【彩虹滑道】全长160米，美的只是彩虹滑道的外在，急速、旋转、失控多种感受、多种玩法使得彩虹滑道成为了碧麟湾又一网红打卡项目。\n【竞速卡丁车】是西北五省内最长的卡丁车专业赛道。竞速赛、里程赛体验速度给你带来热血沸腾的感觉。\n【疯狂老鼠过山车】亲子儿童都可以玩的娱乐型过山车。可爱小老鼠的造型，时而急速俯冲，时而回旋腾挪就像一只灵活的小老鼠穿梭在丛林之间。\n【枪林弹雨射击场】橡胶弹丸，八倍镜，让你瞬间成为一名百发百中的狙击手。\n【弓箭射击场】百步穿杨，正中靶心，化身为神箭手。\n【旋转木马】伴随着音乐的节奏，骑在木马上瞬间带你回到童年的快乐。\n【海盗船】海盗船启动后从缓慢摆动慢慢的急速摆动，乘客乘坐于海盗船之上，随着由缓至急的往复摆动，犹如莅临惊涛骇浪的大海之中，时而冲上浪峰，时而跌入谷底，惊险刺激，挑战你的失重和心理承受能力的极限。\n\n【摇头飞椅】摇头飞椅也叫升降飞椅，是集旋转、升降、变倾角等多种运动形式于一体的大型飞行塔类游乐设施，安全措施到位，造型华丽。\n', '110.529516', '38.707037', '2', '2710020701201000019267', '神木市碧麟湾休闲农业有限公司', '陕西神木农村商业银行股份有限公司麟州路支行', '0', '91610821583543612D', '3', '459727034@qq.com', '1', '', '', '', 'JQSMSB00B066FA', 'https://oss.wlxfq.dianfengcms.com/webupload/0c41caf313de81ea355497ad9ecd07c6.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/846303bb3654a9caa2f925cc2384f76a.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/03fe53069d7352db9dce14f696c849a6.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/87603749316e632b0e061a507f07bf73.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('87', '1671525868', '1677729440', '1', 'yyulinmeicheng', 'fcd54bd2c4e10809698b56a0d0216d3a', '1677718755', '117.23.106.61', '榆林美程假日旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/62f8226b9b41972b1fe06a8444063f36.jpg', '1677718755', '117.23.106.61', '13', '韩廷', '13335320876', '全天', '陕西省榆林市榆阳区航宇路街道富康路148号邮政大楼', '榆林美程假日旅行社有限责任公司，简称：美程旅游。是由原榆林心连心旅行社更名而来，成立于2006年，注册资金300万，许可证号：L-SXN00398，经过12年的发展目前是榆林市规模较大的旅行社， 2017年与国家级AAAA景区太行山大峡谷、AAAAA皇城相府等签订战略协议，成功开通太行山大峡谷直通车，皇城相府、云台上 青海、甘南、内蒙古黄花沟等热门线路直通车，受到市场一致好评。公司口号：美程旅游，不负旅行好时光。\n', '109.749962', '38.259633', '3', '103205791487', '榆林美程假日旅行社有限责任公司', '中国银行股份有限公司榆林榆阳支行', '0', '91610800790761241M', '1', 'fenhe518@126.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/4baedf289aa88ae5e4c0207de6da22f0.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/028bb7b78a6b63b76ea96e03858d32df.jpg', 'LXSYLMC7490CB8E', 'https://oss.wlxfq.dianfengcms.com/webupload/1e83e3edbb7a85815beeedd341251418.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/ff263a797c9c368b6fff28f2e64c2558.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8eae6bc32e5dd2579777ba937dc32d12.jpg\"]', '0', '0000-00-00 00:00:00');
