INSERT INTO `tp_seller` VALUES ('89', '1671533049', '1677729430', '1', '神木市神旅文化旅游有限责任公司', '080f8646519b31643c43adaa8cf7554d', '0', '', '神旅文化旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/eb55d896ceb085adeaceffb182dbbf74.jpg', '1671533049', '124.23.133.42', '0', '刘宁', '13772940505', '08：00-18：00', '神木市神旅文化旅游公司', '神旅文化旅游公司，是一家以地接游，周边游、国内游为主的本土旅行社，主要从事招徕和接待中国公民境内旅游，承办各种会议、展览，安排商务考察、学术交流、探险、文化教育、体育比赛、文艺演出等专项活动。追求卓越是我们发展的动力，持续学习是我们成功的保障，求真务实、创新进取、诚信服务、以人为本使我们秉承的经营管理理念，以顾客为中心。\n', '110.498868', '38.842498', '3', '2710020301201000175384', '神木市神旅文化旅游有限责任公司', '陕西神木农村商业银行股份有限兴城支行', '0', '91610821MA70ETL5XX', '3', '1956401484@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/18e6dbe1e366554defdb473b9acf3cb6.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/98a5186f196d490e5d8ee155da232666.jpg', 'LXSSMSSFA25A55F', 'https://oss.wlxfq.dianfengcms.com/webupload/9a28027849d381cbe00a412169fe017a.png', 'https://oss.wlxfq.dianfengcms.com/webupload/1f7d019a43bbbbb688c8adf8d9f4643a.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/70737446ed1061504f3c7a2889207d8a.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('90', '1671584230', '1677729399', '1', '13409192238', 'e5008a7d31e827bef6e96a690da2f7bf', '1677633078', '117.36.172.2', '靖边县阜美旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/b79fd1d9763bdf97796f74cf9d9d0c98.jpg', '1677633078', '117.36.172.2', '2', '石涛', '13402928623', '8：00----18:00', '靖边县文旅集团有限公司', '靖边县阜美旅行社是靖边县首家县属国有旅行社，主要营业范围:国内旅游、入境旅游、秦晋甘宁蒙连线旅游、摄影探险旅游、专业波浪谷丹霞地貌景区地接、陕西景区门票酒店餐饮预订、汽车租赁等旅游业务。 我社本着“服务第一， 顾客至上”的服务理念， 为游客提供全方位的旅游服务。  \n', '108.806935', '37.601074', '3', '61050169750800000519', '靖边县阜美旅行社有限责任公司', '中国建设银行股份有限公司靖边县支行', '0', '91610824MA70AA1Y6D', '5', '1285662216@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/30aa1ffe49d55c3af3ca90db0e154b68.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/a28ee6fcc23e21422fc1596193101783.jpg', 'LXSJBXFAB26F1CE', 'https://oss.wlxfq.dianfengcms.com/webupload/22f614f17d7ae2f4454d9d4dd9a08b64.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/ee2a4e4a82afbf0d11ca8e22eeef4088.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ed2620fd26b61dfc2c36743972f2ed96.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('91', '1671593008', '1677729392', '1', '陕西塞上天骄旅行社有限公司', '265b96db2360061b077999d7486cc6f4', '1677639114', '124.115.107.1', '陕西塞上天骄旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/ed081f370cb4b1c016e67c7225067342.png', '1677639114', '124.115.107.1', '4', '张春健', '15891139256', '09:00-18:00', '陕西省榆林市榆阳区明珠路街道天源路53号溪苑北区', '    陕西塞上天骄旅行社有限公司成立于2018-01-11，总社地址位于：陕西省榆林市高新技术产业园区天源路国土局家属院北面13号商铺，神木门店地址：陕西省榆林市神木市滨河新区和谐家园东门。经营范围包含：出入境旅游服务；国内旅游服务；旅游项目的开发、管理及服务；餐饮服务；票务代理服务；旅游信息、商务信息咨询；旅游、文化艺术交流活动的组织与策划；展览展示服务；会务服务；工艺品、服装鞋帽、办公用品、文体用品、日用品、农特产品的销售。\n', '109.759335', '38.244798', '3', '61050110569800000149', '陕西塞上天骄旅行社有限公司', '中国建设银行股份有限公司榆林西沙支行', '0', '91610893MA708QXQ7W', '1', '583714275@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/admins/ad15a88ea6cc1badd9af0bf978823587.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/13f9af54cadca5dcbe6efd9134ec5682.jpg', 'LXSSXSSAE6CF52A', 'https://oss.wlxfq.dianfengcms.com/admins/30d960ef3d7d5a29d41433493672668f.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/e230ae38438094b49d9537963031c322.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1d7e1747a76997d31edf1ca97406ff09.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('92', '1671598837', '1677729383', '1', '吴堡华夏石城旅行社有限公司', 'fcdf507d0b7a0bda14a7997c7a14ceef', '0', '', '吴堡华夏石城旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/2277d854c7e400517dc82c740b17039f.png', '1671598837', '113.135.197.9', '0', '李文利', '13909125330', '8：00—18:00', '陕西省榆林市吴堡县宋家川街道迎宾大道天星宾馆(黄河大道)', '公司名称: 吴堡县华夏石城旅行社有限公司 公司性质: 有限责任公司: 注册资金;  100万元; 经营范围:国内旅游服务;研学活动; 入境旅游服务; 会议服务;  文化艺术交流活动; 土特产销售；承办展览展示活动。公司地址:吴堡县宋家川镇建材路。 公司为自然人独资注册资金100万元人民币公司将随着市场的发展客源的增多利润的加大今后将会继续以货币或实物的形式追加投资。从而扩大企业规模进一步提高企业的经营能力和抗风险能力。\n', '110.726574', '37.450517', '3', '961002010006566750', '吴堡华夏石城旅行社有限公司', '中国邮政储蓄银行吴堡县支行', '0', '91610829MA709Q3K2N', '10', '958139916@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/48cd1396cc1c134f3a13f4da7fecb158.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/8c6e572e50a5d6201ef426f855f505f6.jpg', 'LXSWBHXD54D4A3A', 'https://oss.wlxfq.dianfengcms.com/webupload/3fd353569dd8ede98eb868ad6527f7af.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/819f4daf4102ec1504880dc14464e499.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b6d78fe3c9d3661ae27e7524d3e0cfcc.jpg\"]', '0', '0000-00-00 00:00:00');
