INSERT INTO `tp_seller` VALUES ('98', '1671686452', '1677728728', '1', '神木市红碱淖旅游发展有限公司', '5d21898afb0121efd8f2fffc0c0b848c', '0', '', '红碱淖景区', 'https://oss.wlxfq.dianfengcms.com/webupload/0ea45d12c4f1fd3a947932f016839c35.jpg', '1671686452', '113.134.218.136', '0', '李平', '13379398766', '9：00-17：00', '陕西省榆林市神木市尔林兔镇迎亲路红碱淖风景区', '红碱淖景区简介 红碱淖位于陕西省最北部，距离神木市区70公里，地处鄂尔多斯草原和毛乌素沙漠交汇处，是中国最大的沙漠淡水湖，素有“大漠明珠”和“沙漠里的大海”之美称。红碱淖先后被评为省级风景名胜区、国家4A级景区、国家级水利风景名胜区、国家级自然保护区。 红碱淖水域辽阔，湖水面积35平方公里，沿岸有七条季节性河流注入，平均水深8.2米，最深水位12米。红碱淖自然环境保护完好，生物物种丰富多样，被誉为榆林、鄂尔多斯地区的肺和肾。 红碱淖湿地是全球最大的珍稀濒危鸟类—遗鸥的繁殖与栖息地，每年4-8月份，有占全球数量90%的遗鸥在这里繁衍生息。另外，还有白天鹅、金雕、红脚隼、赤麻鸭、鸳鸯等50多种野生鸟类。天空湛蓝，湖水碧绿，大漠金黄，草原辽阔，牛羊成群、百鸟翔集，这些景色一起构成了红碱淖景区独特的自然风光。 红碱淖景区依托得天独厚的自然优势和区位优势，经过了近30年的发展，已成为集休闲、旅游、观光、度假、娱乐为一体的综合服务体。目前，景区拥有水上拖拉伞、漂移艇、豪华游艇、快艇、水上摩托艇、水上自行车、水上排筏船、水上飞机、沙地越野车、沙地八轮车、越野卡丁车、滑草、骑骆驼、骑马等水上、沙漠十几种娱乐项目。此外，晚间有“大漠之夜篝火晚会”，还有以本土之水炖大淖之鱼而闻名的“红碱淖水煮鱼”，以其鲜嫩、可口而驰名。       一、自然景观 1.湖泊：红碱淖是中国最大的沙漠淡水湖，拥有35平方公里的湖水，平均水深8.2米，最深水位12米，一眼望去烟波浩渺，没有任何瑕疵，就像是上天造物时的恩宠，赋予了它最佳的色彩和灵性，碧绿的湖水像一块无暇的翡翠，如镜的湖水，映照着天空，波光粼粼的湖面上，布满触不可及的细碎星芒，闪烁着水晶般的耀眼湖光。 2. 草原：在红碱淖南北两端有广袤无垠的大草原，每到春夏季节，青草漫野，鲜花盛开，牛羊成群，来到这里你能感受到大自然的和谐之美。 3.沙漠：红碱淖处于毛乌素沙漠边缘，连绵起伏的黄色沙丘，色彩变幻的深蓝湖面，湖泊与沙漠相伴，飞鸟伴驼玲起舞，沙漠的沙丘轮廓清晰、层次分明，丘脊线平滑流畅，迎风面沙坡似水，背风面流沙如泻。在大漠深处的沙山之巅，可静观大漠日出的绚丽，目睹夕阳染沙的景色，湖水、沙漠、夕阳共同交织出一幅迷人的画卷，呈现高原的雄阔、坦荡和壮丽。 4. 晚霞：红碱淖的晚霞也是一道靓丽的风景线，黄昏来临，金色的夕阳慵懒的洒在湖面上，整个湖面一片金黄，在水天一色间，“大漠孤烟直，长河落日圆”的壮美被演绎的淋漓尽致，远处草原上散落的牛羊，近处骑着马儿和在湖边悠闲游走的人们，组成日落黄昏一幅生动而祥和的画卷。 二、生物物种 1.遗鸥：随着红碱淖湿地系统的不断演进，加之其处在我国候鸟迁徙的主要线路上，每年春天，数以万计的鸟儿迁徙而至，红碱淖也逐渐成为全球最大的遗鸥繁殖与栖息地。遗鸥，顾名思义是被“遗忘或忽略的鸥”，每年4-8月，有占全球90%的遗鸥会在这里繁衍生息，活动于这片湿地的精灵，成为红碱淖最具有特色的重点保护物种。 2.白天鹅：红碱淖也是白天鹅从北到南迁徙过程中的重要补给站和停留地，每年10月，会有数千只白天鹅来到红碱淖，为红碱淖带来了生机与活力。 除了遗鸥与白天鹅，这里还有红脚隼、赤麻鸭、鸬鹚、白鹭、鸳鸯等50余种野生鸟类，每到夏季，我们将看到万鸟腾空、百鸟齐鸣、翩翩起舞的场景，简直堪称“鸟儿的天堂”。 三、特色文化 昭君文化：红碱淖景区有一座高18.5米的昭君雕像，说起昭君，她与红碱淖还有一段不为人知的动人故事，相传，在汉代时期，昭君出塞，远嫁匈奴，在即将踏入匈奴之地时，在此稍作停留，想到从此就要背井离乡，不禁潸然泪下，便形成了这美丽的红碱淖。因此，当地人们把红碱淖也称之为昭君出塞时回眸一顾的离别泪。 民族文化：红碱淖处于陕蒙交界地带，千百年来，蒙古族在蒙古地区生根繁衍，不断壮大。作为同样拥有悠久历史的汉族，其先进的文化不断辐射、影响着周边民族，在两民族不断接触、交流的过程当中，蒙汉文化互相交融、互相影响，形成了独具特色的文化景观。 四、娱乐项目 水上项目：在这片辽阔的水域上，您可以乘坐着快艇与鸟儿同行，悠闲的水上皮划艇、水上自行车、水上排筏船会给您带来水中的乐趣，水上飞机、水上拖拉伞会让您一览大漠风光，惊险刺激的水上漂移艇、摩托艇、水上飞人让你心跳加速。 沙地项目：连绵不断的沙漠也会给您带来不同的体验，八轮车上漂移，卡丁车、越野车上兜风，滑草道上尖叫，当然您也可以骑着骆驼在沙漠里徜徉，躺在沙滩上享受日光浴，也可以带着心爱的她去网红拍照点打卡收藏对未来美好的期待。 五、特色饮食 红碱淖炖鱼：红碱淖炖鱼是当地最具特色名菜之一，采用红碱淖野生鲤鱼或草鱼通过古法烹饪而成，其肉质细嫩，汤鲜味美，口味独特。“十里城外，五里飘香”用来形容红碱淖水煮鱼在合适不过了。古人云：“食面不如食肉，食肉不如食鱼。”经常吃鱼具有降血脂和提高免疫力的功效。 六、特色酒店 来客楼酒店：来客楼酒店是一座湖景酒店，距离湖畔仅500米，“来客”取自英文LAKE（湖）的谐音。酒店共有两层，设套房2间，标准间42间，可同时接待100余人进行住宿；设计装修时尚大气，采用简约的线条延伸空间，轻盈明快的色彩呈现浓厚的人文气息，同时配以游客休息、读书、品咖的场所，让游客充分享受休闲之乐。 七、品牌活动 红碱淖每年会根据季节特征举办各类大型活动，如：风筝文化节、沙滩寻宝、国际音乐节、全国环湖自行车赛、横渡红碱淖全国邀请赛等大型活动，吸引了全国各地的参赛者和游客慕名而至。 八、周边联动 以红碱淖为核心向周边辐射打造了一条休闲旅游带，不仅丰富了游客体验，更全方位的发掘了旅游资源、带动当地的经济发展。其中最具代表性的是： 尔林兔大草原：位于红碱淖西15公里处尔林兔大草原的千亩花海，每年6月以后，进入了黄金季节，这里便成为了花的世界，是游人休闲恬淡的绝美之地。 公格沟丹霞地貌：在景区东12公里，有一处丹霞地貌，地貌以红色为主色，层层叠叠、色彩缤纷。四面山脉绵延起伏，形态各异的丹霞地质有序排列，置身其中，犹如进入一个奇幻世界。  \n', '109.944599', '39.087183', '2', '2710022901201000012205', '神木市红碱淖旅游发展有限公司', '陕西神木农村商业银行股份有限公司尔林兔分理处', '0', '91610821552174447C', '3', '840965746@qq.com', '1', '', '', '', 'JQSMSH24A4ACC4', 'https://oss.wlxfq.dianfengcms.com/webupload/aa5e951916c795a3890eefc89ab221a0.png', 'https://oss.wlxfq.dianfengcms.com/webupload/04be43ef88f2bc0f43d0af6ce95a60e9.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1c013b3c58d797cd96a3016ac02149db.png\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/5022f6e8ff22637964f51510c291e9af.png\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/13589b84ba0c4d864f1bdc835186ef59.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('100', '1671699488', '1677652097', '1', 'bf123456789', '758f804bc10df0d60f8fbfb99a50900b', '1677655738', '218.200.40.140', '榆林野生动物园', 'https://oss.wlxfq.dianfengcms.com/webupload/0396d5ad09bc3920612c5254903922f6.jpg', '1677655738', '218.200.40.140', '5', '刘伟东', '15891027242', '上午9：30至下午4：30', '陕西省榆林市榆阳区古塔镇榆林野生动物园', '<p>榆林野生动物园位于榆阳区古塔镇四里沙风景区，距离榆林城区19公里，总规划面积2300余亩，一期开放面积1100余亩。是榆阳区转型升级高质量发展的重点示范项目和重要的民生工程。项目采取政府与社会资本合作承包的方式，由榆林市榆阳区博丰动物园有限公司负责投资承建及运营，区政府负责配套基础设施建设。项目主要依托卧云山植物园的生态资源禀赋优势、南部山区已形成的文化旅游业态优势、榆林建设陕甘宁蒙晋交界最具影响力城市区位优势，建设以大规模野生动物种群放养和自驾车观赏为特色，集动植物保护、研究、旅游观赏、科普教育为一体的具有陕北特色的野生动物园。</p>\r\n', '109.869689', '38.190286', '2', '806052601421003778', '榆林市榆阳区博丰动物园有限公司', '长安银行股份有限公司榆林明珠大道支行', '0', '916108003056878435', '1', '1148060015@qq.com', '1', '', '', '', 'JQYLYS2E328257', 'https://oss.wlxfq.dianfengcms.com/webupload/60606de451e90be755b775c88b8e5341.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/fa58c28ae895d01c6a90193a3dc02b8f.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8b6b3e617daf29e5dc931db4ad5a991d.jpeg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1351861edad4adb0124e03a8b7d7419d.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('101', '1671699778', '1677728214', '1', 'Zhong123456', '6335f4ff9a974aa3c4dc165a1a468126', '1677663624', '106.36.207.102', '郝家桥革命旧址', 'https://oss.wlxfq.dianfengcms.com/webupload/43b3281323238f79be19252fab7b67ce.png', '1677663624', '106.36.207.102', '3', '申浪浪', '13571240918', '早上8点30，下午5点30', '郝家桥', '榆林旅投·陕西中红未来运营管理有限公司成立于2022年3月25日，隶属榆林市旅游投资发展有限公司，是市国资委备案工商注册的国资企业。公司秉持以“产业引导、市场主体、铸魂育人、创新创业”为理念，以基地建设及运营为纽带，共建红色力量，共享红色动力，做活“红色”文章，践行文物活化利用政策，恢复革命旧址唤醒红色记忆。 2022年4月11日开始入驻张家砭镇郝家桥村，接手郝家桥景区的全面运营管理工作。榆林旅投中红未来运营管理有限公司依托郝家桥从革命战争年代的“农村楷模”到新时代的“全国脱贫攻坚楷模”的历史背景，聚焦乡村振兴培训领域，研发并建立序列化“课程式产品”体系，设计“一线，一轴，双核，多点”的产业布局，联动周边红色资源形成连片互动，集群聚合，以教育培训融合三产，联农带农，实现“乡村振兴楷模”宏伟目标。\n', '110.184454', '37.480175', '2', '2710112801201000026920', '陕西中红未来运营管理有限公司', '陕西榆林农村商业银行股份有限公司科创支行', '0', '91610802MA7MK3832A', '7', '1844034193@qq.com', '1', '', '', '', 'JQSXZH3BF570AE', 'https://oss.wlxfq.dianfengcms.com/webupload/dd6515e0cf33ee9d19ad238295de9331.png', 'https://oss.wlxfq.dianfengcms.com/webupload/4b3ca54341726353ee86b95227e082f5.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/925237abb3b3dd7c64f6c3b28c15bb39.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ba4aa9f14dde91dffe0958cfd52761a0.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/cde08e75c43ffeaa09fb0e37e70450ba.png\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('102', '1671705007', '1677728204', '1', 'Yang123456', '403cbf42b9d680f7f97efe0ed08453b9', '1677653066', '106.36.207.102', '杨家沟革命旧址', 'https://oss.wlxfq.dianfengcms.com/webupload/ed3a8482586d69a87c4b44f8cdcf6512.png', '1677653066', '106.36.207.102', '4', '申浪浪', '13571240918', '早上8点30，下午5点30', '杨家沟', '榆林旅投·陕西中红未来运营管理有限公司成立于2022年3月25日，隶属榆林市旅游投资发展有限公司，是市国资委备案工商注册的国资企业。公司秉持以“产业引导、市场主体、铸魂育人、创新创业”为理念，以基地建设及运营为纽带，共建红色力量，共享红色动力，做活“红色”文章，践行文物活化利用政策，恢复革命旧址唤醒红色记忆。 2022年4月11日开始入驻张家砭镇郝家桥村，接手郝家桥景区的全面运营管理工作。榆林旅投中红未来运营管理有限公司依托郝家桥从革命战争年代的“农村楷模”到新时代的“全国脱贫攻坚楷模”的历史背景，聚焦乡村振兴培训领域，研发并建立序列化“课程式产品”体系，设计“一线，一轴，双核，多点”的产业布局，联动周边红色资源形成连片互动，集群聚合，以教育培训融合三产，联农带农，实现“乡村振兴楷模”宏伟目标。\n', '110.333989', '37.758905', '2', '2710112801201000026920', '陕西中红未来运营管理有限公司', '陕西榆林农村商业银行股份有限公司科创支行', '0', '91610802MA7MK3832A', '8', '2603779171@qq.com', '1', '', '', '', 'JQSXZH7A45BFBC', 'https://oss.wlxfq.dianfengcms.com/webupload/498c91526693376d9f50efd0a91b4647.png', 'https://oss.wlxfq.dianfengcms.com/webupload/3b82cafe84345b13d0e2c3821b74c93e.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/b8a1cb4960a4dfecc79e77939d56cb4f.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/03ad6c14aead8336aec2f15930b42803.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/31d9938ee1441f96d6767023cf7688e9.png\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('104', '1671760382', '1677728681', '1', '尔林兔大草原', 'fadbe2339b74e55490bbc5200c3cfb14', '1677567922', '61.185.149.49', '尔林兔大草原', 'https://oss.wlxfq.dianfengcms.com/webupload/1d415210c540d595ca361ccbf85742cc.jpg', '1677567922', '61.185.149.49', '5', '李娅娜', '18691266800', '2022年03月10日', '陕西省榆林市神木市尔林兔镇尔林兔大草原2号停车场', '该公司是一家主营景区运营、活动策划等相关业务的文旅企业，目前主要运营景区为尔林兔大草原，尔林兔大草原是1978年陕西省林业厅林草项目，同期规划了尔林兔、大保当、瑶镇、中鸡四个公社共计三万五千亩草原。时至今日，尔林兔大草原是至今保存最为完整的一片原生态草原，总占地面积10373亩。根据神木市创建国家高A级旅游景区的梯队安排，2022年拟创建尔林兔大草原国家4A级旅游景区。 尔林兔大草原以万亩草原、千亩花海、百亩乐园等为载体，以城市亲子家庭、追求品质的高端消费人群、青少年研学群体、高端企业团建群体为主要目标客群，秉承分期投入、滚动发展的原则，融合三生“生产、生活、生态”、三业“农业、加工业、服务业”，打造集田园花海休闲观光、农业生产农事研学、定制高端企业团建、精品草原主题露营、民俗文化美食街区、特色乡村节庆活动等为一体的农旅田园综合体。2021年8月成功举办“相约草原·向阳而行”葵花文化旅游节暨尔林兔大草原欢乐嘉年华活动，活动期间榆林周边游抖音热度67万人次，游客量达10万余人次，辐射带动周边村集体收入达500余万元，其中村集体收入达90万元。 尔林兔大草原是1978年陕西省林业厅林草项目，同期规划了尔林兔、大保当、瑶镇、中鸡四个公社共计三万五千亩草原。时至今日，尔林兔大草原是至今保存最为完整的一片原生态草原，总占地面积10373亩。根据神木市创建国家高A级旅游景区的梯队安排，2022年拟创建尔林兔大草原国家4A级旅游景区。 尔林兔大草原以万亩草原、千亩花海、百亩乐园等为载体，以城市亲子家庭、追求品质的高端消费人群、青少年研学群体、高端企业团建群体为主要目标客群，秉承分期投入、滚动发展的原则，融合三生“生产、生活、生态”、三业“农业、加工业、服务业”，打造集田园花海休闲观光、农业生产农事研学、定制高端企业团建、精品草原主题露营、民俗文化美食街区、特色乡村节庆活动等为一体的农旅田园综合体。2021年8月成功举办“相约草原·向阳而行”葵花文化旅游节暨尔林兔大草原欢乐嘉年华活动，活动期间榆林周边游抖音热度67万人次，游客量达10万余人次，辐射带动周边村集体收入达500余万元，其中村集体收入达90万元。\n', '109.82077', '39.026787', '2', '612899991013000262110', '榆林牧歌田园旅游有限公司', '交通银行榆林分行', '0', '91610 802MA 7HTN7 W2K', '1', '791927696@qq.com', '1', '', '', '', 'JQYLMGB6E9E65A', 'https://oss.wlxfq.dianfengcms.com/webupload/80707d9068320dcdb58ba5cb0b46f338.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/b40381b8bd3e6309196da168cb625192.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/683dad2add074d12101bca26ebe92cbb.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/2f4c119739e95da529a370fe1dd4e775.jpg\"]', '0', '0000-00-00 00:00:00');
