INSERT INTO `tp_seller` VALUES ('107', '1671776992', '1677727903', '1', 'mhl503017', '72df22078ee6c0a3be7f3ce48d357f9f', '1677744574', '36.45.211.146', '麻黄梁景区', 'https://oss.wlxfq.dianfengcms.com/webupload/b2c21854f7967cf1e4d2a62fd2c96042.jpg', '1677744574', '36.45.211.146', '3', '刘雲森', '18291239616', '10:00-17:00', '麻黄梁黄土地质公园', '麻黄梁黄土地质公园位于榆林市城东约35公里，公园以佳芦河为中心，总面积17.87平方公里，核心保护区6.35平方公里，地质遗迹涉及5大类、50余处地质遗迹点，主要包括黄土峰林地貌景观、第四纪地层剖面、沙漠地貌景观、古生物化石等地质遗迹，对研究我国大陆乃至欧亚大陆第四纪地层剖面地质学具有重要意义。总体规划分为“一心、两环、三景区、四板块、多景观”五大体系，“一心”为场馆（游客）综合服务中心，“两环”为科考道路大环线和小环线，“三景区”为公园内划分为东流畔、胡麻梁、店坊3个景区，“四板块”为地质遗迹保护、科普旅游、生态环境保护、黄土艺术写生4个板块，“多景观”为黄土峰林地貌、沙漠地貌、水景、生物、长城文化等多项特色景观，是全国唯一的一个可以同时欣赏到黄土地质遗迹与沙漠地貌景观的地质公园。\n', '110.057281', '38.381574', '2', '2710014101201000078576', '榆林市榆阳区麻黄梁黄土地质公园开发建设中心', '陕西榆林榆阳农村商业银行开发区支行', '0', '12610802MB2986379H', '1', '1336725945@qq.com', '1', '', '', '', 'JQYLSY8944E3BA', 'https://oss.wlxfq.dianfengcms.com/webupload/18b0fccdeaaee585a858f48b0d0ed691.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/bdd307a7af9b9437717a20170d5e2502.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/2c6704d91aceb303bf200123b6cf3d28.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/09983b7211d0467fcd84e43d8eaeeaa4.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/fa9027d03f422f8301144e8925dba248.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('108', '1671780863', '1672734983', '1', '8306888', 'd44470acdb39d886f5aa9770879e8e2e', '0', '', '神木艺术中心影城', 'https://oss.wlxfq.dianfengcms.com/webupload/fa28f4abe373634a4c9c3339d3b22797.jpg', '1671780863', '106.36.9.244', '0', '18791919107', '0912-8306888', '12：00-24：00', '神木艺术中心影城', '神木新村艺术中心影城位于神木大剧院负一层，总投资800多万，影城规模达2000余平方米，按照全国一线影院标准建设，影城拥有5个专业电影厅，最小可以容纳70人，最大三号影厅容纳280个座位，是神木唯一一个IMAX厅，影城共计600个座位，5个影厅全部采用了3D高清放映设备，保证了每位观众绝佳的观影效果，艺术中心影城大厅内采用了先进的LED显示屏，每日拍片、票价有序排列，精准的电脑售票，观众可方便的选择自己想要的座位。大厅另侧设有卖品区，品类繁多的食品将满足顾客不同的需求。订票电话：0912-8306888\n', '110.4706', '38.900579', '5', '2710021801201000030268', '陕西神木星火传媒文化有限公司', '陕西神木农村商业银行股份有限公司麻家塔分理处', '0', '91610821338733201', '3', '1757629290@qq.com', '1', '', '', '', 'YYSMYS2500F2B9', 'https://oss.wlxfq.dianfengcms.com/webupload/3532835f786e06516e10e7a1818db19b.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/12afa2ee764b578f596adab5b3ee9f1a.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a99e89bb0eddc599aad95ac74f943990.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/b7ef7e5343220e229bfef30b1c1775dd.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/d7011cd3f3bf7a3b25b3684d7620ee69.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0c44e848236700093e4a87c64be9f58c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/5687b04d97f274be1b18904cdbbbad4f.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('109', '1671782008', '1671785720', '1', '榆林容大国际影城', 'bedde457aff78493575eff13fecc889a', '1677728451', '36.42.56.143', '榆林容大国际影城', 'https://oss.wlxfq.dianfengcms.com/webupload/a9f737dbc34f9b310dd416be47b652d7.jpg', '1677728451', '36.42.56.143', '6', '李军', '15009229555', '12：00-24：00', '容大国际酒店', '容大国际影城附近的公交站:\n人民路、苏州中学、治沙所、保宁中路、保宁路、好日子购物广场、榆林学院、常乐北路、烟草公司、青山路、保宁西路、建安路、榆林学院南门、常乐中路。\n\n容大国际影城附近的公交车:\n13路、2路、6路、10路等\n', '109.729422', '38.289449', '5', '2710012801201000011966', '榆林市榆阳区容大国际酒店有限公司', '陕西榆林农村商业银行股份有限公司西沙支行', '0', '916108025735480143', '1', '223559713@qq.com', '1', '', '', '', 'YYYLRDEA318494', 'https://oss.wlxfq.dianfengcms.com/webupload/3e6e12d9b684ddb68e161e5bf07b4017.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/665feac84bc2f994b3db5849022d1a6e.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/02965f767648ba1ccf62ec3aabfe446c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ae965e8e3a321bd20b8fb83722270b40.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1310f0bdaca5ec02467f9dcb03a4a30c.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7e7b722eca84a7be385e992fe5d6a329.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('110', '1671788121', '1677728442', '1', '靖边县文旅集团有限公司', '736f903ed0e7dc20110daf5d85eb02fd', '1677554515', '117.36.174.151', '清凉石窟景区', 'https://oss.wlxfq.dianfengcms.com/webupload/96fddaa7f0e2994a806ae35c27072d59.jpg', '1677554515', '117.36.174.151', '2', '齐安宇', '17795992529', '全天', '清凉石窟景区', '清凉石窟位于靖边县小河镇，因远望有九条山脉宛如九条巨龙盘附于此，故称九龙口。据清凉石窟遗存的碑文记载，该寺建于北魏孝文帝年间，距今约一千五百多年，是靖边最古老的文化圣地。清凉石窟初建于寺咀塔，经过一百多年的王朝更替，历经战火，唐朝贞观年间，由寺咀塔迁址至古寺圪堵。在明成化年间、万历年间两次进行扩建，但因古寺圪堵地形砭窄，道路难行，香火一直不旺。康熙二十三年，有白狐口衔如来佛祖牌位至龙眼泉边，当地人认为此乃神喻，遂将寺院移建至石壳上，历经3年，人工凿石窑13孔，开砭路1条，其时为清凉石窟历史上最为鼎盛的时期，曾有僧人百余，寺管土地数千亩。光绪年间再次扩建，人工凿窑，砭路改建，人工凿百十台阶而上。这时的清凉石窟塑像工艺超群、美观，壁画精细，栩栩如生，观赏价值极高，信徒众多，香火旺盛。\n', '110.505662', '38.814493', '2', '20361082400100000137301', '中国农业发展银行靖边县支行', '20361082400100000137301', '0', '91610824MA70339H02', '5', '119628490@qq.com', '1', '', '', '', 'JQJBXWBA669010', 'https://oss.wlxfq.dianfengcms.com/webupload/f88dff1ac1186fce6ccb78ed78d9e171.png', 'https://oss.wlxfq.dianfengcms.com/webupload/bb6340982e83babf457d726be9594709.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c78c3767e92faa0c325ed3ea45cf60b0.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/82fa181deeb9e7ba9fff789ebfcfa0d1.jpg\"]', '0', '0000-00-00 00:00:00');
