INSERT INTO `tp_seller` VALUES ('120', '1677116072', '1677729369', '1', '榆林市山丹丹旅行社有限公司府谷分社', 'b9bd167e9b1871793d06844d465ff4ec', '0', '', '山丹丹旅行社府谷分社', 'https://oss.wlxfq.dianfengcms.com/webupload/ed5245a93cc456104ab3b658c8802f6b.jpg', '1677116072', '113.135.193.120', '0', '王燕子', '18098019255', '上午8点至下午6点', '府谷县沙后河村羊道河', '      榆林市山丹丹旅行社有限公司府谷分社隶属于是榆林市恒泰汽车运输集团旗下的全资子公司，府谷山丹丹旅行社经榆林市工商局注册、榆林市旅游局批准成立，是一家主要经营入境旅游、国内旅游服务、票务代理业务的旅游企业。随着山丹丹总社的不断发展壮大，现拥有十二个旅游分社、两个服务网点，拥有多名实践经验丰富的管理人员和优秀计调、导游的旅游业务专业人才。曾多次组织接待国内大型的旅游团队享有良好的信誉和口碑。 山丹丹旅游依托于恒泰汽车运输集团的企业规模和历史优势，发挥运游结合的运营特点，以“品牌化、规模化、优质化”为目标，为客户提供全方位的旅游出行和延伸服务。     山丹丹旅游一直秉承“倾心的服务、愉快的旅游”的经营理念，为客户提供性价比高的旅游、休闲、会展服务和舒适的商旅体验，以专业的能力帮助客户达成美好的出行愿望。 山丹丹旅游用精心设计的行程，让游客尽享世界风光；以专业完善的服务，助客户实现旅行梦想。\n', '111.034274', '39.078681', '3', '2710120901201000009229', '榆林市恒泰汽车运输集团有限公司府谷汽车站', '府谷农村商业银行海则庙分理处', '0', '91610822MA703Q5D5H', '4', '243729289@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/6259c6da3f7ed8ca1413efd06efefa39.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/0af80941896526da109ffeb569358a0d.jpg', 'LXSYLSS855370DD', 'https://oss.wlxfq.dianfengcms.com/webupload/4f2085da020fff9e9dff9e42901f7f4b.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/92de59ce551ed32076b63733baab88e1.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/80e7cbc38ca1db9950bba46dab5270a4.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/f1cbe5fbc4828195e418930a6c9615f8.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('121', '1677119129', '1677729352', '1', '18292275252', 'da6c44d93cf4736fc4d6d822d7574ec6', '1677575943', '1.84.216.89', '榆林市德行旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/afa21d6aee66d6e9dacc13dd4a44b180.jpg', '1677575943', '1.84.216.89', '3', '刘苗青', '15596536966', '8：00—17：30', '陕西省榆林市榆阳区长城路街道榆林市铁路建设办公室翰庭大厦', '榆林德行是一家专业从事青少年研学旅行、夏冬令营等校外教育活动的服务机构，以\"立德树人，行天下”为公司宗旨，“为7-18岁青少年提供社会能力教育整体解决方案”为使命，以“让每一个孩子至少有一次游学经历”为愿景，拥有包括市内短期营、国内营、亲子营、主题营、海外游学、留学等在内的多种社会实践及素质教育产品体系。\n', '109.755564', '38.275069', '3', '61050169361100000235', '榆林市德行旅行社有限公司', '中国建设银行榆林上郡路支行', '0', '91610802MA704XXF4M', '1', '1907525330@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/777107f79b364d06b9b2278c15e81323.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/ec2f67ac550047f733aa131cd17bf6e9.jpg', 'LXSYLSDE3847A8C', 'https://oss.wlxfq.dianfengcms.com/webupload/e9cb6ada022f109cfae8ab7cb53847c2.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/4fc6fddabd5a0a70c9cf0d847b415aa4.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/ce2e6787682b53c782b2ce8d252d02aa.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('122', '1677225550', '1677226991', '1', '榆林市大美乡村旅游有限公司', 'ea39692d11f96098d9bdf4a926d10325', '1677726242', '61.185.149.13', '赤牛坬民俗博物馆', 'https://oss.wlxfq.dianfengcms.com/webupload/35875e5d8acf66647fab00ce1e777750.png', '1677726242', '61.185.149.13', '5', '高艳阳', '15909121536', '8:00-20:00', '佳县坑镇赤牛坬民俗旅游文化村', '赤牛坬村位于佳县城南30公里的黄河近岸，四面龟山怀抱，枣林层叠，气韵生动；明清老村，错落有致，辗转腾挪，古朴厚重；新村逶迤延展，绿树掩映，步步入景。全村282户，1008人，枣林面积2100亩，是全市第一批社会主义新农村示范村、市级文明村、市级十大乡村旅游示范村、市级新型农村社区建设示范村、省级文明村、省级生态村、全省最具影响力区域、中国“美丽乡村”创建示范村、中国美丽宜居村、中国乡村旅游模范村、中国美丽休闲乡村、全国文明村、中国乡村旅游重点村、全国乡村治理示范村、国家AAA旅游景区。\n\n赤牛坬村始于至元，绵延八百年，民俗文化底蕴深厚。赤牛坬博物馆囊括了陕北物质民俗、精神民俗、社会民俗的诸多方面，共有展厅展室168个，展区面积30000余平方米，展品10万余件。仓储式的博物形制和独具特色的布展手法让人目不暇接，印象深刻。灯博馆、鞋博馆、酒瓶馆、三十六行馆以及出自农民之手拙朴而精巧的泥雕、草雕，洋洋大观，令人惊叹。\n\n陕北窑洞群落，高岵庄园、民俗文化大院、碾磨园、凤凰台、姐妹三亭、裕民戏楼、月桥、西村牌楼、百花园、小西湖、老柳新枝、杏花三月、山路十八弯、十里红枣大观园、佳南第一壑、仙人嘴、双头山、榆湾梯田、古墕峡谷、夜晚天际大弧线。这些大自然的造化和劳动人民的杰作，大美无言，让人神情安顿、怡然自得，一步三回头。\n\n一年一度的赤牛坬“过大年”从腊月二十三开始到次年正月二十三结束。年味十足的传统民俗活动唤起了人们对过去生活的美好追忆。每年的春节文化活动有四邻八乡上万人参与，更有文化界、艺术界及社会各界人士观看并指导活动。村民自编自演的抬花轿、搬水船、掐草帽、货郎等传统秧歌剧及跌坛、祈雨、打夯、打梿枷、拉碾盘等几近失传的原生态节目，深受游客喜爱。\n\n枣糕是陕北传统食品中辈分最高、情份最重、最有尊荣、最显高贵吉祥的美食。赤牛坬“千人枣糕宴”是每年春节活动必吃的一道民俗大餐，让游客大快朵颐，回味悠长。成为陕北传统饮食文化的一大亮点、一大品牌。\n\n赤牛坬五谷画以陕北民俗风情为题材，构思独特、制作精美，古朴凝练、大俗大雅，色彩自然华美，形象栩栩如生，渗透着浓郁的乡村民俗文化气息。“溜席巴”、“拉碾盘”、“拦羊汉”、“寻虱子”等代表作具有很高的艺术价值，是馈赠亲友、装点居室、收藏养心的佳品。\n\n赤牛坬村是一个集休闲度假、游览观光、体验互动、娱乐购物、教育子女、开会培训为一体的民俗文化村；是传统文化教育基地，艰苦奋斗教育基地和爱国主义教育基地；是黄土文化、农耕文化、黄河文化的宣教中心；是黄土高原丘陵沟壑区摄影写生采风基地；是服务榆林，辐射周边城市居民的后花园、后粮园、后游园；是中国最美的乡村旅游胜地。真诚希望四方客人走进赤牛坬，收获投资兴业的成果，体验如诗如画的美妙。\n\n美丽赤牛坬欢迎您！\n', '110.577832', '37.843371', '2', '26006601040004755', '榆林市大美乡村旅游有限公司', '中国农业银行股份有限公司榆林镇北支行', '0', '91610828352252148H', '9', '582259533@qq.com', '1', '', '', '', 'JQCNGMEE578BF3', 'https://oss.wlxfq.dianfengcms.com/webupload/f4f5904994486360575bd0afd059bf61.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/181baf52f346b6e664ced23e3b921933.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/4085ca7fc2034869d6877890477b2511.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/67f715de1057e7871964523a91b11ab7.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('123', '1677316073', '1677728704', '1', '榆林圣嘟文化科技有限公司', 'b8f05a4866b026c97308a88f4f43a4a5', '1677737501', '117.35.29.141', '圣都乐园', 'https://oss.wlxfq.dianfengcms.com/webupload/2236d30bca076d5fb8c0960925d24adc.png', '1677737501', '117.35.29.141', '9', '游客服务中心', '0912-3839380', '12：00-20：00', '圣都乐园', '运营时间：周一至周五：12:00-20:00\n                 周末、节假日：10:00-20:00（具体可咨询0912-3839380）\n\n榆林圣都乐园是一座集室内娱乐、室外游乐、文化娱乐、文体休闲、园林景观、综合服务为一体，融日、夜双重娱乐为一身的现代主题娱乐休闲乐园，是人们度假、休闲、娱乐的最佳场所。 乐园涉及室外大型游乐设施20余项，其中最具亮点的由：目前西北第一高摩天轮、全国首例6环冲锋过山车、西北最大规模的水上游乐设施飞舟冲浪、全国最长轨道高架车太空漫步、西北最高的高空飞翔，同时还有首次登陆榆林的大摆锤、双层豪华转马、神舟飞碟等。考虑到榆林冬季漫长，为满足游客冬季游玩需要，共设置了多项室内游乐：有3D狩猎、恶魔城堡、儿童耍戏、风怒的小鸟等。 在游乐设施的选择上注意老、中、青少年游玩爱好，满足不同年龄段游客的需求。 游乐园以一流的理念，一流的设施，一流的服务，一流的环境，为人们带来一种全新的时尚娱乐体验！游乐园以时尚的现代气息、动感的韵律，给这座城市带来缤纷的活力，以崭新的姿态向人们展示了人民对美好生活的向往和追求，他是最具城市风格的所在，他必将成为榆林城市生活的重要标志。\n', '109.747314', '38.275295', '2', '806051701421002816', '榆林圣嘟文化科技有限公司', '长安银行股份有限公司榆林上郡路支行', '0', '91610800MA70AXHK6D', '1', '313104287@qq.com', '1', '', '', '', 'JQYLSD22FBE628', 'https://oss.wlxfq.dianfengcms.com/webupload/2a33a6963dc199bb9fd2af8961f5a4e0.png', 'https://oss.wlxfq.dianfengcms.com/webupload/dde8f5a40841c98f49f9e096f1dbd6f4.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0d68170dac233f4337d9dcf384dc6a54.jpg\"]', '0', '0000-00-00 00:00:00');
