INSERT INTO `tp_seller` VALUES ('127', '1677487902', '1677728951', '1', 'jinlin123456', 'b5f84c79db0562d4fe5454f834e658ac', '1677580977', '124.115.247.211', '未来金麟影院', 'https://oss.wlxfq.dianfengcms.com/webupload/14c8769604a070b5b9f97fd303afe8e1.jpg', '1677580977', '124.115.247.211', '3', '刘玉珍', '13109686955', '2022年1月1日', '陕西省榆林市神木市滨河新区街道成业广场4017号', '影城建筑面积3750平方米，拥有6个多功能3D标准数字激光放映厅，可同时共可容纳920人观影。影城共有六个影厅，其中最有特色的是二号。二号影厅是将4K放映机、杜比全景声系统、最大厅集一体的黑马影厅，也是神木拥有这先进的放映机和音响系统的影院。画面感更加逼真，清晰度更强，声音更加立体。激光高品质画面，给您带来视觉新震撼；杜比全景声为您提供强大而生动的全新影院聆听体验;声音可以在影院中自由移动，以营造动态效果;再现自然而真实的音频体验，与故事情节高度契合;增设顶部扬声器，实现有史以来最逼真的声音效果。 影城拥有6个周边商铺，大厅还设置各类电玩。\n', '110.47399', '38.89327', '5', '912900697610701', '神木市未来金麟影视文化有限责任公司', '招商银行股份有限公司榆林神木支行', '0', '91610821MA70E9LW6K', '3', '3567511926@qq.com', '1', '', '', '', 'YYSMSW8CD03178', 'https://oss.wlxfq.dianfengcms.com/webupload/6c232f38adf985253018875d4b7bdf5b.jpg', 'https://oss.wlxfq.dianfengcms.com/admins/0a951731a866de11009a178e130ddb16.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/e78e5223bca9bb49c456d9101c295ad7.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/admins\\/8891407c9e1e88a21268b227366681fa.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/4f3bfa27ffba399ecfcc18ea526cf884.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c4afd5a05d32cb7cf76232ead3c705f3.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/c33c68ed0d8bdc1f873c726314c339c6.jpg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/1eacf514dc30ebfc34bbe9b040b12ad3.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('128', '1677487962', '1677671345', '1', '91610802MA70571K6R', '3d558122fcac9ea5fdc9ee8eccf8f433', '1677720249', '113.200.6.109', '补浪河女子民兵治沙连景区', 'https://oss.wlxfq.dianfengcms.com/webupload/7ed9ee8da269fa13824ad5223accb4a7.png', '1677720249', '113.200.6.109', '4', '滕生芳', '0912—7995157  ', '早上9:00-下午17:00', '榆林市榆阳区补浪河镇治沙连', '<p>补浪河女子治沙连景区隶属榆阳区大水湾村，位于榆林市西部，中心城区近郊；东侧毗邻G242榆补路，距榆阳机场约70公里，总面积4400亩，在榆林市1小时交通圈的边缘。治沙连扎根大漠，自1974年建立以来，治理荒漠14400亩，在荒滩大漠上建起一片沙海绿洲。景区内建有女子民兵治沙连史展览馆、实弹射击馆、军旅体验营、户外拓展区、双多向飞碟靶场、大型训练营房等项目，是集红色旅游、培训教育、军体赛事为一体的大型综合旅游目的地。 随着陕西省全域旅游的进一步发展，《榆林市国民经济和社会 发展第十四个五年规划》文件明确榆阳女子民兵治沙连是旅游景区，提出弘扬&ldquo;治沙精神&rdquo;，从本土特色文化中挖掘生态文明资源，大力弘扬补浪河女子民兵治沙连治沙精神的时代内涵，建设榆阳区补浪河女子民兵治沙连等生态文明教育基地。 &nbsp; 2022年作为陕西省十七运射击项目场地，是陕北唯一具备营业性资质的实弹射击体验基地。射击馆现拥有5个射击功能区，总占地面积130亩。室内射击场馆分别是25米手枪射击馆、50米步枪射击馆和10米气枪射击馆，室外拥有双多向飞碟靶场和4块实用射击场。3大场馆内共有射击靶位135个。场馆采用最先进的彩显电子报靶系统、抛靶设备和电子计时计分设备，具备一流的比赛条件。8月初陕西省十七运榆阳赛区射击项目在这里拉开帷幕。 帐篷营地占地面积89880m&sup2;，绿草茵茵，环境优美。滨水区共100间房一次可容纳200人同时住宿。其中六角玻璃帐篷共30间房可容纳60人同时住宿，人字形帐篷共70间房一次性可容纳140人同时住宿。建成后林下区魔方占地面积16300m&sup2;，杨柳青青，凉风习习，建成后共30间房可容纳60人同时住宿；花海区帐篷营地占地面积49560m&sup2;，建成后共30间房可容纳60人同时住宿。生态停车场占地面积71207.10㎡，建成后可停车辆约1200辆。</p>\r\n\r\n<p>业务联系电话:13891209884&nbsp; &nbsp; 15029426039</p>\r\n\r\n<p>&nbsp;</p>\r\n', '109.07881', '38.375373', '2', '806050401421004696', '榆林市榆阳区大漠军旅文化园管理有限责任公司', '长安银行股份有限公司榆林保宁路支行', '0', '91610802MA70571K6R', '1', '1093581948@qq.com', '1', '', '', '', 'JQBLHN39F21672', 'https://oss.wlxfq.dianfengcms.com/webupload/db9870c811ccd181d2390b53f946f93b.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/0518c82afebca59c0a7090a8ee56cc6d.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/8f5d57e97639a2052e14bbf667050281.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('129', '1677549875', '1677729341', '1', 'Xty123456', '95b0b079eab5886587b499b53f42c8e4', '1677572119', '219.144.18.234', '府谷信天游国际旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/d16fe10b226dbc867d871d2627c822e0.jpg', '1677572119', '219.144.18.234', '5', '郝彦林', '13609229019', '8:00-12:00  14:00-18:00', '府谷县新区颐佳华府北门商铺1-11', '陕西信天游国际旅行社有限责任公司，是经陕西省旅游局批准及工商注册的，具有独立法人资格，注册资金为200万元。并颁发旅游许可证的旅游企业。 自成立以来在社会各界和旅游同人的大力支持下，企业取得长足的发展，坚持走品牌创新旅游的思想、本着以质量铸造品牌、信誉开创未来的宗旨、服务与大众。旅行社累计接待国内外游客26万人余次，均无一起投诉！受到了游客、旅游业商会联合体、旅游主管部门等的一致好评！公司下设：营销、售后、财务、计调、导游等5个服务部门。\n', '111.045863', '39.028069', '3', '806050701421000668', '陕西信天游国际旅行社有限责任公司', '长安银行股份有限公司府谷县支行', '0', '91610822797926002T', '4', '1224703521@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/5c86c3d21902a3fea50a738d95faab39.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/31341c0c4656b51687b4a1597bdb4593.png', 'LXSSXXT6B5A7AC8', 'https://oss.wlxfq.dianfengcms.com/webupload/fac13a19d7fc1c38410ef7d81a404619.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/786d3c278aac9ec0c38088f1a8755884.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a1798f2724d6ff40b3a056017801000f.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_seller` VALUES ('131', '1677556045', '1677728275', '1', '靖边县镇靖古堡文化旅游区', 'da637a7e0556d18b17bdb8f95ead262d', '1677721023', '117.36.172.43', '镇靖古堡文化旅游区', 'https://oss.wlxfq.dianfengcms.com/webupload/78c5d86893e9beee93d1c596aaa480b7.jpg', '1677721023', '117.36.172.43', '1', '齐安宇', '17795992529', '全天', '镇靖古堡文化旅游区', '镇靖古堡文化旅游区有近20孔陕北传统窑洞、7处院落以及千余件农耕民俗物件，有城门洞、草垛、走廊、马厩、群雕等民俗建筑。文化园分南北两个区域。南区以博览为主、兼体验功能，有农耕发展史馆、农耕文化馆、二十四节气馆、时代烙印馆、账房窑、非物质民俗文化馆等16个展馆。北区以体验为主，有酒坊、油坊等5个展馆。最具特色之处在于有一条168米长的人工窑洞隧道，农耕文化展览馆将沿着这条隧道进行布展，鉴证三边的风情和发展。\n', '108.800183', '37.521417', '2', '961003010003598888', '靖边县龙洲旅游开发有限公司', '中国邮政储蓄银行陕西省榆林市靖边县西街支行', '0', '91610824MA7035Y81H', '5', '767757448@qq.com', '1', '', '', '', 'JQJBXL21422EE0', 'https://oss.wlxfq.dianfengcms.com/webupload/faee06c0f4c216f6715f36f89b251d26.png', 'https://oss.wlxfq.dianfengcms.com/webupload/6b6ce709eb0bb0b2e5535f13b6aa2a45.png', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/9f3eafed4b4c8f212f7bce3f44faa8f2.jpg\"]', '0', '0000-00-00 00:00:00');
