INSERT INTO `tp_seller` VALUES ('133', '1677558300', '1677728178', '1', '神木市陕北民俗文化大观园有限公司', '353f25a7aa0c7cfa0acfae42dd78a487', '1677667701', '113.143.250.80', '陕北民俗文化大观园', 'https://oss.wlxfq.dianfengcms.com/webupload/66ed42edc215c78e188a16ca44d72dfd.png', '1677667701', '113.143.250.80', '5', '屈云波', '15891158958', '8:30—18:00', '陕西省榆林市神木市解家堡乡木瓜梁村', '大观园于2008年初开始筹建，占地面积2000亩，累计投资2.3亿元。2010年5月1日开园运营，至今已累计接待游客达300万人次，实现旅游综合效益过亿元。现为“国家3A级旅游景区”、“全国休闲农业与乡村旅游五星级园区”、“省级平安景区”。\n主要功能区有：民俗特色餐厅、美食街、窑洞宾馆、农家小院、地坑式四合院、文化艺术中心、民俗博物馆、摄影基地、水土保持科技展馆、动物园、游泳馆、游乐园、蔬菜大棚、手工作坊展示区、林间休闲区。\n', '110.50142', '38.73879', '2', '2710020301201000033379', '神木市陕北民俗文化大观园有限公司', '陕西神木农村商业银行股份有限公司兴城支行', '0', '91610821681569381A', '3', '525980876@qq.com', '1', '', '', '', 'JQSMSS8B36D84E', 'https://oss.wlxfq.dianfengcms.com/webupload/52247120fc417d62c8212c67ba7bb29e.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/cb8aec359a235003a1a56f6c7e291569.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/a2c78ccaaee81a3722fe728b8c478e85.jpeg\",\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7570d82b351ba351076eb2b6be52de8e.jpeg\"]', '0', '0000-00-00 00:00:00');
