INSERT INTO `tp_seller` VALUES ('136', '1677582062', '1677588729', '1', '15691238787', '8a93ceae621db814fe586727307bd8fc', '1677589239', '117.37.116.213', '海华旅行社', 'https://oss.wlxfq.dianfengcms.com/webupload/a21adb559c52960a8ae9fbb8db953ed4.jpg', '1677589239', '117.37.116.213', '1', '张艳', '15691238787', '08:00---18:00', '横山区南大街石油小区楼底', '<p>海华旅行社有限责任公司成立于<br />\r\n2005年，是由省市旅游局批准，经省工商局登记注册，并足额缴纳质量保证金的一家旅游企业。<br />\r\n公司坐落于横山区南大街鸿泰酒店斜对面石油小区楼下，经营范围包括会务服务、入境旅游、国内旅游及机票、酒店预订等全方位的旅游服务。自公司成立之日起，公司不断探索和发展一条品质与享受相结合的专业旅游服务道路。公司以&quot;品质化&quot;、&quot;规范化&quot;、&quot;人性化&quot;为发展目标，以全新服务、悉心策划、注重特色为经营理念，立志在满足顾客需求的基础上追求卓越、精益求精，并且不断加大人力及技术等方面的持续投入，与全国各地的旅行社、酒店、车队建立了良好的合作关系与业务往来，力争为游客提供可靠周到、品质优良的全方位旅游服务。</p>\r\n', '109.289953', '37.948771', '3', '806050801421000933', '榆林市海华旅行社有限责任公司', '长安银行股份有限公司横山县支行', '0', '91610823552157081A', '2', '185567697@qq.com', '1', '', 'https://oss.wlxfq.dianfengcms.com/webupload/256429076e00b7d8f8f7a5a356544b86.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/463a3f0b9d986ba5a771a4bc2411e1c6.jpg', 'LXSHHLXB8B30E4D', 'https://oss.wlxfq.dianfengcms.com/webupload/ad981df5fd46d4d95606a5ff406d4306.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/84c769c250d697f9d57ab45731bc2db2.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/0f8b9bf1ae491a1a9a3a189547924c72.jpg\"]', '0', '0000-00-00 00:00:00');
