INSERT INTO `tp_seller` VALUES ('140', '1677638194', '1677672725', '1', '佳县大美石窑农牧文化发展有限责任公司', 'f2269aadef1a301c6fc0cc7681a206c1', '1677756903', '111.19.113.238', '佳县大美石窑旅游度假区', 'https://oss.wlxfq.dianfengcms.com/webupload/0aa81e0d9868eeb8a94d07d8c03cff3f.jpg', '1677756903', '111.19.113.238', '7', '杜军利', '13891265557', '00：00--23：59', '佳县大美石窑农牧文化发展有限责任公司', '  大美石窑旅游度假区简介大美石窑旅游度假区位于陕西省榆林市佳县上高家寨乡王家山村秃尾河畔，东接沿黄河旅游观光线，北靠神佳高速，西临榆佳高速，地理位置独特，交通便利。大美石窑是一个集聚游、玩、吃、住、购、研学、会议、培训、团建、休闲、农牧、田园观光一体的旅游度假区。大美石窑于2017年县政府授牌东方红干部学院教学基地，2018年12月17日评为陕西旅游民宿标杆示范单位，2018年12月18日评为国家3A级景区，2018年12月26日授予榆林市中小学生研学旅行基地。2020年8月9日市教育局授牌榆林市中小学教师教育培训基地。2022年2月17日被评为省级旅游度假区(4A)。大美石窑热忱欢迎全国各届人士来此饱览陕北固有的丘陵沟壑以及厚重广袤的黄土高原，感受乡村魅力，体验窑洞风情，领略田园风光，回味传统文化，汲取红色基因，尽享陕北美食。\n', '110.42978', '38.335243', '2', '26091501040030634', '佳县大美石窑农牧文化发展有限责任公司', '中国农业银行股份有限公司榆林高新区支行', '0', '91610828MA7035J19Q', '9', '2608014513@qq.com', '1', '', '', '', 'JQJXDMA5EE3E6B', 'https://oss.wlxfq.dianfengcms.com/webupload/6ff788f12a1ac5dc37338cd5b8e21e79.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/d51df2ceeaa0c8b797472b6f852a0156.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/bbdca64769143b1bbdb51e36a6de4979.jpg\"]', '0', '0000-00-00 00:00:00');
