INSERT INTO `tp_seller` VALUES ('142', '1677673428', '1677727421', '1', '榆林市榆阳区赵家峁村股份经济合作社', 'ae4d5c6060388520f5a74024a5456378', '1677720306', '106.36.207.102', '赵家峁景区', 'https://oss.wlxfq.dianfengcms.com/webupload/03a18b9510665c905aa87e946c916cb8.jpg', '1677720306', '106.36.207.102', '2', '林灵', '13324615181', '早8时至晚8时', '陕西省榆林市榆阳区古塔镇赵家峁景区', '旅游与休闲娱乐、餐饮、会议会展、拓展一体的景区\n', '109.942329', '38.167726', '2', '2710011801201000009506', '榆林市榆阳区赵家峁村股份经济合作社', '陕西榆林榆阳农村商业银行古塔支行', '0', '93610802MA703FR92F', '1', '543473015@qq.com', '1', '', '', '', 'JQYLSYA5147A05', 'https://oss.wlxfq.dianfengcms.com/webupload/6ea0e353f0dd6e7a49c69a3d0cfd33cc.jpg', 'https://oss.wlxfq.dianfengcms.com/webupload/21ed53e9334fb016448b997b228dd364.jpg', '[\"https:\\/\\/oss.wlxfq.dianfengcms.com\\/webupload\\/7ba71157678da9ef44e6d1094c927fec.jpg\"]', '0', '0000-00-00 00:00:00');
INSERT INTO `tp_notice` VALUES ('3', '1664164476', '1677756800', '50', '1', '212', '0', '', '', '无', '', '关于消费券发行公告（试行）', '<p>&nbsp;根据国务院印发的《扎实稳住经济的一揽子政策措施》、《陕西省财政厅关于落实稳住经济一揽子政策财政措施的通知》和《榆林市人民政府关于印发扎实稳住市场经济若干政策措施的通知》，为了进一步贯彻落实中省市关于经济社会有序恢复和发展的决策部署，助力榆林文旅产业提振复苏，提升文旅产业对榆林全年经济社会发展的综合贡献，提升旅游服务品质，激发文旅消费动能。榆林市政府面向全市居民和来榆游客，决定于2023年3月3日起发放&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券。现将有关事宜公告如下：</p>\n\n<p>一、活动名称</p>\n\n<p>&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券</p>\n\n<p>二、发行时间</p>\n\n<p>2023年3月3日-5月15日（每周五上午9：00&mdash;12：00）</p>\n\n<p>三、发放量及券种类别</p>\n\n<p>&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券计划发行总量为17.2万张，共四种消费券类型，具体如下：</p>\n\n<p>1、畅游消费券</p>\n\n<p>发行量为3.6万张（其中1.5万张定向发放旅行社，作为引客入榆的外来游客使用）。游客通过&ldquo;畅游榆林&rdquo;微信小程序领取相应的景区消费券，凭二维码核销入园（22家景区，详见景区名录）。</p>\n\n<p>2、剧院消费券</p>\n\n<p>发行量4.3万张（其中1.5万张定向发放旅行社，作为引客入榆的外来游客使用）。</p>\n\n<p>（1）榆林大剧院和神木大剧院，分别推出200元面值卡可通用于所有剧目。政府补贴60元，剧院匹配40元，客户自付100元，该观演卡适用于剧院在线的自营剧目不限场次、不限座位，节假日通用，用完即止（办理时间周一至周五）。</p>\n\n<p>（2）榆林剧院《米脂婆姨绥德汉》剧目，通过&ldquo;畅游榆林&rdquo;微信小程序领取，该券政府补贴60元，游客可以领取价值158元的C区观演票，游客凭二维码核销观演（周二休演）。如需升级其他区域观演票，需自行与商家沟通，补齐相应差价，预约电话：0912-3448884。</p>\n\n<p>3、旅行消费券</p>\n\n<p>发行量5.3万张，2日游补贴150（元/人）、3日游补贴300（元/人）。此券适用于外地来榆团队游客，消费总金额不得低于补贴金额，由榆林34家旅行社从专用通道领取（详见旅行社名录）</p>\n\n<p>4、观影消费券</p>\n\n<p>发行量4万张（适用于榆林各县市区25家电影院，详见名录）。</p>\n\n<p>该券政府补贴50元，影院匹配30元，客户自付120元，享受面值200元的观影卡，可观影7次，适用该影院所有影片。消费者可在目录内选择任意一家电影院办理，该卡/券不记名、不限观影厅、节假日通用，用完即止。</p>\n\n<p>四、领取办法</p>\n\n<p>1、市民及散客，领取畅游、剧院和观影消费券这3种券，消费者通过微信小程序搜索&ldquo;畅游榆林&rdquo;关键字，注册、登录进入本次消费券发行专用平台领取对应的产品消费券。（&ldquo;畅游榆林&rdquo;小程序需实名认证，注册手机号、身份证号码等任一条件相同视为同一用户）</p>\n\n<p>领取成功后，可以在右下角&ldquo;我的&rdquo;，点击&ldquo;未使用订单&rdquo;图标找到已领取的消费券，点开即可获得核销二维码，在消费券所对应的场所进行核销。</p>\n\n<p>五、使用及核销规则</p>\n\n<p>1.所有消费券名额有限，先领先得。畅游、剧院和观影费券散客每期每券每人限领1张。领券后，需按照消费券载明方式和核销范围在有效期内核销使用，逾期作废。如领取的消费券未在有效期内核销，则该消费券将实时自动回滚至总券池，再次释放给消费者公平领用。</p>\n\n<p>2.旅行消费券。旅行社需实团上报计划，每团最高限领50张，本券仅限在榆旅行的外地游客和来榆境外游客，2日游游客，必须在榆住宿1晚，2天消费总额不得低于150元/人（不包含游客自费部分）；3日游游客必须在榆住宿2晚，3天消费总额不得低于300元/人（不包含游客自费部分）。游客报团后，由参与消费券发放的旅行社或分社，从团队通道申请领用该消费券。旅行社实团上报计划，按照系统要求填写团队信息，申请领取对应的消费券和景区门票，审批成功后系统自动匹配，团队参观时，带团导游凭团队二维码到景区扫码核销入园。</p>\n\n<p>六、兑付要求</p>\n\n<p>1、畅游消费券、剧院消费券和影院消费券发行结束后，在其消费券管理后台下载已核销数据报表，核对确认，加盖公章后在系统上传提交，并同步提交原始凭证。</p>\n\n<p>2、旅行消费券发行结束后，在管理平台上传旅行团确认单、旅游意外险保险单、景区合影照片、餐宿车发票以及消费券结算账单等相关凭证，加盖公章上传系统，并同步提交原始凭证。</p>\n\n<p>3、线上线下资料审核无误，向各商户兑付对应款项。</p>\n\n<p>七、入驻商户名录（排名不分先后）</p>\n\n<p>（1）景区（22家）</p>\n\n<p>门票类：13家</p>\n\n<p style=\"text-align: center;\">镇北台 &nbsp;红石峡 &nbsp;动物园 &nbsp;&nbsp;陕北古风园 &nbsp;&nbsp;军旅园</p>\n\n<p style=\"text-align: center;\">白云山 &nbsp;赤牛坬 &nbsp;大美石窑 &nbsp;&nbsp;&nbsp;红碱淖 &nbsp;&nbsp;&nbsp;二郎山</p>\n\n<p style=\"text-align: center;\">陕北民俗大观园 &nbsp;清凉石窟 &nbsp;镇靖古堡</p>\n\n<p>交通及观光设备类：4家</p>\n\n<p style=\"text-align: center;\">郝家桥 &nbsp;&nbsp;杨家沟 &nbsp;&nbsp;麻黄梁 &nbsp;&nbsp;尔林兔</p>\n\n<p>游乐体验类：5家</p>\n\n<p style=\"text-align: center;\">碧麟湾 &nbsp;&nbsp;&nbsp;&nbsp;圣都乐园 &nbsp;&nbsp;&nbsp;&nbsp;赵家峁</p>\n\n<p style=\"text-align: center;\">女子民兵治沙连 &nbsp;&nbsp;大漠漂流</p>\n\n<p>（2）剧院（3家）</p>\n\n<p style=\"text-align: center;\">榆林大剧院、榆林剧院、神木大剧院</p>\n\n<p>（3）旅行社（34家）</p>\n\n<p style=\"text-align: center;\">陕西舒翔国际旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林市康乐旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林市长泰国际旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林旅游百事通国际旅行社有限公司</p>\n\n<p style=\"text-align: center;\">陕西羊老大国际旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林驼之旅有限责任公司</p>\n\n<p style=\"text-align: center;\">西安海外旅游有限责任公司榆林分公司</p>\n\n<p style=\"text-align: center;\">盈科美辰国际旅行社榆林分公司</p>\n\n<p style=\"text-align: center;\">榆林市中辉假日旅行社股份有限公司</p>\n\n<p style=\"text-align: center;\">榆林美程假日旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林市山丹丹旅行社有限公司</p>\n\n<p style=\"text-align: center;\">榆林市大洋旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林市美佳利得旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林卓越旅行社有限公司</p>\n\n<p style=\"text-align: center;\">陕西塞上天骄旅行社有限公司</p>\n\n<p style=\"text-align: center;\">榆林市德行旅行社有限公司</p>\n\n<p style=\"text-align: center;\">榆林市海华旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林市山丹丹旅游社绥德分社</p>\n\n<p style=\"text-align: center;\">神木市神旅文化旅游有限责任公司</p>\n\n<p style=\"text-align: center;\">神木市麟州星光旅游有限公司</p>\n\n<p style=\"text-align: center;\">神木市驰骋旅行社有限公司</p>\n\n<p style=\"text-align: center;\">靖边县夏都旅行社</p>\n\n<p style=\"text-align: center;\">陕西洲际国际旅行社靖边分公司</p>\n\n<p style=\"text-align: center;\">靖边县阜美旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">陕西信天游国际旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林中万旅行社有限公司</p>\n\n<p style=\"text-align: center;\">榆林市山丹丹旅行社有限公司府谷分社</p>\n\n<p style=\"text-align: center;\">榆林市山丹丹旅行社有限公司清涧分社</p>\n\n<p style=\"text-align: center;\">吴堡县华夏石城旅行社有限公司</p>\n\n<p style=\"text-align: center;\">陕西途悦假日旅游有限责任公司</p>\n\n<p style=\"text-align: center;\">陕西盛世华堂旅行社有限责任公司</p>\n\n<p style=\"text-align: center;\">榆林市三边国际旅行社</p>\n\n<p style=\"text-align: center;\">榆林市康乐旅行社有限责任公司靖边分公司</p>\n\n<p style=\"text-align: center;\">定边县大漠旅游行社有限公司</p>\n\n<p>（4）电影院（25家）</p>\n\n<p style=\"text-align: center;\">文星影城有限公司</p>\n\n<p style=\"text-align: center;\">紫金城影院有限公司</p>\n\n<p style=\"text-align: center;\">榆林华夏国际影城</p>\n\n<p style=\"text-align: center;\">榆林光影界影视文化有限公司（奥斯卡影城古城店）</p>\n\n<p style=\"text-align: center;\">陕西星天地国际影城有限公司</p>\n\n<p style=\"text-align: center;\">陕西星天地国际影城有限公司国贸荟分公司（中影星天地国际影城）</p>\n\n<p style=\"text-align: center;\">榆林丰泽鑫影城有限公司</p>\n\n<p style=\"text-align: center;\">榆阳区容大国际酒店有限公司</p>\n\n<p style=\"text-align: center;\">榆林奥斯卡影城有限公司</p>\n\n<p style=\"text-align: center;\">中影爱国者国际影城有限公司</p>\n\n<p style=\"text-align: center;\">文投国际影城大剧院店</p>\n\n<p style=\"text-align: center;\">文投国际影城凯信店</p>\n\n<p style=\"text-align: center;\">榆林阳光影院</p>\n\n<p style=\"text-align: center;\">榆林新港时代影城镇川店</p>\n\n<p style=\"text-align: center;\">吴堡县大世界影城</p>\n\n<p style=\"text-align: center;\">有约影视文化传媒有限公司</p>\n\n<p style=\"text-align: center;\">华夏星光影城管理有限公司</p>\n\n<p style=\"text-align: center;\">神木市新村艺术中心影城</p>\n\n<p style=\"text-align: center;\">锦界华夏影城</p>\n\n<p style=\"text-align: center;\">神木大兴影院</p>\n\n<p style=\"text-align: center;\">神木市皇冠影城</p>\n\n<p style=\"text-align: center;\">横山区龙泰国际影城</p>\n\n<p style=\"text-align: center;\">江美文化传媒有限公司</p>\n\n<p style=\"text-align: center;\">金字塔文化影视有限公司</p>\n\n<p style=\"text-align: center;\">神木市未来金麟影视文化有限公司</p>\n\n<p>八、发行要求：</p>\n\n<p>1、商户入驻审查：严格遵循合法、自愿、公平、诚信原则，积极参于2023年&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券活动，所有商户需是在榆依法注册的企业，经营状况及信用良好，无重大失信、违法违规等行为，无发生重大人身安全责任事故，所提交商户资料真实有效。</p>\n\n<p>2、安全责任：严格落实企业安全生产主体责任，加强经营场所的各类安全隐患排查，防止各类安全生产责任事故的发生，足额购买相应保险，保障消费者的人身及财产安全。</p>\n\n<p>3、产品服务承诺：严格按照消费券发行文件、实施细则和商户使用手册等要求，通过发行平台进行商户入驻、产品上架，做好客户接待服务、核销等工作。通过各种方式配合做好营销宣传工作，主动向消费者做好活动的解释及引导工作。不得变相加价，不得以虚假商业信息欺骗、误导消费者，对举报、投诉及争议等事宜积极主动配合相关部门做好沟通、解释、协调等处理工作，保障消费者合法权益。因商户所提供的产品和服务引发的消费者投诉或争议商户自行解决并承担由此产生的责任。</p>\n\n<p>4、核销要求：各商户须及时在发行平台提交消费券使用过程中产生的真实凭证。旅行社提供系统核销账单确认件、旅游合同、保单、游客在各景区的合影照片、车餐宿发票（游客完成酒店定位打卡，旅行社确保系统抓取定位符合实际定位范围，否则不予兑付）。</p>\n\n<p>5、严禁事项与责任承担：严禁任何个人或商户串通套现，严格落实2023年榆林市文旅电子消费券核销规则，杜绝出现刷单等违法违规交易。商户确保相关消费券核销记录、打卡记录的真实有效，不得以任何形式自行篡改数据或伪造数据，不得以任何方式协助他人虚假交易，保证每张文旅电子消费券与实际交易信息相符。</p>\n\n<p>6、款项兑付：在每个发行周期结束后，商户在发行平台下载已核销账单，核对确认后，加盖公章并上传提交。最后根据第三方审计公司审计结果，向各商家兑付相应补贴款项。商户及游客需严格按照消费券发行文件要求完成本次发行任务。任何个人及商户不得串通套现，一经查实有违法违规行为，自动取消参与资格，并全额退还补贴资金，同时承担相应法律责任。</p>\n\n<p>本次《榆林市&ldquo;畅游榆林&middot;券享生活&rdquo;文旅电子消费券》（试行）发行任务最终解释权归榆林市文化和旅游局；如有不妥，请广大市民、来榆游客、商家提出宝贵意见，便于我们及时更正。</p>\n\n<p>咨询电话：0912-3358881</p>\n\n<p>投诉电话：0912-3422816，0912-3282163</p>\n');
